.de. Neukunden legen ihr Benutzerkonto einfach und bequem direkt über die App an. \nDB Handy-Tickets können für die meisten DB Verbindungen gebucht werden.\nAuch das City-Ticket ist für BahnCard-Kunden bei Fahrten über 100km inklusive.\nIhr aktueller Reiseplan ist mit Ihrem Ticket immer direkt zur Hand, inkl. aller Umstiegs- und Pünktlichkeitsinformationen.\n\nSparpreis-Finder: \nLassen Sie sich direkt über die App bequem die attraktiven Sparpreise des Fernverkehrs anzeigen und buchen Sie direkt.\n\nNavigationshilfe:\nWie Sie am schnellsten zum Bahnhof kommen? Die Straßenkarte im DB Navigator zeigt es Ihnen. Dank der integrierten GPS-Ortung wird Ihre aktuelle Position als Standort verwendet.\n\nStandortbestimmung mit Augmented Reality: \nDie optimale Orientierungshilfe, besonders, wenn Sie sich nicht auskennen: Einfach Kamera-Symbol in der Standort-Suche drücken, Umgebung durch die Kamera betrachten und sofort werden umliegende Haltestellen im Bild eingeblendet inklusive Entfernungsangabe. \n\nVerbindungs- & Fußwegsuche\nIhre Reise braucht keine Umwege. Die Routing-Funktionen zeigen Ihnen die nächsten Haltestellen und Stadtpläne vor Ort. \nNatürlich können Sie eine Adresse als Start- oder Zielpunkt anstelle einer Haltestelle definieren.\nSo finden Sie immer den richtigen und kürzesten Weg von Tür zu Tür.\n\nFlinkster- & Call a Bike-Finder:\nZielort erreicht. Und wie geht es weiter? Steigen Sie doch einfach um. Der Flinkster- & Call a Bike-Finder zeigt Ihnen die nächsten Stationen der DB Mietwagen und Fahrräder vor Ort.', '2009-12-15 16:00:00', '2014-05-23 15:01:09')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
