Error - 2014-05-23 15:01:34 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('426355372', 'JP', 'jp.gnresound.mosquitone.iphone', '耳年齢チェック！iPhone版', 'http://a1346.phobos.apple.com/us/r30/Purple/75/70/93/mzl.rfnkqjuv.53x53-50.png', 'http://a1862.phobos.apple.com/us/r30/Purple/75/70/93/mzl.rfnkqjuv.75x75-65.png', 'http://a1539.phobos.apple.com/us/r30/Purple/75/70/93/mzl.rfnkqjuv.100x100-75.png', '0.00000', 'JPY', 'GN Resound Japan K. K.', 'iOS_Apps', '6013', 'topfreeapplications', 0, '☆☆☆☆☆バージョンアップ情報☆☆☆☆☆\n\n65万人の方に遊んでいただいている耳年齢\nチェックゲームがバージョンアップ!\n新機能は目で観る耳年齢。音を周波数ごとに解析して、グラフに表示するので、様々な音を目で確認できます。\nあなたがしゃべった声、手をたたいた音などリアルタイムにビジュアル表示します。\nモスキート音が聞こえない方でも視覚的に\n鳴っていると分かるようになりました。\n\n☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆☆\n\nVer2.0追加機能\n\n1. メニュー追加\n2. 「目で観て確認」機能追加\n3. 聞こえのQ&A追加\n4. モスキートキャラクター変更\n\nVer2.0修正\n1. ボタンを押した時の気になるぷちっと音を修正しました。\n2. iOS5に対応しました。\n\n補聴器メーカーのジーエヌリサウンドジャパンより耳年齢チェックゲームが登場!\n\n視力、身長、体重などと違い、意外に知っている人の少ない自分の聴力レベル。\n人間の耳は20Hzから20,000Hzの周波数を聞き分けることができるといわれています。\n聴力の低下は思いのほか早く、20代より徐々に始まるというのが定説です。\n特に、周波数の高い音は年齢とともに徐々に聞きにくくなっています。\n\n「モスキート音」をご存知ですか?\nもともとはイギリスのセキュリティーシステム用に開発され、\n「大人には聞こえない携帯着信音」として日本でも密かなブームになっています。\nモスキートゲームアプリケーションであなたの耳の実年齢をチェックしてみましょ\nう。\n\n操作は簡単!アプリケーションをインストールして起動したら、\nあなたが該当する年齢の「再生」ボタンを押すだけです。\n\n※モスキートゲームは病院で行われている聴力検査とは異なり、\nあくまでも簡易な耳年齢チェックゲームです。普段の会話でも\nよく聞こえない音がありご心配の場合には、耳鼻科医師にご相談ください。\n※実際に会話での聞き取りに必要な音は250Hzから3,000Hzの\n周波数帯に集中しているため、日常生活の会話などで支障が出てくるのは\n健康なきこえの方で、50歳代前後からはじまるといわれています。', '2011-03-22 12:24:56', '2014-05-23 15:01:34')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:01:36 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('799315677', 'JP', 'com.voltage.metr2', '新･生存率0%！地下鉄からの脱出', 'http://a1853.phobos.apple.com/us/r30/Purple6/v4/52/20/da/5220da0e-6280-b2cb-2642-ef3ba4bda428/mzl.fwmrvykm.53x53-50.png', 'http://a369.phobos.apple.com/us/r30/Purple6/v4/52/20/da/5220da0e-6280-b2cb-2642-ef3ba4bda428/mzl.fwmrvykm.75x75-65.png', 'http://a1646.phobos.apple.com/us/r30/Purple6/v4/52/20/da/5220da0e-6280-b2cb-2642-ef3ba4bda428/mzl.fwmrvykm.100x100-75.png', '0.00000', 'JPY', 'Voltage inc.', 'iOS_Apps', '6014', 'topfreeapplications', 0, '■簡単操作のノベル型サスペンスゲーム■\n\nアナタの選択が運命を決める！マルチエンド方式のサスペンスノベルゲーム！\n\n--------------------------\n\n◆ストーリー◆\n\n深夜の地下鉄。\n互いの名前も知らない14人の乗客が、各々の理由で終電に乗り込む。\nしかし、突然暴走した電車が、彼らを絶望へと導く･･･\n\n一人、また一人と命を散らす乗客たち。\n\n「この中に犯人がいる!?」\n\n疑心暗鬼の中、この死の地下鉄からアナタは脱出できるのか･･･？\n\n--------------------------\n\n◆ゲーム概要◆\n\n『新･生存率0％！地下鉄からの脱出』は、無料で遊べるノベル形式のサスペンスゲームです\n毎日３枚無料で付与されるチケットを使い、画面タップで読み進めるカンタン操作。\nゲーム途中の選択肢によって、数多くの結末が用意されています。\nいち早く脱出するか、全てのエンディングを見るか･･･\n遊び方はアナタ次第！\n\n--------------------------\n\n◆ストーリーボリューム◆\nストーリーはキャラクター毎に20話用意されています。\n1キャラでエンディングは30種類以上ありますが、真のエンディングは1つです。\n\n--------------------------\n\n◆主な新機能◆\n・1キャラ30個以上、全90個以上のエンディングを追加\n・選択肢等でのダメージを廃止\n・チケットで読み進めるゲームシステムに変更\n・ストーリーマップなど、直感で操作できるインターフェイスを導入\n\n--------------------------\n\n【推奨端末】iPhone5S、iPhone5C、iPhone5、iPhone4S、iPhone4、iPad（第2世代～）、iPad mini、iPod touch第5世代～\n【推奨OS】ios5.0～ \n【非推奨端末】iPhone3GS、iPhone3G、iPad（第1世代）、iPod touch (～第4世代)', '2014-04-21 16:00:00', '2014-05-23 15:01:36')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
