側画像を追加\n*名刺メモ情報を追加\n\n【スマート管理】\n* 　全画面で名刺を表示\n*名刺認識結果を携帯電話のアドレス帳や電子名刺入れ或いはGmail、Exchangeに保存\n*ソート、分類、検索、メール一括送信、エクスポート等の方法連絡先を管理\n*名刺を選択して連絡先情報によって電話、SMS送信、メール送信、名刺上のウェブサイトにアクセス、またマップで位置確認\n*パスワードで連絡先情報を保護\n\n【便利に共有】\n*メール、SMSで名刺共有\n*QRコード作成、QRコードで名刺共有\n*名刺をvCardやExcelにエクスポート\n*LinkedInの中で連絡先を検索、連絡先にLinkedIn招待を送信\n\n【クラウド同期】\n*アカウントを登録してログインすると、オンラインで連絡先情報を確認でき、誤削除した連絡先もいつでもリストア。\n*携帯電話、タブレット、パソコンもクラウドでいつでも名刺情報を同期、更新\n\n名刺認識管理(CamCard)を気に入っていただけましたら、或いはご意見がございましたら、少しお時間をいただき、名刺認識管理(CamCard)のご評価或いはisupport@intsig.comまでご連絡をお願いします。商品の改善へのご協力により更に多くの優れた機能を体験していただけますよう努力して参ります。\n\n-----アドバイス-----\n弊社製品ご使用の際に、よりよい効果を得るため：\n*画像が鮮明であればそれだけ認識精度も高まります。「明るい場所で、極力手ぶれの少ない状態で撮影してください」\n*画像が大きければそれだけ認識精度も高まります。「撮影する際には画像が大きくディスプレイに表示されるようにしてください」\n\nTwitterで私達をフォロー@camcardintsig\nFacebookで私達をフォローCamCard\nGoogle+で私達をフォローCamCard\n\n-------弊社の他のアプリケーション-------\n------- CamScanner \n* 　　App Store 2011年度セールスナンバー１アプリケーション\n* 　　App Store 2012年度セールスナンバー１有料アプリケーション\n*全世界4000万人以上のユーザー、3000以上の教育機関、60以上の国・地域で使用されるスキャンアプリ！\n*｢CamScannerは特別な画像処理技術でドキュメントがより読みやすくなる｣—Makeuseof.com\n*｢間違いなくCamScannerは携帯電話で一番のスキャナーアプリ｣—CNET.com\n\n\n-------CamDictionary\n*  App Store 2011年度ナンバー１人気辞書/辞典アプリケーション\n*  App Store 2012年度ナンバー１有料アプリケーション', '2010-04-06 20:57:23', '2014-05-23 15:01:53')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:01:54 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('608515289', 'JP', 'net.WeatherMate.WeatherMate', 'ウェザーメートプロ - ライブ気象レポート、10日間の予報、レーダーマップ、および悪天候警報', 'http://a1105.phobos.apple.com/us/r30/Purple4/v4/82/62/f8/8262f8f7-505b-e037-3522-8bf9811aaf33/mzl.fshagaic.53x53-50.png', 'http://a1621.phobos.apple.com/us/r30/Purple4/v4/82/62/f8/8262f8f7-505b-e037-3522-8bf9811aaf33/mzl.fshagaic.75x75-65.png', 'http://a1138.phobos.apple.com/us/r30/Purple4/v4/82/62/f8/8262f8f7-505b-e037-3522-8bf9811aaf33/mzl.fshagaic.100x100-75.png', '100.00000', 'JPY', 'Muhammad Ibraheem', 'iOS_Apps', '6001', 'toppaidapplications', 0, 'あなたの新しい相棒をよろしく- ウェザーメート. アップストアで最も美しく正確な天候アプリ。 \n\nウェザーメートは、基礎的及び上級ユーザーの双方に最も正確な気象情報を提供してくれる最先端の気象予報と美しいユーザーインターフェースを組み合わせた新しい魅力的なアプリです。お天気アプリとは思えないほど直感的でチャーミング、そして、楽しい！ パワフルなウェザーツールとユーザーインターフェースの組み合わせたこのアプリはナンバーワンのお天気アプリです。\n\nこのアプリは、現在の気象状況、10日間の気象予報、10日間の毎時の気象予測、悪天候警報、天文情報、気温プッシュと凍結警報、そして、世界中のあらゆる地域の気象地図を動画で提供してくれます。320万以上の予め選ばれた場所から選択するか、あなたのデバイスのGPSを使ってあなたの現在の場所の予測を読み取ることができます。また、あなたの天気画面をキャプチャし、ソーシャルメディアを介して友達と共有することも可能です。もっと楽しさを加えるため、このアプリは、気象状況を声で知らせてくれます！今までに無かった方法で天気を体験しましょう。\n\nアップストアにある数ある他のアプリの中で何がこのアプリを差別化しているのか？\n\nローカル,現在地, 周辺\n\nウェザーメートは最も正確で信頼性の高い気象情報を確保するために業界のリーダーであるWeather Undergroundからの気象データを使用しています。それだけでは在りません。ウェザーメイトは最もローカライズされた気象データを提供するために、世界中に設置されている30,000+の個人気象観測所のネットワークを使用しています。あなたの自宅や職場に最も近い気象ステーションを選択するオプションがあります。\n\nこのアプリを使用することで、外を見て天気を確認することがなくなります。補償致します！\n\n機能\n\n● 最高10箇所の世界中の場所を同時に追加\n● 最寄りの気象ステーションカラの現在の気象状況\n● 10日間の予報 \n● 向こう10日間の時間毎の詳細な気象情報を含む1時間毎の予測\n● 最もローカライズされた気象データを得るために、希望の地域に最も近い気象ステーションを選択\n● 悪天候警報は、あなたに近寄る荒天からあなたを守る\n● 雲、雨、サテライト及びレーダーマップを含むインタラクティブ・ウェザーマップ。全て動画です！\n● あなたのホーム画面のアイコンのバッジに気温アラートをプッシュします。温度がゼロマークを通過したときに凍結アラートを通知。これらのアラートは、ロック画面と通知センターにも表示されます。アプリを実行していない時でも常に最新の気象情報を把握！\n● 自動的に現在の気象状況に合った魅力的な天候アニメーションの背景\n● 選択した場所のそれぞれの現地時間を表示するワールド・クロック\n● あなたの天気画面をキャプチャし、Facebook、Twitterやメール経由で友人と直接共有\n● ライブの気象状態と気温を聞く。そうです、アプリが話してくれます！\n● スワイプで選択した地域の切り替え\n● カスタム輝度コントロール\n● 全ての気象パラメータに独自の単位を選択。12と24時間の時間形式も選択可能\n● サウンドを基本にしたUIイベント\n● ユニバーサル・アプリ。iPhone, iPod Touch 及び iPad用に1つの天気アプリ \n● iPhone 5S及びiOS 7との完全な互換性\n● 豪華なレティナ・グラフィック(HD対応) \n\n詳細な気象情報\n\n● 現在の気温\n● 実感温度\n● 最高及び最低気温\n● 天気状況/アイコン\n● 風速と方向\n● 降水確率\n● 視界\n● 湿度\n● 気圧\n● 雲量\n● UVインデックス\n● 体感温度\n● 露点\n● 日の出時間\n● 日没時間\n\nサポート\n\nご質問やご意見がある場合は、設定画面のサポートタブの \"カスタマーサポートに連絡\"ボタンを使用するか、support@weathermate.netまでメールでお問い合わせください。あなたのフィードバックは我々にとって非常に大切です。\n\nwww.twitter.com/ WeatherMateAppでTwitterでフォロー、または、www.facebook.com/ WeatherMateAppでFacebookでファンになりましょう。', '2013-03-13 06:30:11', '2014-05-23 15:01:54')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:01:55 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('825089659', 'JP', 'com.appsverse.photonxphone', 'Photon X フラッシュブラウザプレイヤー - Flash無料音楽,動画&漫画ゲームダウンロード  for iPhone', 'http://a209.phobos.apple.com/us/r30/Purple/v4/b9/1d/b4/b91db41b-7280-fe36-7575-cce658eccc59/mzl.fnecrubd.53x53-50.png', 'http://a725.phobos.apple.com/us/r30/Purple/v4/b9/1d/b4/b91db41b-7280-fe36-7575-cce658eccc59/mzl.fnecrubd.75x75-65.png', 'http://a946.phobos.apple.com/us/r30/Purple/v4/b9/1d/b4/b91db41b-7280-fe36-7575-cce658eccc59/mzl.fnecrubd.100x100-75.png', '100.00000', 'JPY', 'Appsverse Inc.', 'iOS_Apps', '6002', 'toppaidapplications', 0, '\"iPhoneとiPadで「艦これ」をプレイするには、日本でよく使用されているFlashブラウザのPhoton Xブラウザをダウンロードすると良いでしょう。 \n\nステップ1 \n1) 稲妻ボタンを押してFlashモードを入れてください。 \n2) 次に「艦これ」のウェブサイトへ行きます。 \n\n日本国内にいれば、お使いのiPhoneまたはiPadからゲームをプレイできるはずです。 \n\nステップ2: \nゲームをプレイするにあたり、ステップ1で問題が発生した場合のみ、ステップ2をお試しください（日本国内ユーザーのみ）。 \n\n1) www.google.co.jpへ行きます \n2) Photon Browserの歯車アイコンをクリックしてCookieを消去します \n3) Photon Browserの歯車アイコンをクリックして、ローカルアクセス、IPの順にクリックします \n4) 稲妻アイコンをクリックしてFlashモードを入れます \n5) 「艦これ」ゲームへ移動します \nPhoton X Flashブラウザは、App Storeで一番人気の私たちの有料ブラウザを基にした、最新世代のFlashブラウザです。Photon XはiOS7に合わせた外観にアップデートされ、動画鑑賞が驚くほどスムーズかつ速くなる よう再設計された技術が組み込まれています。Photon X Flashブラウザがあれば、Flash動画を観たり、FacebookのFlashゲームをプレイしたり、Flashウェブサイトをブラウズすることができます。　 \n\n使い方 - Flashサイトを閲覧する場合は、稲妻ボタンを忘れずに押してください。Flash動画を一番良い状態で観るには、帯域幅を7に切り替えます。動画を観ているだけの時は歯車アイコン＞スムーズモードを有効にし、終了時は歯車アイコン＞動画モードに戻してください。IPの地理的位置に基づいてブロックされているローカルコンテンツやテレビウェブサイトを観る場合は、ローカルアクセスモードをオンにしてください。　 \n\nFlash対応に加えて、Photon Xはマルチタブ対応、インテリジェントURLバー、色のカスタム、プライベートブラウジング、デスクトップブラウジング、など他にも多くの機能を持った高度ブラウザです。', '2014-03-22 06:18:25', '2014-05-23 15:01:55')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:01:57 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('382069612', 'JP', 'se.resenatverket.FlightRadar24', 'Flightradar24 Pro', 'http://a158.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.53x53-50.png', 'http://a1026.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.75x75-65.png', 'http://a1983.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.100x100-75.png', '300.00000', 'JPY', 'Flightradar24 AB', 'iOS_Apps', '6003', 'toppaidapplications', 0, 'あなたの携帯やiPadをエアートラフィックレーダーに変えて、日本の周りや世界中を飛ぶ飛行機をリアルタイムで詳細な地図上で見てみましょう。アップル機器を空を飛んでいる飛行機にかざして、行き先その他を調べましょう。何百万人ものひとがなぜ Flightradar24を愛用しているのか。今日、ご自分で体験してみませんか。\n\nFlightradar2 アプリが25カ国以上でベストセラーとなった、また140カ国以上 (日本、米国、英国、ドイツその他) でベストセラーの旅行アプリとなった優れた機能には以下があります: \n* 詳細な地図上を飛行機が移動するのをリアルタイムでご覧になれます\n* 機器を空にかざすだけで、上空を飛んでいる飛行機を識別できます (GPS 搭載の機器が必要です)\n* 飛行機のパイロットがなにを見ているか、リアルタイムで 3Dで体験できます (iPhone 4S, iPad 2, iPod Touch 第5世代、+ iOS 6.0 以降のバージョンが必要となります)\n* 飛行機をタップすると、ルートや予想到着時間、実際の離陸時間、機種、速度、高度や高解像度の画像といった、全体的なフライトと機体の情報が表示されます\n* 便名や空港、航空会社で、個別のフライトを簡単に探せます\n* 航空会社、期待、高度、速度その他で簡単にフィルタリングできます\n* 簡単にお気に入りに追加でき、関心のある地域を迅速にナビゲーションできます\n* 機器を主要な航空の発着案内に合わせると、リアルタイムでフライトステータス更新と、現在の空港周辺の天候条件を見ることがをできます (アプリ内で別途ご購入いただいた場合)\n* リアリスティックな機体の記号 (アプリ内で別途ご購入\n* 航空会社、機種、便名または登録に基づいたカスタマイズされたアラートを設定する(アプリ内で別途ご購入) \n\nどのように機能するか\n今日、ほとんどの機体には、いわゆる位置データを送信する、いわゆるADS-Bのトランスポンダーが搭載されています。Flightradar24 は急成長中のネットワークで、世界中に数千のグループステーションを持ち、アプリ内の地図で機体が移動するのを示すこのデータを受け取ります。マルチラテレーションの助けを借りて、Flightradar24 はカバーする地域を拡大中であり、 ADS-B トランスポンダーを持たない機体の位置も計算可能となっています。\n\nアプリでは、米国連邦航空局 (FAA) からの直接的な情報供与により、従来のレーダーデータも利用されています。このデータは、米国とカナダの全空域をほぼリアルタイムでカバーします。\n\n***重要な通知***\nFlightradar24 アプリは英語で表記されています。が、テキストはほとんどなく、追加テキストが必要な際にも可能な限り周知の記号を使っています。\n\n特別の地域の飛行機の往来追跡にのみご興味がある場合には、アプリをご購入前に Flightradar24.com にてご確認ください。Flightradar24 は、他に類を見ないレベルの世界中の機体位置データを提供していますが、カバーされていない地域もあります。 \n\nカバレッジは随時変更される場合があります。\n\nFLIGHTRADAR24 にコネクトしよう\nFlightradar24 を Facebook でイイネ！して、Twitter でフォローしよう。\n\nヘルプ & サポート\nforum.flightradar24.com/threads/89-Important-Read-this-before-you-ask-questions\nflightradar24.com/contact-us.\n\n免責\nこのアプリの使用は、厳密に娯楽目的に限られています。特に、あなた自身や他の人々の命にかかわるような活動は、使用目的から除外します。いかなる状況においても、このアプリの開発者は、データの使用や解釈により、または本同意に反する使用から起こる事柄に対し、責任を負いません。弊社は、アプリ内のユーザーの活動を匿名で追跡・報告する権利を有します。', '2010-07-31 13:29:46', '2014-05-23 15:01:57')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
