一覧画面右下の「使い方、ヘルプ」により詳しい説明を載せております。\n\n◆◆◆おススメチェックのポイント◆◆◆\n試作の段階からいろいろご意見頂き基本的なチェックポイントを何点かご紹介いたしますので、よろしければご参考にして下さい。\n\n1、右後方から録画した場合\nアドレスの画面でラインを肩→ボール、へそ→ボールの2本の直線をひき、頭の部分に○を記入\n＊チェックポイント:2本線からクラブヘッドがはみ出てないかチェック。インパクトまで頭が丸からずれていないかチェック(インパクト時は少々頭が沈んでいるのはOK)\n\n2、正面から録画した場合\nアドレスの画面で両足の中心から垂直に2本線、頭に○、両ひざに○を記入\n＊チェックポイント:トップの位置で頭、ひざ、体全体が右に(画面では左)に大きくずれていないかチェック。インパクトで左ひじが曲がっていないチェック\n\n上記はほんの一例です、レッスン書やゴルフ雑誌、レッスンプロや上級者の方の意見を参考にベストスコアー更新されることを祈念いたします。', '2010-09-01 16:00:00', '2014-05-23 15:01:59')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
