\n」ユーリ（日刊Appliv） \n\nーーーーーーーーーーーーー\n操作方法\nーーーーーーーーーーーーー\n◇ 投稿フィールドは左右にフリックすることでカーソルが移動。 \n◇ タイムラインを長押しで各種機能を呼び出し。 \n◇ タイムラインを左フリックでツイートに含まれるコンテンツを呼び出し。 \n◇ Homeタブ長押しでUserStreamに接続\n◇ タイムライン上のアイコンをタップでユーザーに関する情報を閲覧 \n◇ タイムラインをタップで複数リプライも簡単に。 (タップの動作をお気に入り登録等に設定することも可能) \n\nーーーーーーーーーーーーー\n投稿ブックマークレット\nーーーーーーーーーーーーー\njavascript:window.location=\'nightfoxduo://\'+encodeURIComponent(document.title)+\'%20\'+window.location\n\nーーーーーーーーーーーーー\nwiki(機能要望・バグ報告・アップデート予定など): \nーーーーーーーーーーーーー\nhttp://www58.atwiki.jp/nightfox/\n\n\n\n※当アプリはインディーズアプリです。品質やサポート等企業のアプリと異なります。ご理解の上ご購入ください。\nまた他のアプリに比べアップデートの頻度が早い為、どんどん仕様が変化します。\nアップデートの管理や仕様変更に対応出来ない方は購入をお控え下さい。', '2012-09-12 16:00:00', '2014-05-23 15:02:00')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
