サービス: Twitter, Instapaper, Pocket, Readability, Tumblr, Evernote, Facebook 他計13 \n・ブックマーク、履歴、ページリジューム、記事検索、ビルトインYouTubeプレイヤーなど', '2012-01-17 08:38:52', '2014-05-23 15:02:06')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:02:10 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('862469459', 'JP', 'com.wac.orbis', 'オービス警報 - オービス&渋滞', 'http://a72.phobos.apple.com/us/r30/Purple4/v4/df/ed/57/dfed5755-a29a-cad0-ce3a-e7ceb8e7575d/mzl.zaullzlv.53x53-50.png', 'http://a940.phobos.apple.com/us/r30/Purple4/v4/df/ed/57/dfed5755-a29a-cad0-ce3a-e7ceb8e7575d/mzl.zaullzlv.75x75-65.png', 'http://a1897.phobos.apple.com/us/r30/Purple4/v4/df/ed/57/dfed5755-a29a-cad0-ce3a-e7ceb8e7575d/mzl.zaullzlv.100x100-75.png', '300.00000', 'JPY', 'WAC.com Co.,Ltd', 'iOS_Apps', '6010', 'toppaidapplications', 0, '◆安全・快適！これ一本でオービスも渋滞も！◆\nバックグラウンドでナビアプリと併用可能！\n◇AppStore 有料【総合】で２位を記録！\n有料【ナビゲーション】1位継続中！\n記念キャンペーン実施中\n販売価格：300円←500円（40%OFF）\nキャンペーン期間：5月31日まで\n\n■□■ オービス警報 の特徴■□■\nオービス、取締ポイントをアイコン、警報画面、警報音声でお知らせ。うっかりスピードの出し過ぎを防ぎ、安全運転をサポートします。\n\n◇最新オービスデータで安心！\n・新東名、東京ゲートブリッジなど最新のオービスデータに対応\n　2014年度最新情報を収録（2014年5月現在）\n・取締りポイント（ネズミ捕り）1000箇所以上\n\n◇渋滞も一目でわかる！\n・地図上に交通状況を表示して渋滞情報を確認可能。\n\n◇普段お使いのナビアプリと併用可能！\n・バックグラウンドモードを有効にすることで、通知センターと音声で警報\n・標準マップやグーグルマップなど、普段お使いの地図・ナビアプリにオービス機能を併用することが可能です。\n\n◇利用期限なし！安心の買い切りアプリ\n・市販のレーダー探知機と同様、一度購入すれば期限切れを気にせず、ずっと使えるお得なアプリです。\n\n\n(1).オービス・取締りポイント\n・三栄書房のオービスデータを収録*\n・オービス 644箇所\n　　LHシステム\n　　ループコイル式オービス\n　　Hシステム\n　　レーダー式オービス\n・取締りポイント 1046箇所\n\n(2).地図表示\n・地図上にオービス、取締りポイントのアイコン表示\n・高速/一般、高速道のみ、一般道のみの表示・警報切り替えが可能\n・グーグルマップ地図\n・交通状況表示\n・GPS速度計\n\n(3).警報機能\n・オービス、取締りポイントに接近すると警報音声と警報画面を表示\n・進入角度・通過判定を行い、対向車線の警報を除外\n・音量設定、BGMのフェード\n\n(4).バックグラウンドモード\n・通知センターで警報表示\n・バックグラウンドで警報音声\n・別のナビ・地図アプリで同時利用が可能\n※バックグラウンドでお使いになる場合は、設定でバックグラウンドを有効にしてからお使いください。（デフォルトはOFFになっております）\n\n(5).省電力モード\n・CPU負荷の高い処理を抑制しバッテリーの消費を抑える省電力モードを実装\n・バッテリー駆動でのご利用の際は省電力モードを有効にしてお使い下さい。\n・省電力モードは同時に熱対策にも有効です。\n\n■動作環境\n・iOS7.0以降\n・iPhone5s/5c/5, iPhone4s\n・iPad Air, iPad第4世代～iPad2 *\n・iPad mini with Retina / iPad mini*\n・iPod touch 第5世代 *\n\n※iPadシリーズ Wi-Fiモデルおよび、iPod touchはGPSが内蔵されておりませんので外付けGPS機器とインターネット接続環境を併用することで利用可能となります。\n※iPadシリーズ ではiPhone互換モードで動作します。\n\n■ご購入前のご注意\n※本アプリはインターネットに接続する環境が必須となりますので予めご了承下さい。\n※GPSスピードメータはGPSの測位差により速度を計測しますので1〜２秒のタイムラグが発生します。予めご了承下さい。\nまた、GPSの受信状況により必ずしも正確な速度表示を保証するものではありません。\n※車のスピードメータは保安基準により実速よりも高い速度が表示されます。\nそのため、GPSスピードメータの指し示す速度が低く表示されますので予めご了承下さい。（速度表示補正可能）\n【保安基準】スピードメーター 40km/h\n平成18年まで製作車：実速 31.0～44.4(km/h)\n平成19年以降製作車：実速 31.0～40.0(km/h)\n\n■利用上の注意\n1.ご利用の際は交通法規を遵守して運転してください。万が一お客様が本アプリを使用中に事故等を起こした場合であっても弊社は一切責任を負いません。 \n2.本アプリは安全運転をしていただくためのアプリケーションです。\n3.建物内やトンネルなど場所によりGPSが受信できない、もしくは正確な位置を特定できないことがあります。 \n4.本アプリはGPSを利用して現在位置を取得しているため、バッテリーの消耗が早くなりますので、ご注意下さい。\n5.本アプリは電力を消費しますので十分に充電されているか、シガー電源等で給電可能な状態でのご利用をお勧めします。 バッテリー駆動の場合は省電力モードを有効にしてお使いください。\n6.アプリケーションをバックグラウンドで使用し続ける場合、バッテリーの消費にご注意下さい。\n7.iPhoneを車に取り付けてお使いになる場合にはなるべくエアコンの送風が少しでもあたる位置に設置することをお勧めいたします。また本体が熱くなる場合は省電力モードをONにしてお使いになるとかなり効果的です。\n\n■収録データと免責事項\n・三栄書房のオービスデータを収録しています。\n本製品に搭載されているオービス及びスピード取締りポイントデータは、必ずしも日本全国に設置されているオービス及びスピード取締りポイントの全数を網羅しているものではございません。また搭載データにより不利益が生じた場合でも弊社は補償責任は一切ございませんのでご了承下さい。\n\n・一部弊社独自調査によるPOIデータが含まれます。\n\n※本製品の詳しい情報は弊社製品サイトを御覧ください。\nその他、不具合の報告ご要望等ございましたらば \nぜひ、サポート宛にメールをお願いします。 \n\n\npowered by navico.\n\n--------------------------------------------------- \n◇◇◇ 通信欄 v1.2.0 ◇◇◇ \n[2014/05/21]\n本日アップデータv1.2.0をリリースいたしました。\n詳細は下覧の「新機能」の項目をご参照下さい。', '2014-04-18 17:19:28', '2014-05-23 15:02:09')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
