\n•待ち受け画像に設定して常に名言を意識する\n•家族や友人にメールやLINEで名言を贈る\n•Twitterで名言の実行を宣言する\n\n\n◆名言カテゴリ一覧◆\n\n愛　恋　男女　結婚　結婚反対　教育　人間関係　赦し　学び　年齢　時間　社会　世界　平和　幸福　人生　道　夢　意志　継続　努力　行動　才能　仕事　失敗　挑戦　勇気　真理　美　お金\n\n\n掲載名言数　700\n掲載偉人数　300人以上\n\nーーーーーーーーーーーーーーーーーーーーーー\n\n※ロック画面からリマインダー通知が消えてしまうという方へ\nロック画面から通知が消えた場合、その通知は「通知センター」の中に表示されています。「通知センター」はiPhoneの画面上部の時刻が表示されているあたりをタップして、画面下部に引っ張るようにすると出てきます。「通知センター」はどのアプリを使っているときでも見ることができます。この「通知センター」の中の通知をタップするとアプリを起動できます。', '2012-11-25 19:26:39', '2014-05-23 15:02:17')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
