Error - 2014-05-23 15:02:31 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('529443604', 'JP', 'com.revivasoftworks.Snore-Lab', 'いびきラボ (SnoreLab)', 'http://a1520.phobos.apple.com/us/r30/Purple4/v4/73/52/d5/7352d538-30ba-7abe-0965-327c0704895a/mzl.lrdkpfmw.53x53-50.png', 'http://a388.phobos.apple.com/us/r30/Purple4/v4/73/52/d5/7352d538-30ba-7abe-0965-327c0704895a/mzl.lrdkpfmw.75x75-65.png', 'http://a1441.phobos.apple.com/us/r30/Purple4/v4/73/52/d5/7352d538-30ba-7abe-0965-327c0704895a/mzl.lrdkpfmw.100x100-75.png', '200.00000', 'JPY', 'Reviva Softworks Ltd', 'iOS_Apps', '6020', 'toppaidapplications', 0, 'iOSナンバー1のいびき分析アプリを使って、あなたのいびきを録音、測定、そして軽減しませんか。医師も推奨しています! \n\nいびきラボでは、音波分析を使っていびきを録音・測定することで、効果的ないびきの軽減方法が明らかになります。\n\n「このアプリは驚くべき発見です。これで初めて、自分のいびきをコントロールできると感じました。いびきラボありがとう!」\n\n「いびきラボは、これまで私が使った最高の睡眠レコーダーです。2週間少しでいびきが40パーセント以上減りました。」 \n\n▷ 30カ国で上位10位以内の医療アプリ \n▷ 33カ国で「What’s hot」として注目される医療アプリ \n▷ 「Lifehacker」、「Quantified Self」その他で特別記事掲載\n▷ 「HealthTap」で最高水準の米国の医師が推奨 \n\n特徴: \n▷ 高度ないびき検出アルゴリズム\n▷ いびきの音のサンプルを録音\n▷ いびきの強度を測定 (いびきスコア)\n▷ 睡眠統計を録音\n▷ 音ファイルをEメール送信\n▷ いつ、どのようにいびきが激しかったかを表示\n▷ 複数の夜間を通していびきの比較が可能\n▷ いびき対策の情報を提供\n▷ 試したいびき対策の効果についてテスト実施\n▷ アルコールなど、特別な要因によるいびきへの影響を表示\n▷ 容易な使用法、校正の必要なし\n▷ 100,000を上回るダウンロード数\n▷ 毎晩1,000以上の人々が使用!\n\nいびきラボは簡単で楽しく使え、洞察力に富み、強力な機能でいびきに悩む人々を支援します。多くのユーザーが、このアプリを使っていびきの軽減に成功したと報告しています。\n\nあなた、またはあなたのパートナーがいびきでお悩みなら、今日すぐにダウンロードしませんか! あなたのいびきスコアは?\n\nSnoreLabは、400名を超えるユーザーからのレビューで平均4.7星の評価を獲得しています。以下のような感想をいただいています: \n\n「このアプリは本当に素晴らしい。絶対に誰にでも必要だと思います:)」\n\n「驚くべき、役に立つアプリ- 私が寝ている間に何が起こっているのかがわかるようになりました」\n\n「このアプリは、機能的に役立つばかりでなく、簡単に使えるところがすごいです。健康増進に向けてシンプルで効果的なツールです。」\n\n「最高のアプリです。リストされているいびき対策をいくつか試して、いびきが減りました。私自身も妻も感謝します。特に妻が大変感謝しています!」\n\n「私は医師ですが... このプログラムは役に立ち、医師に相談する際に非常に便利なものです。」', '2012-10-26 11:18:40', '2014-05-23 15:02:30')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
