/ミュート切り替えられます。\n・イメージ画像表示にはインターネット環境が必要です。画像以外のコンテンツはオフラインでも利用可能です。\n・イメージ画像はグーグル画像検索の結果を最大32件表示しています。カクテルによっては画像がネットから正しく表示されないことがあります。\n・「すべてのカクテル」等で検索ボックスを使った場合、レシピデータ量が多すぎるため、検索結果が表示される迄に時間がかかります。フリーズではありませんのでご注意下さい。\n・レシピの分量は、分量表記と分数表記の2種類が含まれています。\n\n-----------------------------\n要望や質問などはレビューに書かれてもお返事が出来ないとこがあります。\nお手数ですが、メールにてご連絡下さい。\ninfo(a)moverecrus.com', '2012-01-10 15:37:14', '2014-05-23 15:02:34')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
