*名刺裏側画像を追加\n*名刺メモ情報を追加\n\n【スマート管理】\n* 　全画面で名刺を表示\n*名刺認識結果を携帯電話のアドレス帳や電子名刺入れ或いはGmail、Exchangeに保存\n*ソート、分類、検索、メール一括送信、エクスポート等の方法連絡先を管理\n*名刺を選択して連絡先情報によって電話、SMS送信、メール送信、名刺上のウェブサイトにアクセス、またマップで位置確認\n*パスワードで連絡先情報を保護\n\n【便利に共有】\n*メール、SMSで名刺共有\n*QRコード作成、QRコードで名刺共有\n*名刺をvCardやExcelにエクスポート\n*LinkedInの中で連絡先を検索、連絡先にLinkedIn招待を送信\n\n【クラウド同期】\n*アカウントを登録してログインすると、オンラインで連絡先情報を確認でき、誤削除した連絡先もいつでもリストア。\n*携帯電話、タブレット、パソコンもクラウドでいつでも名刺情報を同期、更新\n\n名刺認識管理(CamCard)を気に入っていただけましたら、或いはご意見がございましたら、少しお時間をいただき、名刺認識管理(CamCard)のご評価或いはisupport@intsig.comまでご連絡をお願いします。商品の改善へのご協力により更に多くの優れた機能を体験していただけますよう努力して参ります。\n\n-----アドバイス-----\n弊社製品ご使用の際に、よりよい効果を得るため：\n*画像が鮮明であればそれだけ認識精度も高まります。「明るい場所で、極力手ぶれの少ない状態で撮影してください」\n*画像が大きければそれだけ認識精度も高まります。「撮影する際には画像が大きくディスプレイに表示されるようにしてください」\n\nTwitterで私達をフォロー@camcardintsig\nFacebookで私達をフォローCamCard\nGoogle+で私達をフォローCamCard\n\n-------弊社の他のアプリケーション-------\n------- CamScanner \n* 　　App Store 2011年度セールスナンバー１アプリケーション\n* 　　App Store 2012年度セールスナンバー１有料アプリケーション\n*全世界4000万人以上のユーザー、3000以上の教育機関、60以上の国・地域で使用されるスキャンアプリ！\n*｢CamScannerは特別な画像処理技術でドキュメントがより読みやすくなる｣—Makeuseof.com\n*｢間違いなくCamScannerは携帯電話で一番のスキャナーアプリ｣—CNET.com\n\n\n-------CamDictionary\n*  App Store 2011年度ナンバー１人気辞書/辞典アプリケーション\n*  App Store 2012年度ナンバー１有料アプリケーション', '2010-04-06 20:57:23', '2014-05-23 15:02:40')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:02:41 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('302955766', 'JP', 'com.weathernews.weather', 'ウェザーニュース タッチ', 'http://a1884.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.53x53-50.png', 'http://a400.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.75x75-65.png', 'http://a781.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.100x100-75.png', '0.00000', 'JPY', 'Weathernews Inc.', 'iOS_Apps', '6001', 'topgrossingapplications', 0, 'ようこそ、みんなで作る天気予報の世界へ！\n\nウェザーニュースタッチは、天気・季節・減災などの専門気象情報はもちろん、 いまこの瞬間のリアルタイムの空がわかる究極の天気予報アプリ（無料）です。\n \n全国600万人のウェザーリポーターから送られてくるリポートによって、 刻々と変わる「空の様子」や、周辺の人々の「体感」が手に取るようにわかります。 また、「ソラサーチ」という機能を利用すれば、 今あなたがいる場所に今後降ってくる雨の影響を 現地のリポートを元に詳細に知ることができます。\n 天気予報の精度は､観測データの量によって決まります｡ みなさんから寄せられる膨大な数のウェザーリポートは､ これまで150年間大きく変わらなかった天気予報の精度向上に 大きな一歩を踏み出しています｡\n このように、ウェザーニュースタッチは、従来の天気予報の限界を超えて、 詳細で正確な天気予報をみんなのチカラで創る全く新しいアプリなのです。\n\n 【よくあるお問い合わせ】\n 多く頂いたご意見につきまして、設定方法をお知らせ致します。 もっと便利に・もっと楽しくウェザーニュースタッチをご活用ください。\n\n ◆常にONになっているGPS機能を停止するには？\n 　マイページのソラミッション通知設定や、スマートアラーム設定をOFFにすると、\n 　GPS機能を停止することができます。その場合、エリア限定で配信される災害情報など、\n 　各種通知サービスがご利用頂けなくなりますので、ご注意ください。\n\n ◆起動画面を「天気予報Ch.」（ピンポイント天気）にするには？\n 　１）「天気予報Ch.」をMyスクリーンに登録\n 　　起動時に表示したい画面を開き、ツールバーの「＋」をタップします \n　２）「AllCh.」から「MyCh.」を立ち上げます\n 　　「編集」から「起動時の画面を設定」をタップ。\n 　　表示したい画面の上部にある「HOME」をタップすることで設定いただけます。\n 　※この方法で、天気予報Ch.以外にもお気に入りのChを起動画面に設定することができます。\n\n ◆ツールバーに「MyCh.」を設定するには？ \n　１）ツールバーの一番右にある六角形のアイコンを長押しします。\n 　２）「MyCh.」と「TOPのソラピース」のアイコンが表示されます。\n 　 　　「MyCh」アイコンを選択すると、ツールバーに「MyCh.」を設定できます。\n\n 【究極の天気予報アプリ】\n ウェザーニュースタッチには、定番の気象メニューが充実。 気象のエキスパート４００名が支えるお天気サイトの決定版です。\n ◆全２５チャンネルがあなたの生活を全力サポート\n 　▼ALL Ch.\n 　・今日明日週間の天気（天気予報、１０分天気予報）\n 　・気象災害対策Ch（地震、津波、台風、ゲリラ雷雨、警報注意報など）\n 　・専門気象Ch（雨雲レーダー、衛星、天気図、ライブカメラなど）\n 　・季節情報Ch（星空、さくら、花粉、花火、紅葉、スキー＆スノボ）\n 　・24時間生放送で天気を伝える動画番組Ch（SOLiVE24）\n◆スマートアラーム(通知サービス)\n 　スマートアラームの設定をONにしておくだけで、GPSによる位置情報をもとに、\n 　今いる場所の最新の気象情報を入手できます。\n 　 　(なお、バックグラウンドで位置情報(GPS)の利用は、バッテリーの消費量が大きくなる場合がありますのでご注意ください。)\n ◆ウェザーニュース会員（有料）登録について \n　スマートアラームやソラトモ機能など有料オプションの機能をご利用頂くには、「ウェザーニュース会員」（有料）をアプリケーション内でご購入手続きください。\n 　会員登録はご購入頂いた期間有効です。期間内に追加購入頂きますと、その期間分が加算されます。\n 　期間途中での解約に際し、返金は致しかねますのでご了承ください。\n 　自動更新にて、「ウェザーニュース会員」をご利用いただいている方へ\n - １ヶ月ごとの自動更新となります。\n - 月額 300 円です。\n - お支払いは iTunes よりご利用いただきます。\n - 現在有効期間満了の少なくとも24時間以上前に、自動更新を停止しない限り、自動的に更新されます。\n - ご購入後、[設定] - [iTunes Store/App Store] - [Apple ID] - [購読] の項目より、いつでも自動更新を停止していただくことができます。\n - 期間の途中で自動更新を停止していただいても、残りの有効期間については引き続きお使いいただけます。\n - 他のお支払い方法により、有効な期間が残存しているときに、新規に自動更新をご登録いただいた場合は、その残存期間については無効とさせていただきます。ご注意ください。', '2009-01-24 07:26:15', '2014-05-23 15:02:41')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:02:42 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('657795287', 'JP', 'com.square-enix.dqxtools', 'ドラゴンクエストⅩ　冒険者のおでかけ便利ツール', 'http://a564.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.53x53-50.png', 'http://a1080.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.75x75-65.png', 'http://a805.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.100x100-75.png', '0.00000', 'JPY', 'SQUARE ENIX INC', 'iOS_Apps', '6002', 'topgrossingapplications', 0, '================================\nドラゴンクエストⅩプレイヤー専用アプリです\n================================\n\n\n※※　はじめにご確認ください　※※ \nお使いの端末が以下のいずれかに当てはまる場合、アプリが正常に動作しない場合がございます。 \n\n・OSのバージョンが古い端末の場合\n・改造端末の場合\n・以下のような解析がされた端末の場合\n ---ソフトウェアの改造 \n ---ルート化等を含む解析\n ---リバースエンジニアリング\n ---逆コンパイル、または逆アセンブル　等\n\n\n【ご利用いただける機能】 \n『ドラゴンクエストⅩ』の世界をより一層お楽しみいただける『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』です！ \nこのアプリには、ゲームをしていないおでかけ先でも使える「ちょっと便利な機能」が搭載されています。 \n\n\n■キャラクター情報確認機能 \n自分のキャラクターの装備やパラメーターなどのプロフィール情報を確認できます。 \n\"サポート仲間雇われ情報\"やドラゴンクエストⅩ内でフレンド登録した相手キャラクターの状態が確認できる\"フレンド確認機能\"はもちろんのこと、その他にも、\"キャラクターの3D表示機能\"や、ドラゴンクエストⅩ内で所属しているチームの情報が確認できる\"チーム情報確認機能\"などの機能をお使いいただけます。 \n\n■郵便局機能 \n自分のフレンド宛てに手紙を送ることができます。また、郵便局に届いたお届け物も確認することができます。  \n\n■旅人バザー閲覧機能 \n「旅人バザー」に出品されているアイテムを条件をつけて検索したり、自分が出品しているアイテムの情報を確認することもできます。 \n\n■おしらせ確認機能 \nゲーム内での『ドラゴンクエストⅩ』運営スタッフからのお知らせを確認できます。\n\n■ライブカメラ \n「ドラゴンクエストⅩ」の世界がライブカメラ画像として映しだされます。画像は数十秒に一度更新されます。 \n\n■思い出アルバム \n「ドラゴンクエストⅩ」の世界で撮影した思い出アルバムの写真をおでかけ先で確認することができます。 \n\n\n■Ver2.0.1以降の新機能\n・チームクエスト閲覧機能の追加\n・元気チャージを元気玉に交換できる機能の追加\n・キャラクターの持ち物を確認できる機能の追加\n・ゴールド銀行からのゴールドの引き出し、預け入れができる機能の追加\n・郵便箱の手紙、アイテム、ゴールドを受け取る機能の追加\n・バザーの出品とりやめ機能の追加\n・プレミアムコンシェルジュ機能の追加\n\n\n≪プレミアムコンシェルジュについて≫\nプレミアムコンシェルジュでは以下のサービスがご利用いただけます。\n\n【こちらは有料のサービスになります】\n\n------------------------\n\n◆畑のお世話\nおでかけ便利ツール上から「ドラゴンクエストⅩ」内の畑に水をあげることができます。ご自身のキャラクター以外にフレンド、チームメンバー、自宅のご近所の方にも水をあげることができます。\n\n※畑のお世話機能に関しては「ドラゴンクエストⅩ」にログインした状態でもご利用いただけます。\n\n◆バザー落札\n旅人バザーに出品されているアイテムを、おでかけ便利ツールより落札することができます。\n\n◆バザー出品\n「ドラゴンクエストⅩ」内でお持ちのアイテムを、おでかけ便利ツール上から旅人バザーに出品することができます。\n\n◆元気玉をふくびき券に交換できるサービス\n「ドラゴンクエストⅩ」内でお持ちの元気玉・小元気玉・超元気玉を、元気玉の種類に応じた枚数のふくびき券に交換することができます。\n\n※ただし、一度に交換できるふくびき券は99枚です\n\n◆酒場サービス\nおでかけ便利ツール上からサポート仲間を雇うことができます。酒場サービスは町や村、キャンプ地、住宅村などフィールドやダンジョン以外の場所で「ドラゴンクエストⅩ」のゲームをログアウトしている場合にご利用いただけます。\n\n◆ふくびき所\nおでかけ便利ツール上から、「ドラゴンクエストⅩ」内でお持ちのふくびき券またはふくびき補助券を使用して、お好きな大陸のふくびき所をご利用いただけます。\n※「冒険者の便利ツール専用ふくびき所」もございます。\n\n------------------------\n\n\n≪ご注意≫\n\n※プレミアムコンシェルジュ機能をご利用の際には『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』上でのみ使用できる仮想通貨「ジェム」が必要となります。\n\n※ジェムはアプリ内のショップよりお買い求めいただけますが、初回サービスとして500ジェムをご利用のアカウント毎にプレゼントしております。また、毎日おでかけ便利ツールを起動するたびにもらえるデイリーボーナスもご用意しておりますので、無料でプレミアムコンシェルジュ機能をお使いいただくことも可能です。\n\n\n■お客様へのお願い\nお客様が「ドラゴンクエストⅩ」をよりお楽しみいただけるよう、本アプリの品質向上に努めておりますが、特定の端末でのみ発生する固有の不具合など原因調査が難しいものも多く、改善のためにお客様からの情報提供を必要としております。\n\nレビュー等の内容では原因特定に至らない場合も多いので、もし不具合が見つかりました際には、ぜひとも弊社サポートセンターまで詳細情報をご提供いただけますと幸いです。\n\n※アプリに関しての不具合やお問い合わせは\n　下記URLもしくはアプリ内からお問い合わせください。\n　スクウェア・エニックスサポートセンター\n　http://support.jp.square-enix.com/main.php?la=0&id=7901\n\n【使い方】 \n本アプリをご利用になるためには、「ドラゴンクエストⅩ　目覚めし五つの種族　オンライン」をオンラインモードでプレイしている「スクウェア・エニックス　アカウント」が必要です。 \n\nアプリを起動した後に、「はじめる」→「新しくキャラクターを登録」をお選びいただき、「スクウェア・エニックス　アカウント」を入力の上、「おでかけ便利ツール」に登録したいキャラクターを選択してください。 \n\n\n【ご注意】 \nおでかけ便利ツールに登録できるキャラクターは1キャラクターです。ただし複数キャラクターをお使いの方も、登録キャラクターを変更することで、おでかけ便利ツールをお使いいただけます。 \n　 \n登録しているキャラクターの変更をするためには、画面右上にある 「編集」ボタンを押し、キャラクター削除した後に再度キャラクター登録を行ってください。 \n\nまとめて複数キャラクターを登録しておきたい方のために、キャラクター登録チケットをアプリ内で販売いたします。一度このチケットをご購入いただければ、登録可能キャラクター数を最大限の10キャラクターまで増やせます。 \n\n【対応機種】 \niOS 5以上の機種 \n\n※OSのバージョンが古い場合、 \n　 正常に動作しない場合があります。 \n\n\n【非推奨機種】 \niPhone3GS \n\n※アプリが動かなくなった場合 \n　 バックグラウンドで起動しているアプリを \n　 完全に終了させて再度起動してください。 \n　 (操作方法についてはご使用の端末の \n　　マニュアル等をご参照ください。）', '2013-07-27 02:34:53', '2014-05-23 15:02:42')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:02:43 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('382069612', 'JP', 'se.resenatverket.FlightRadar24', 'Flightradar24 Pro', 'http://a158.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.53x53-50.png', 'http://a1026.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.75x75-65.png', 'http://a1983.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.100x100-75.png', '300.00000', 'JPY', 'Flightradar24 AB', 'iOS_Apps', '6003', 'topgrossingapplications', 0, 'あなたの携帯やiPadをエアートラフィックレーダーに変えて、日本の周りや世界中を飛ぶ飛行機をリアルタイムで詳細な地図上で見てみましょう。アップル機器を空を飛んでいる飛行機にかざして、行き先その他を調べましょう。何百万人ものひとがなぜ Flightradar24を愛用しているのか。今日、ご自分で体験してみませんか。\n\nFlightradar2 アプリが25カ国以上でベストセラーとなった、また140カ国以上 (日本、米国、英国、ドイツその他) でベストセラーの旅行アプリとなった優れた機能には以下があります: \n* 詳細な地図上を飛行機が移動するのをリアルタイムでご覧になれます\n* 機器を空にかざすだけで、上空を飛んでいる飛行機を識別できます (GPS 搭載の機器が必要です)\n* 飛行機のパイロットがなにを見ているか、リアルタイムで 3Dで体験できます (iPhone 4S, iPad 2, iPod Touch 第5世代、+ iOS 6.0 以降のバージョンが必要となります)\n* 飛行機をタップすると、ルートや予想到着時間、実際の離陸時間、機種、速度、高度や高解像度の画像といった、全体的なフライトと機体の情報が表示されます\n* 便名や空港、航空会社で、個別のフライトを簡単に探せます\n* 航空会社、期待、高度、速度その他で簡単にフィルタリングできます\n* 簡単にお気に入りに追加でき、関心のある地域を迅速にナビゲーションできます\n* 機器を主要な航空の発着案内に合わせると、リアルタイムでフライトステータス更新と、現在の空港周辺の天候条件を見ることがをできます (アプリ内で別途ご購入いただいた場合)\n* リアリスティックな機体の記号 (アプリ内で別途ご購入\n* 航空会社、機種、便名または登録に基づいたカスタマイズされたアラートを設定する(アプリ内で別途ご購入) \n\nどのように機能するか\n今日、ほとんどの機体には、いわゆる位置データを送信する、いわゆるADS-Bのトランスポンダーが搭載されています。Flightradar24 は急成長中のネットワークで、世界中に数千のグループステーションを持ち、アプリ内の地図で機体が移動するのを示すこのデータを受け取ります。マルチラテレーションの助けを借りて、Flightradar24 はカバーする地域を拡大中であり、 ADS-B トランスポンダーを持たない機体の位置も計算可能となっています。\n\nアプリでは、米国連邦航空局 (FAA) からの直接的な情報供与により、従来のレーダーデータも利用されています。このデータは、米国とカナダの全空域をほぼリアルタイムでカバーします。\n\n***重要な通知***\nFlightradar24 アプリは英語で表記されています。が、テキストはほとんどなく、追加テキストが必要な際にも可能な限り周知の記号を使っています。\n\n特別の地域の飛行機の往来追跡にのみご興味がある場合には、アプリをご購入前に Flightradar24.com にてご確認ください。Flightradar24 は、他に類を見ないレベルの世界中の機体位置データを提供していますが、カバーされていない地域もあります。 \n\nカバレッジは随時変更される場合があります。\n\nFLIGHTRADAR24 にコネクトしよう\nFlightradar24 を Facebook でイイネ！して、Twitter でフォローしよう。\n\nヘルプ & サポート\nforum.flightradar24.com/threads/89-Important-Read-this-before-you-ask-questions\nflightradar24.com/contact-us.\n\n免責\nこのアプリの使用は、厳密に娯楽目的に限られています。特に、あなた自身や他の人々の命にかかわるような活動は、使用目的から除外します。いかなる状況においても、このアプリの開発者は、データの使用や解釈により、または本同意に反する使用から起こる事柄に対し、責任を負いません。弊社は、アプリ内のユーザーの活動を匿名で追跡・報告する権利を有します。', '2010-07-31 13:29:46', '2014-05-23 15:02:43')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:02:44 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('392604257', 'JP', 'jp.jra-van.JRASSApp', 'JRA-VAN競馬App', 'http://a672.phobos.apple.com/us/r30/Purple4/v4/a8/f0/4e/a8f04eb1-2ace-2d83-2f61-d5dfe6c66eab/mzl.nzwijwxf.53x53-50.png', 'http://a1188.phobos.apple.com/us/r30/Purple4/v4/a8/f0/4e/a8f04eb1-2ace-2d83-2f61-d5dfe6c66eab/mzl.nzwijwxf.75x75-65.png', 'http://a673.phobos.apple.com/us/r30/Purple4/v4/a8/f0/4e/a8f04eb1-2ace-2d83-2f61-d5dfe6c66eab/mzl.nzwijwxf.100x100-75.png', '0.00000', 'JPY', 'JRA SYSTEM SERVICE CO.,LTD.', 'iOS_Apps', '6004', 'topgrossingapplications', 0, '「JRA-VAN」がiPhoneアプリになりました。\n情報収集から予想、投票(IPAT連動)、レース動画まで、競馬を楽しむための充実した様々な機能をぜひ一度お試しください。\n\n■今回のバージョンアップ(Ver 1.12) \n・iOS7に対応しました。\n・iPhone5以降の縦長画面に対応しました。\n・開催日程画面のレスポンスを改善しました。\n・帯域増強のため 動画(レース/調教/パドック)の配信元 を変更しました。\n・その他、軽微な不具合事象を修正しました。\n\n■前回のバージョンアップ \n・パドック動画が視聴できるようになりました。\n・開催日のレース傾向を一覧表示する機能を追加しました。\n・記事/コラムに名勝負メモリアル、優駿連載コラム、顕彰馬コラムを追加しました。\n\n■情報内容・機能\n・出馬表(単勝オッズ/馬体重/過去5走)\n・オッズ\n・プロフィール(競走馬/騎手/調教師/繁殖馬/産駒/馬主/生産者)\n・IPAT連動機能\n・レース結果(払戻金/全馬着順)\n・レース動画\n・調教動画(重賞レース出走予定馬のみ)\n・データマイニング予想\n・データ分析(持ちタイム一覧/過去対戦成績/過去レース傾向)\n・データ検索(競走馬/騎手/調教師/繁殖馬/産駒/馬主/生産者)\n・本日の騎手/本日の騎乗馬\n・本日の結果一覧\n・各種ランキング\n・変更情報\n・記事/コラム\n・コース図/コース解説\n・血統系統図/血統解説\n・WIN5\n・お気に入り(レース/競走馬/騎手/調教師)\n・速報通知(メッセージ通知)\n・お楽しみコンテンツ(複コロゲーム、ウィナーズホースゲーム、プレゼント応募)\n など\n※レース動画はレース終了後約15分後から閲覧可能になります。\n※IPATでの投票はJRAのPAT会員(A-PAT会員または即PAT会員)様のみお使いになれます。\n※「複コロゲーム」「ウィナーズホースゲーム」等のお楽しみコンテンツは全てJRAシステムサービス株式会社の主催により行われるもので、Appleは一切関わりがありません。\n\n■料金\nアプリケーションは無料ですが、情報を閲覧するには、以下の料金がかかります(アプリ内課金)。\n\n土・日2日分\n(木曜出馬発表後-土曜日18時までの購入)  \n210円(税込):レース動画も見放題!\n\n日のみ(土曜日18時以降の購入)\n105円(税込):レース動画も見放題!\n\n4週間(購入日から4週間後まで)\n525円(税込):レース動画も見放題!\n\nレース動画のみの閲覧\n1レースあたり10円(税込)\n(購入日の翌々日24時まで閲覧可能)\n\n初回起動時にアンケートにご回答いただくと、4週間の無料お試し利用権が付与されます。\n\n※)アプリの再インストール等でチャージした金額が0になってしまった場合は、[設定]→[お問い合わせ]からサポートデスクにご連絡ください。履歴を確認してチャージ金額を復元いたします。\n\n■対応ハードウェア\niPhone(推奨:4以降)/iPod Touch(推奨:第3世代以降)\n\n■対応OS\niOS4/5/6/7\n\n■注意事項\n・本アプリケーションのご利用には、3G回線またはWi-Fiのインターネット接続が必要になります。', '2010-11-30 16:00:00', '2014-05-23 15:02:44')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:02:45 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('443904275', 'JP', 'jp.naver.line', 'LINE', 'http://a949.phobos.apple.com/us/r30/Purple/v4/9d/70/4e/9d704ec0-64e4-b612-5637-c6cf76105435/mzl.ektwynue.53x53-50.png', 'http://a1817.phobos.apple.com/us/r30/Purple/v4/9d/70/4e/9d704ec0-64e4-b612-5637-c6cf76105435/mzl.ektwynue.75x75-65.png', 'http://a1030.phobos.apple.com/us/r30/Purple/v4/9d/70/4e/9d704ec0-64e4-b612-5637-c6cf76105435/mzl.ektwynue.100x100-75.png', '0.00000', 'JPY', 'NAVER JAPAN', 'iOS_Apps', '6005', 'topgrossingapplications', 0, '無料通話・無料メールアプリの決定版\n\nLINEは、24時間、いつでも、どこでも、無料で好きなだけ通話やメールが楽しめる新しいコミュニケーションアプリです。\n\n世界231ヶ国、登録ユーザー数4億4千万人突破! \n\n日本、タイ、台湾、スペイン、中国、インドネシア、シンガポール、香港、マレーシア、インド、スイス、サウジアラビア、メキシコ、ロシア、マカオ、アラブ首長国連邦など、世界52ヶ国のApp Storeで無料1位を記録!\n\n\n【LINEの新機能】\n\n◆ビデオ通話\n遠く離れた家族や友人との会話やビジネスミーティングに便利な「ビデオ通話」ができるようになりました。\n\n◆Snap Movie\nその瞬間をひとコマ動画で撮影して、BGMもつけて共有できる「Snap Movie」機能を追加しました。\n\n\n【LINEの主な特徴 】 \n\n◆スマホ同士なら、いつでも、どこでも無料の音声＆ビデオ通話\n・クリアな音声品質で好きなだけ長電話をしても無料です。\n・国際電話ももちろん無料！ \n\n◆サクサク簡単すぐ届く無料メール \n友だちとメールがわりに、サークルの仲間とMLがわりに。テキストだけでなく、絵文字や写真、地図も送れます。 \n・気持ちが伝わるスタンプ・絵文字を搭載 \n・動画や音声メッセージも簡単送信可能 \n・PCにも対応 \n\n◆より楽しく・便利に コミュニケーション \nタイムラインで、テキスト・写真・動画・スタンプ・位置情報などを使って、自分の近況をアップしたり、友だちの投稿をチェックできます。\n\n◆「スタンプショップ」でお気に入りを見つけよう！\n世界の人気キャラクターや、ちょっと笑えるシュールなキャラクターなど、表情豊かなスタンプを購入できます。\n\n◆便利な情報が届く「LINE公式アカウント」 \n「友だち」に追加するだけで、国内外の人気有名人からのメッセージや、企業からのお得なお知らせ･クーポンなどが届きます。\n\n\n※パケット通信料金がかかりますのでパケット定額サービスへの加入をおすすめします。\n\n【推奨環境変更のお知らせ】 \nLINE最新バージョン（3.1.3）から、LINEの推奨環境が変わりました。 \n\n- iPhone 3GS 以上 \n- iOS 4.3 以上 \n\nアプリのバージョンアップまたはLINEの新規インストールは上記の推奨環境で行ってください。 \n\nなお、古いバージョンのiOSのままiPhoneを使っている方は、最新版へのOSのバージョンアップをおすすめします。 \n\n▼iOSのバージョンアップ方法はこちら \nhttp://mb.softbank.jp/mb/iphone/support/os_update/how_to_update/ \n（ソフトバンク・KDDIどちらも同じ方法です）', '2011-06-21 16:00:00', '2014-05-23 15:02:44')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:02:47 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('586803362', 'JP', 'jp.monokakido.WISDOM2', 'ウィズダム英和・和英辞典 2', 'http://a926.phobos.apple.com/us/r30/Purple4/v4/ec/7f/0a/ec7f0aca-d100-98d7-2346-17d36dc99edc/mzl.xpvpyfbi.53x53-50.png', 'http://a1442.phobos.apple.com/us/r30/Purple4/v4/ec/7f/0a/ec7f0aca-d100-98d7-2346-17d36dc99edc/mzl.xpvpyfbi.75x75-65.png', 'http://a1999.phobos.apple.com/us/r30/Purple4/v4/ec/7f/0a/ec7f0aca-d100-98d7-2346-17d36dc99edc/mzl.xpvpyfbi.100x100-75.png', '2900.00000', 'JPY', '物書堂', 'iOS_Apps', '6006', 'topgrossingapplications', 0, '「ウィズダム英和・和英辞典 2」は、2012年11月に刊行された、三省堂「ウィズダム英和辞典 第3版」と「ウィズダム和英辞典 第2版」をセットにした電子辞典です。前作の「ウィズダム英和・和英辞典」と合わせて累計20万本以上販売されている App Store のベストセラー英和辞典アプリです。\n\n強力な用例検索機能によって、豊富な用例から的確な英語表現を見つけることができます。また、およそ15万の用例や約4万項目の音声データを含んでいるにも関わらず、インストール容量が約260MBと非常にコンパクトなのも特徴です。もちろんすべてのコンテンツがインストールされるため、使用時にネットワークに接続する必要はなく、オフラインで安心してお使いいただけます。\n\n主な機能は以下の通りです。\n\n- 物書堂独自のレイアウトエンジンによる高速表示\n- 前方、後方、完全一致検索\n- 成句・複合語検索\n- 日本語にも対応した用例検索\n- 複数項目による成句・用例のアンド検索\n- 和英・英和をまたいだ“なぞってジャンプ®”\n- 発音と例文の音声再生（英和辞典：約4万項目）\n- スペルミスの自動補正\n- コピー&ペースト（長押しでコピーすることができます）\n- 項目内検索\n- 項目内の重要語義や品詞や成句へのポップアップメニューによる簡易アクセス\n- スワイプによる前後の項目の表示\n- ブックマーク（日付や見出しでのソート、自由な並べ替え）\n- iCloudを使ったブックマークの同期（iSO6以降が必要です）\n- 表示履歴および検索履歴\n- iPadにも対応したユニバーサルアプリ\n- Retinaディスプレイ対応\n- インターフェースのカラー変更\n- 本文と一覧の文字サイズの変更、音量調整、画面回転のロック、検索文字消去\n- 検索画面を引っぱって消去\n- クリップボード検索\n- 他のアプリからの検索\n- 物書堂の他のアプリ（コウビルド英英、大辞林等）の呼び出し\n- ウィズダム英和・和英辞典からのブックマークの移行（v3.6以降のウィズダム英和・和英辞典のブックマーク画面からウィズダム２を選択してください）\n\nコンテンツについて\n\n◎ ウィズダム英和辞典 第3版\n\nコーパス（大規模英語データベース）を全面活用した、現代英語と語法に強い上級英和辞典、待望の改訂第3版。類義語解説・重要コロケーションなどを大幅増補し、項目数は類書中最大級の約10万2千項目。各種のコラムにより、日常学習・受験対策をあらゆる角度からサポート。重要な単語やイディオムについて約4万項目の音声を収録。\n\n- 項目数:約10万2千項目\n- 音声データ:約4万項目\n\n◎ ウィズダム和英辞典 第2版\n\n自然な英文を書き、英語による総合的な発信をサポートするための上級和英辞典、待望の改訂第2版。語の選択、文章の組み立て、模範例の提示という3つの面から、実際の英文作成を支援。項目数約9万、用例数約8万4千と増補。詳細な語法・類語解説のほか、まとまった文章を書くときに役立つ情報を満載。\n\n- 項目数：約9万項目\n- 用例数：約8万4千項目', '2012-12-29 16:00:00', '2014-05-23 15:02:46')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
