、自動更新設定をオフにされていない限り、自動的に継続されます。\n・利用券の有効期間が終了する24時間以内に自動継続は更新され課金されます。\n・自動更新の設定は、[設定]>[Store]>[アカウント情報]内の[App購読の管理]にて、オフに設定変更できます。\n・利用券の有効期間中は、現在の課金をキャンセルすることは出来ません。\n・個人情報保護方針および利用規約については、オフィシャルサイト(http://app.joysound.com/)をご覧ください。\n\n◆ご注意\n・このアプリケーションは、演奏データを再生するためのプレーヤーアプリです。\n見放題サービスをご利用いただくには、別途1ヵ月利用券(300円税込)をご購入いただく必要があります。\n利用券をご購入いただかなくても全曲45秒試聴が可能です。\n・チューナーをご利用いただくにはマイクが必要となります。\n・利用券は、購入手続きを行ったApple IDに紐づきます。故障などにより端末を交換した場合などは、「ギタナビJOYSOUND」アプリをダウンロードの上、設定画面からリストア(復元)してください。\n・本アプリのご利用には、3Gもしくは無線LAN等のネットワークに接続している必要があります。\n・本体の音量を小さくしている場合、本アプリもそれに比例して音量が小さくなります。マナーモードに設定されている場合は音が鳴りませんので、解除してください。', '2011-07-12 17:53:51', '2014-05-23 15:03:02')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
