）にしてください。\n\n【収録データ】 \n・収載語約100,000語/イラスト・図・写真 約550点/発音音声 約56,000語/解剖イラスト26点 \n\n【アップデート履歴】  \n・Version 2.2.4\n　iOS 6をインストールしたiPod touchで解剖図が表示されない不具合を修正しました。\n\n・Version 2.2.3\n　iOS 5.1に対応しました。\n\n・Version 2.2.2\n一部データを修正しました。\n\n・Version 2.2.1\n凡例を修正しました。\n\n・Version 2.2\nRetinaディスプレイに対応しました。\n\n・Version 2.1.1\niOS 4.2 (iOS 4.2.1) に対応/iPadの縦画面でも正常に動作するよう修正/マルチタスキングに対応 \n\n・Version 2.1\n解剖図中の部位名 (青文字) をタップすると解説文を表示/履歴や単語帳から表示する解説画面にも単語追加ボタンを追加/サポートサイトをステッドマン内で表示/解説文中の欧文を大きく表示/\n文字選択時に「ジャンプ」メニューを表示/日本語入力時にインクリメンタル検索できるよう修正/単語追加や「設定ほか」をポップオーバーで表示 \n\n・Version 2.0\niPadに対応しました。', '2010-04-26 16:00:00', '2014-05-23 15:03:17')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
