Error - 2014-05-23 15:03:29 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('637494062', 'JP', 'com.ivysoft.powerrecord', 'Recordium 音声レコーダー、ボイスメモ', 'http://a547.phobos.apple.com/us/r30/Purple/v4/fb/d9/da/fbd9daa2-d523-d264-99e6-46367f5f3d46/mzl.ixmphhre.53x53-50.png', 'http://a1415.phobos.apple.com/us/r30/Purple/v4/fb/d9/da/fbd9daa2-d523-d264-99e6-46367f5f3d46/mzl.ixmphhre.75x75-65.png', 'http://a420.phobos.apple.com/us/r30/Purple/v4/fb/d9/da/fbd9daa2-d523-d264-99e6-46367f5f3d46/mzl.ixmphhre.100x100-75.png', '0.00000', 'JPY', 'Pichak co.', 'iOS_Apps', '6000', 'topfreeipadapplications', 0, '「本日のアプリ」で今日だけ無料に！\n「本日のアプリ」をダウンロードして、24時間ごとに有料アプリを０円で手に入れよう！\n\nアップル、TheNextWeb、ガーディアン、ライフハッカー、The Telegraph、MakeUseOf、iMore、AppAdviceなどにも特集されました！\n\nRecordiumはiPhone、iPad、iPod Touchのためにデザインされたパワフルでエレガントな録音アプリです。Recordiumでは、録音や再生の途中でトラックにハイライトをつけ、あなたの録音の一番大切な部分にフォーカスできます。録音のどこにでもノート、タグ、写真をアタッチメントとして追加できるので、検索時に、トラックの一番重要なハイライト箇所へのすばやいアクセスが可能です。また、Dropbox等のいろいろなクラウドアプリで、録音を友達とシェアできます。 \n直観的なユーザー・インターフェース、滑らかな再生、さまざまな圧縮アルゴリズムによる録音サイズと音質のカスタマイズといった優れた特徴を持つRecordiumは、学生、ジャーナリスト、ミュージシャンはもとより、あらゆるユーザーに必須のツールです。\n\n音が見えるアプリ、それがRecordium！\n\n \nRecordiumの特徴:\n\n*****オーディオのハイライト*****\n録音時と再生時にトラックの重要箇所をハイライト\n波形をタッチしてハイライト部分を簡単に編集　　\n\n\n****注釈****\n      録音に無制限にタグ付けできる\n      トラックのいろいろな箇所にノートを追加\n      トラックのどこにでも写真を追加(カメラやデバイスのギャラリーから)\n      ワンタップで注釈をプレビュー\n      注釈をトラック上で簡単に移動\n      ワンタップで注釈の内容を編集または削除\n\n**編集ツール**\n      録音の不必要な部分をトリム／カット\n      トラックの好きな箇所を切って、新しいファイルを作成\n      トラックの真ん中からでも、自在に部分を削除\n\n**高品質録音**\n      ３つのサンプリングレート(8、22、44.1 kHz) でサイズと音質を管理\n      ４つの録音形式をサポート: WAV、CAF、AIFF、MP4\n      特別なMP4圧縮形式を使用: (例：30MB以下で一時間の録音可能)\n\n**パワフルな録音**\n      バックグラウンドで録音・再生\n      録音時の一時停止\n      電話に出た後で録音が再開される中断防止機能付き\n      録音時間リミットなしで、必要な全ての録音が可能\n      自動保存なので録音をなくす心配なし\n      遠くの声の録音にも対応する強力な録音ボリューム設定\n      自動一時停止で会話の無音部分をスキップし、ファイルサイズを減少\n\n \n**パワフルなファイル共有**\n      録音をDropbox、Google Drive、Evernote等のクラウドアプリにアップロード\n      Recordiumから直接、電子メールで録音を送信\n      Wi-Fi Syncを使って録音をコンピュータに転送\n      iTunesでのファイル共有\n\n**ファイル管理**\n      タイトル、タグ、ノートによる検索\n      ファイルのリストからすばやく録音を再生\n      便利なファイル＆フォルダ管理システム\n      録音や再生時にもファイルやフォルダの名前変更ができる\n      録音ファイルの追加、削除、移動、名前変更ができる\n      録音サイズ、長さ、日付等の詳細情報つき\n\n**さまざまな形式でのインポート**\n      インポートできるオーディオ形式の例: MP3、MP4、WAV、 AIFF、CAF\n\n**再生**\n      高感度な波形\n      タッチできる波形にズームイン／アウトして視覚的にナビゲート\n      ピッチ補正もできる、さまざまな再生速度\n      5秒早送り、5秒巻き戻し機能\n\n**ほしい物リスト**\n次回のRecordiumのアップデートでほしい機能に投票できます。トップランキングの機能は将来のアップデートに付け加えられます。\n私たちは常にユーザーの声を待っています！', '2013-05-25 16:00:00', '2014-05-23 15:03:29')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
