hoo!検索\nウェブや画像、動画に加え、TwitterやFacebookリアルタイム検索できます。\n音声でのキーワード入力にも対応しています。\nTwitterの話題のキーワードを抽出する「話題なう」も提供しています。\n- ウェブ検索（デフォルト検索機能）\n- 画像検索\n- 動画検索\n- 知恵袋検\n- リアルタイム検索\n- レシピ検索\n- ニュース検索\n- ヤフオク!検索\n\n※話題なう、ヤフオク検索、ニュース検索はiPhone版のみの機能です\n※レシピ検索はiPad版のみの機能です\n\n■いつでもどこでも即Yahoo!ニュース\n主なニュースを先読みしてキャッシュします。\n電波が悪くてもニュースがさくさく読めて快適です。\n移動中で電波がな くても、ビジネスですぐに情報がほしい時も便利に使えます！\n「トピックス」は主要ニュースを一目でご覧になれます。\n\n■あなたにおすすめの記事\nあなたの興味・関心を自動で学習して、読んでいただきたいおすすめの記事をお届けします。\n※おすすめの記事はiPhone版のみの機能です\n\n■防災情報や速報ニュース、おすすめコンテンツをお届け\nプッシュ通知で、地震や津波の災害情報や号外ニュース、スポーツ速報、季節のおすすめコンテンツをお知らせします。 \n\n■その他機能\n・Yahoo!メール、Yahoo!天気・災害、Yahoo!占い、Yahoo!テレビ\n自分の情報を設定しておけば、天気予報やテレビ番組表などの最新情報をいつも確認できます。\n・「よく見る」サイトの自動登録機能\nアプリ内ブラウザーの閲覧履歴からよく利用するサイトを自動的に登録します。\n使い込めば使い込むほど、手放せなくなる技ありプチ機能です。\n・Yahoo!のサービスやアプリのショートカット\nYahoo!のサービスやアプリを利用するのに便利なショートカットを提供しています。\nこの機能を使えばいつでもどこでも、すぐに、天気予報やスポーツニュース、芸能ニュース、ビジネスニュースなど、今すぐ欲しい最新速報をすぐ見られます。\n・最新コンテンツた\nYahoo!ニュース、Yahoo!知恵袋、Yahoo!ショッピング、Yahoo!映画のランキングなど人気サービスのコンテンツをラインアップ。\n電波が届かない地下鉄の中などでも記事を読めます。 \n-おもしろ画像コンテンツ、Picアップ\n　犬や猫のかわいい写真や、写真で一言「ボケてセレクト」の思わず笑ってしまうおもしろいコンテンツが盛りだくさん。カカオトークやLINEにシェアしてみんなで楽しもう！\n- Yahoo!ニュース\n　最新ニュース速報、芸能ニュース、スポーツニュース、日本国内、海外ニュース\n- Yahoo!知恵袋 \n　恋愛相談、エンターテインメントと趣味、暮らしと生活のガイド \n- Yahoo!映画 - 映画情報、予告動画\n- Yahoo!映像トピックス – 世界の厳選映像\n- Yahoo!スポーツ - スポーツ速報、最新速報、ニュース\n- Yahoo!ショッピング - おすすめ情報\n- GyaO! - 映像、動画ランキング、　映像、動画配信\n- Yahoo!ロコ - 周辺の人気グルメ店\n- Yahoo!検索ランキング - 急上昇ワード \n- Yahoo!ファイナンス \n　株価、株価検索、株価ニュース、為替情報\n-ヤフオク - オークション\n-Yahoo!地図 \n　地図、店舗、施設検索、地図表示\n-Yahoo!路線情報 \n　路線情報、周辺地図、電車の乗り換え案内 \n-Yahoo!テレビ \n　テレビ番組表、ラジオ番組表、番組表設定\n\n※Yahoo!テレビはiPhone版のみの機能です\n\n■不具合などございましたら、こちらにご連絡ください\nhttp://yahoo.jp/ruVqtV \n\n本アプリケーションおよび本アプリケーションに含まれるウィジェットはYahoo! JAPAN利用規約\n＜ソフトウエアに関する規則（ガイドライン）を含みます＞\nをご確認のうえ、ご利用ください。\n■Yahoo! JAPAN利用規約\nhttp://docs.yahoo.co.jp/docs/info/terms/ \n■プライバシーポリシー\nhttp://docs.yahoo.co.jp/docs/info/terms/chapter1.html#cf2nd \n■ソフトウエアに関する規則（ガイドライン）\nhttp://docs.yahoo.co.jp/docs/info/terms/chapter1.html#cf5th', '2008-12-11 04:39:53', '2014-05-23