Error - 2014-05-23 15:04:17 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('340368403', 'JP', 'com.cookpad', 'クックパッド - No.1レシピ検索アプリ', 'http://a1895.phobos.apple.com/us/r30/Purple4/v4/89/a2/79/89a279c5-0b12-6e14-f2c1-746a7537f605/mzl.blxlvzno.53x53-50.png', 'http://a411.phobos.apple.com/us/r30/Purple4/v4/89/a2/79/89a279c5-0b12-6e14-f2c1-746a7537f605/mzl.blxlvzno.75x75-65.png', 'http://a1000.phobos.apple.com/us/r30/Purple4/v4/89/a2/79/89a279c5-0b12-6e14-f2c1-746a7537f605/mzl.blxlvzno.100x100-75.png', '0.00000', 'JPY', 'COOKPAD Inc.', 'iOS_Apps', '6023', 'topfreeipadapplications', 0, 'みんなのレシピが160万品！ \n\n日本最大の料理レシピサイト「クックパッド」のレシピから、いつでもどこでも「今日食べたいレシピ」を探すことのできるアプリです。 \n毎日の献立がすぐに決まり、使いつづけるうちに「自分だけのレシピ帳」に成長していきます。 \n\n160万品を超えるレシピの中から、毎日の食事はもちろん、お正月のおせち料理、クリスマスなどのイベントにぴったりのパーティー料理、バレンタインチョコや誕生日ケーキなどのスイーツまで、あなたが探しているぴったりのレシピが見つかります。 \n\n- 160万品のレシピから「今日食べたいレシピ」を検索 \n・食材や料理名はもちろん、「クリスマス」「おせち」「バレンタイン」「運動会」「誕生日」「ダイエット」「美容」などの目的別キーワードからも探せます。 \n・よく使う検索キーワードを自動的に記憶します。 \n・「含まない」キーワード検索で、苦手な食材をのぞいたレシピを探せます。 \n・いろんなレシピがあるから、バレンタインのチョコレート、お花見、運動会、ハロウィン、クリスマス、おせち料理、七草粥、誕生日のケーキ、お祝いのディナー料理など、イベントや記念日に大活躍 \n\n\n- おすすめのレシピを毎日お届け \n・「季節のおすすめ」や「話題のレシピ」を毎日お届けします。 \n・「人気の検索キーワード」で旬のレシピが分かります。 \n\n- お気に入りのレシピを保存 \n・お気に入りのレシピをすばやく保存できます。 \n・「お父さんが好きなレシピ」や「絶品お菓子」など、簡単な操作で保存したレシピを分類できます。 \n・つくりましたフォトレポートをレシピ作者に送れば、レシピを作った記録の保存も。 \n\n- 鉄板レシピ \n・検索結果やカテゴリのレシピを「人気順」に見ることができます。（プレミアムサービス） \n・1000人以上が絶賛した「殿堂入りレシピ」が見ることができます。（プレミアムサービス）\n・「デイリーアクセス数ランキング」で毎日のTOP20レシピを見ることができます。（プレミアムサービス） \n\n- 履歴機能 \n・最近見たレシピをいつでも簡単に表示できます。 \n\n- レシピをのせる\n・あなたの毎日の料理をレシピの形で簡単に保存・公開できます。\n・あなたレシピをつくってくれた方から、つくれぽ（つくりましたフォトレポート）が届くことも。\n\n- レシピ共有 \n・LINEやメール、SMSで簡単にレシピを共有できます。 \n\n- 近くのスーパーのチラシ・特売情報をお届け\n・全国10,000店舗から、近くのスーパーのチラシ・特売情報を探せます\n・特売商品を使ったレシピも一緒に見られて、今日の献立決めが簡単に！\n・プッシュ通知で手軽に素早く特売情報がチェックできます\n\n\n※ 本アプリケーションをインストールされると、著作権情報欄に掲載している「クックパッド利用規約」に同意されたものとみなします。インストール前にご確認ください。 \n\n※ 本バージョンよりクックパッドIDをお持ちでないプレミアム会員の方に、IDの取得をお願いしています。取得時の操作でご不明な点がありましたら、サポートデスクまでお問い合わせください。 \n\n\n\n【 プレミアムサービスの仕組みについて 】 \n・プレミアムサービスの価格と期間 \n300円（税込）/1ヶ月間（申し込み日から起算）/月額自動更新 \n\n・課金について \niTunes アカウントに課金されます。 \n\n・自動更新の詳細 \nプレミアムサービス会員期間の終了日の24時間以上前に自動更新を解除しない限り、会員期間が自動更新されます。 \n自動更新される際の課金については、会員期間の終了後の24時間以内に行われます。 \n\n・プレミアムサービス会員状況の確認方法と退会（自動更新の解除）方法 \n会員状況の確認と退会は下記ページから行うことができます。 \n[ App Store アプリ/おすすめページ最下部 → Apple ID/アカウントを表示 → 購読/管理 ] \n次回の自動更新タイミングの確認や、自動更新の解除/設定をこの画面内で行うことができます。 \n※ iTunes からも同様の確認や自動更新の解除・設定を行うことができます。 \n※ クックパッド（アプリ、ウェブサイト全て）からプレミアムサービスの解約を行うだけでは自動更新は解除されません。 \n\n・当月分のキャンセルについて \nプレミアムサービスの当月分のキャンセルについては受けつけておりません。', '2009-11-26 16:00:00', '2014-05-23 15:04:17')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:04:18 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('777310222', 'JP', 'com.goodiware.goodreader4', 'GoodReader 4', 'http://a596.phobos.apple.com/us/r30/Purple/v4/71/e0/bc/71e0bcbf-4022-7580-f9be-70c5624afd7e/mzl.nsaokajw.53x53-50.png', 'http://a1112.phobos.apple.com/us/r30/Purple/v4/71/e0/bc/71e0bcbf-4022-7580-f9be-70c5624afd7e/mzl.nsaokajw.75x75-65.png', 'http://a1669.phobos.apple.com/us/r30/Purple/v4/71/e0/bc/71e0bcbf-4022-7580-f9be-70c5624afd7e/mzl.nsaokajw.100x100-75.png', '300.00000', 'JPY', 'Good.iWare Ltd.', 'iOS_Apps', '1', 'toppaidipadapplications', 0, '--- INTRODUCTORY PRICE FOR A LIMITED TIME - ALMOST 60% OFF ---\n\nThis is the next generation of our famous GoodReader app, and now it\'s a universal app - one app for all your iOS devices.\n\nIn addition to all the features from the original GoodReader app, this upgrade includes the following awesome features:\n- PDF Page Management - add, rearrange, delete, rotate, extract and email individual pages, split and merge files\n- PDF Page Slider now shows page previews\n- icon view for file browser, with larger previews\n- collapsible tool area on the main screen\n- “New PDF” button to create an empty file for your important notes and drawings\n\n-------\n\nGoodReader® is the super-robust PDF reader app. Mashable describes it as “a Swiss Army knife of awesome!” Reviews worldwide hail it as “essential,” “the best,” “magnificent” and “the killer app”. With GoodReader on your iPad or iPhone, you can read virtually anything, anywhere: books, movies, maps, pictures. Use it once and you’ll be hooked. Soon you\'ll be wondering how you ever managed to go mobile without GoodReader.\n\nGoodReader has earned its accolades by the way it handles huge PDF and TXT files, manuals, large books, magazines, and renderings of 100 mb and more with great speed.\n\nThe ability to mark-up PDFs opens up new doors to GoodReader users who can now use typewriter text boxes, sticky notes, lines, arrows, and freehand drawings on top of a PDF file.\n\nAll the excelent features of the original GoodReader are here, including:\n- the best PDF reading engine\n- PDF Annotations - text boxes, popup comments (\"sticky notes\"), text highlights and markups, freehand drawings, lines, arrows, rectangles, ovals, etc.\n- access to various types of servers to store your data - Dropbox, OneDrive, Google Drive, box.com, WebDAV, SMB, AFP, FTP, SFTP\n- Auto Sync with remote servers\n\nOur well-crafted Migration Assistant will make the transition to this new app easy for you - all your files and setting from the old GoodReader app will be transferred with a click of a button.', '2014-05-08 07:40:17', '2014-05-23 15:04:17')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
