7/2010 (.pptx) \nMicrosoft Powerpoint 97/2000/XP/2003 (.ppt) \nOpenDocument テキスト形式 (.odt)　\nOpenDocument スプレッドシート形式 (.ods) \nOpenDocumentプレゼンテーション形式 (.odp) \n様々な画像フォーマット (.png、 .jpg、 .gif、など) \n\n\n+ファイルマネージャを内臓　\n様々な形式のファイルをインポートして、異なるファイル形式にしてエクスポート。　\nローカルファイルへ自動保存および同期化/　\nDropboxから直接編集。　\nBox.net、Google Drive、Google Docsに対応 \nWiFiおよびUSBでの転送に対応 \n\n+その他の機能　\nメールファイル　\nほとんどのドキュメントをPDFにしてエクスポート　\nAir Printを通してドキュメントを印刷　\n対応機種では、音声書き取り機能を使ってタイプ入力　\nマウスモードを使用して、正確なコントロール　\n\n注意: インポートしたPDFファイルを編集することもできます。ただし、正確にインポートできるのは簡単なPDFファイルに限られており、PDFのインポートは完璧ではありません。　\n\n免責事項: \n- 全てのドキュメントを開いたり編集できるわけではありません。開いたり、保存されたドキュメントは、形式の互換性によって、その形式が失われてしまう場合があります。確信がない場合は、お客様のドキュメント（機密文書を除く）を私たちのサポートメールまでお送りいただければ、アプリを使ってドキュメントを開くことができるかテストいたします。　\n- OpenOffice.org™はOracleの登録商標です。 \n- LibreOffice™はThe Document Foundationの登録商標です。  \n- 米国およびその他の国々において、Microsoft®はMicrosoft Corporationの登録商標です。　\n- Documents Unlimitedアプリは、LibreOffice、OpenOffice、Microsoftのいずれからも、提携、宣伝、後援をされておりません。　\n- Documents Unlimitedは、人気のLibreOfficeスイート用のクラウドベースのホスト型ソリューションであり、編集機能はオンラインで使用しなければなりません。　\n- LibreOfficeのデスクトップコンピュータでの使用を希望される方は、 www.libreoffice.orgをご覧ください\"', '2012-04-10 01:12:30', '2014-05-23 15:04:20')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:04:21 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('749078962', 'JP', 'com.apalonapps.wl', '気象ライブ・リローデッド', 'http://a1931.phobos.apple.com/us/r30/Purple4/v4/e8/60/a1/e860a188-db1d-01c9-89cd-e2617fc35b80/mzl.wjotnctr.53x53-50.png', 'http://a447.phobos.apple.com/us/r30/Purple4/v4/e8/60/a1/e860a188-db1d-01c9-89cd-e2617fc35b80/mzl.wjotnctr.75x75-65.png', 'http://a1164.phobos.apple.com/us/r30/Purple4/v4/e8/60/a1/e860a188-db1d-01c9-89cd-e2617fc35b80/mzl.wjotnctr.100x100-75.png', '200.00000', 'JPY', 'Apalon Apps', 'iOS_Apps', '6001', 'toppaidipadapplications', 0, '気象ライブ・リローデッド を体験してください。今までにない直感的でシンプルなデザイン、実況天気図の機能を増強した 気象ライブ の次世代版です。\n\n戸外で日光がさんさんと輝いているのであれ、曇っているのであれ、雨が降っているのであれ、あるいはたとえ雪が降っていても、 気象ライブ があればあなたの街や、世界中のいろいろな場所の現在の天候状況が、驚きのアニメーションで表示されます。\n\n悪天候も良い天候も、iOS 機器の鮮明なスクリーンで魔法のように活き活きと表示されます。外がどうなっているのかを知るために窓の外を見る必要はありません。気象ライブ が、まるで自分がすでに外にいるかのような気分にしてくれるからです。革新的なテクノロジーの Weather Live™ をこのアプリケーションに実装することで、当社はこれを可能にしたのです。\n\n機能:\n\n- 世界中の複数の都市の天気予報と現地時間 \n- 週のどの日またはどの時間にも対応の長期予報。タップするだけで天気の詳細情報が得られます \n- リアルタイムの天候に応じて変化するダイナミックなアニメーション \n- 雲/衛星/雨 気象図 \n- お住まいの地域の厳しい天候について知らせてくれる悪天候警告。日本の気象庁が提供するデータ\n- ホーム スクリーン上にアイコン バッジとして現在の温度が表示 \n- 調節可能レイアウト。基本情報の確認またはより高度な内容。表示したい天気パラメータをレイアウト設定で選択して下さい。\n- 気温がマイナスになるとアラートを発生 \n- 氷点下アラート - 氷点に達したことをお知らせします \n- 矢印の形をしたインジケータは、気圧に敏感な人にとっては便利なツールとなる気圧の変化を反映\n- 選択肢を分かち合うこと: お好きなソーシャルネットワーク上で、友人と天気予報をシェアしましょう \n\n天候の詳細:\n\n- 7-日間の天気予報 \n- 「体感」温度 \n- 本日の最高最低気温 \n- 風向 \n- 風速はマイル毎時、キロメートル毎時、メートル毎秒、ノット、または、ビューフォートで表示\n- 湿度と降水量情報 \n- 気圧と視界の詳細 \n- 気圧はインチ、ミリメートル、キロパスカル、または、ミリバールで表示\n- 華氏または摂氏で気温を表示 \n- 12 または 24 時間制の表示 \n\nその他の機能:\n\n- 都市間の簡単なナビゲーション: 場所を切り替えるには、左または右方向にタッチしてください。\n\nカスタマイズ可能なレイアウト\n\n- すべての詳細\n- 現在の状態のみ\n- テキストのみ\n- 円周表示\n\nウェザーライブ で天気予報がどれだけ美しくなれるかを発見してみましょう。', '2013-12-08 06:10:28', '2014-05-23 15:04:21')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
