Error - 2014-05-23 15:04:24 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('382069612', 'JP', 'se.resenatverket.FlightRadar24', 'Flightradar24 Pro', 'http://a158.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.53x53-50.png', 'http://a1026.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.75x75-65.png', 'http://a1983.phobos.apple.com/us/r30/Purple6/v4/1f/00/ca/1f00caed-74fe-6d38-d092-b6031ee53303/mzl.nnofnfhj.100x100-75.png', '300.00000', 'JPY', 'Flightradar24 AB', 'iOS_Apps', '6003', 'toppaidipadapplications', 0, 'あなたの携帯やiPadをエアートラフィックレーダーに変えて、日本の周りや世界中を飛ぶ飛行機をリアルタイムで詳細な地図上で見てみましょう。アップル機器を空を飛んでいる飛行機にかざして、行き先その他を調べましょう。何百万人ものひとがなぜ Flightradar24を愛用しているのか。今日、ご自分で体験してみませんか。\n\nFlightradar2 アプリが25カ国以上でベストセラーとなった、また140カ国以上 (日本、米国、英国、ドイツその他) でベストセラーの旅行アプリとなった優れた機能には以下があります: \n* 詳細な地図上を飛行機が移動するのをリアルタイムでご覧になれます\n* 機器を空にかざすだけで、上空を飛んでいる飛行機を識別できます (GPS 搭載の機器が必要です)\n* 飛行機のパイロットがなにを見ているか、リアルタイムで 3Dで体験できます (iPhone 4S, iPad 2, iPod Touch 第5世代、+ iOS 6.0 以降のバージョンが必要となります)\n* 飛行機をタップすると、ルートや予想到着時間、実際の離陸時間、機種、速度、高度や高解像度の画像といった、全体的なフライトと機体の情報が表示されます\n* 便名や空港、航空会社で、個別のフライトを簡単に探せます\n* 航空会社、期待、高度、速度その他で簡単にフィルタリングできます\n* 簡単にお気に入りに追加でき、関心のある地域を迅速にナビゲーションできます\n* 機器を主要な航空の発着案内に合わせると、リアルタイムでフライトステータス更新と、現在の空港周辺の天候条件を見ることがをできます (アプリ内で別途ご購入いただいた場合)\n* リアリスティックな機体の記号 (アプリ内で別途ご購入\n* 航空会社、機種、便名または登録に基づいたカスタマイズされたアラートを設定する(アプリ内で別途ご購入) \n\nどのように機能するか\n今日、ほとんどの機体には、いわゆる位置データを送信する、いわゆるADS-Bのトランスポンダーが搭載されています。Flightradar24 は急成長中のネットワークで、世界中に数千のグループステーションを持ち、アプリ内の地図で機体が移動するのを示すこのデータを受け取ります。マルチラテレーションの助けを借りて、Flightradar24 はカバーする地域を拡大中であり、 ADS-B トランスポンダーを持たない機体の位置も計算可能となっています。\n\nアプリでは、米国連邦航空局 (FAA) からの直接的な情報供与により、従来のレーダーデータも利用されています。このデータは、米国とカナダの全空域をほぼリアルタイムでカバーします。\n\n***重要な通知***\nFlightradar24 アプリは英語で表記されています。が、テキストはほとんどなく、追加テキストが必要な際にも可能な限り周知の記号を使っています。\n\n特別の地域の飛行機の往来追跡にのみご興味がある場合には、アプリをご購入前に Flightradar24.com にてご確認ください。Flightradar24 は、他に類を見ないレベルの世界中の機体位置データを提供していますが、カバーされていない地域もあります。 \n\nカバレッジは随時変更される場合があります。\n\nFLIGHTRADAR24 にコネクトしよう\nFlightradar24 を Facebook でイイネ！して、Twitter でフォローしよう。\n\nヘルプ & サポート\nforum.flightradar24.com/threads/89-Important-Read-this-before-you-ask-questions\nflightradar24.com/contact-us.\n\n免責\nこのアプリの使用は、厳密に娯楽目的に限られています。特に、あなた自身や他の人々の命にかかわるような活動は、使用目的から除外します。いかなる状況においても、このアプリの開発者は、データの使用や解釈により、または本同意に反する使用から起こる事柄に対し、責任を負いません。弊社は、アプリ内のユーザーの活動を匿名で追跡・報告する権利を有します。', '2010-07-31 13:29:46', '2014-05-23 15:04:24')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:04:27 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('472006138', 'JP', 'com.TechSmith.CoachsEye', 'Coach\'s Eye', 'http://a617.phobos.apple.com/us/r30/Purple2/v4/c2/d8/7d/c2d87d11-8648-a672-7cda-a8dab0de5565/mzl.mreidtkl.53x53-50.png', 'http://a1133.phobos.apple.com/us/r30/Purple2/v4/c2/d8/7d/c2d87d11-8648-a672-7cda-a8dab0de5565/mzl.mreidtkl.75x75-65.png', 'http://a858.phobos.apple.com/us/r30/Purple2/v4/c2/d8/7d/c2d87d11-8648-a672-7cda-a8dab0de5565/mzl.mreidtkl.100x100-75.png', '500.00000', 'JPY', 'TechSmith Corporation', 'iOS_Apps', '6004', 'toppaidipadapplications', 0, 'Coach\'s Eye は、技術指導やパフォーマンスの向上を目的としたアプリです。優れた機能でその場ですぐにビデオを再生することができます。HD でビデオを録画し、すぐにスローモーションで確認できます。アドバイスを追加して解説ビデオを作成、共有し、スマートに練習しよう。\n\n\nビデオのキャプチャとインポート\n\n  • SD または HD ビデオで録画できます。\n  • 最新の Apple デバイスで 60 または 120 FPS でビデオをキャプチャできます。\n  • ご使用のデバイスのカメラロールや e メール、Dropbox などのアプリからビデオをインポートできます。\n  • 他の Coach\'s Eye ユーザーから共有されたビデオをインポートできます。\n  • タグ機能でビデオを整理できます。\n\n解説ビデオの作成\n\n  • スローモーション再生と描画ツールですぐにビデオを解説できます。\n  • ビデオを 2 つ並べて比較、分析できます。\n  • ホイールを回すと正確にスローモーションで再生できます。 \n  • 解説中はズームとパン機能で必要な部分の詳細を表示できます。\n  • 直線、矢印、サークル、四角形の枠、フリーハンド ツールを使用してビデオ上を描画できます。 \n  • 音声でアドバイスを録音し、注釈、スローモーションで分析ビデオを作成できます。\n\nシンプルな操作で共有\n\n  • e メール\n  • 文字のメッセージ\n  • Facebook\n  • Twitter\n  • YouTube \n  • デバイスのカメラロール\n  • その他のアプリ （Dropbox、Edmodo、Evernote など）\n  • 複数の人にその場で解説ビデオを見せる場合は、大きなスクリーンで表示   （AirPlay や Apple TV、HDMI 接続を経由して TV / プロジェクターを使用します）\n\nコミュニティをチェック\n\n  • [Leaderboard （リーダーボード）] や [Staff Picks （スタッフが選択したビデオ）] で人気のビデオからインスピレーションを得よう。\n  • [Map (地図)] のビデオから世界の人の練習風景を見つけることができます。\n  • 他のコーチや選手が公開したビデオを表示しインポートできます。\n  • 無料のオンライン アカウントから共有、または好きなビデオのページにアクセスできます。\n\nVIP | インフィニット アクセス（アプリ内契約）\n\nモバイルを使用したプロのコーチ向けに設計された最先端クラウド バックアップと共有サービス\n  • 制限なしのクラウド ロッカー バックアップ（ストレージ）\n  • HD 共有 \n  • HD クラウド バックアップ\n  • HD エクスポート\n  • 制限なしのプライベート（リストされない）共有\n  • ご使用の iPhone から iPad へ、またはその逆へビデオを送信\n  • Web クラウド ロッカーから ご使用のすべての Apple デバイスへビデオを送信\n  • すべてのプレミアムツールと効果へのアクセス\n\nVIP 契約は月¥1,500 、年¥14,800 の購読契約です。\n\n\n購読契約は毎月または毎年自動で更新されます。支払は当期の期末前 24 時間以内にご使用の iTunes アカウントから引き落とされます。自動更新を解約するには、いつでもご使用のiTunes アカウントの設定からおこなえます。利用契約期間中の契約のキャンセルはできません。\n\n\nプレミアム ツール（アプリ内購入）\n\n  • Angle tool （アングル ツール）: 1 つのビデオや 2 つのビデオを並べて比較しながら複数の角度を描画できます。角度が表示されマルチタッチで移動できます。360 度の行動範囲以下で測定できます。. \n\n  • Timer tool （タイマー ツール）: ビデオにタイマーが表示され重要な時点をマークします。経過時間を見て時間を計算します。ビデオを再生し、測定する時点までの時間を表示します。\n\n  • Spotlight tool （スポットライト ツール）: 重要な瞬間をフォーカスできます。スポットライトの周りは薄暗くなり、ビデオの特定の部分をフォーカスします。色を変更でき、詳細をズームできます。ビデオの最も重要な箇所に注意を向けることができます。\n\nお問い合わせとフィードバック先: coachseyeinfo@techsmith.com', '2011-11-08 16:00:00', '2014-05-23 15:04:27')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
