Error - 2014-05-23 15:04:33 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('777310222', 'JP', 'com.goodiware.goodreader4', 'GoodReader 4', 'http://a596.phobos.apple.com/us/r30/Purple/v4/71/e0/bc/71e0bcbf-4022-7580-f9be-70c5624afd7e/mzl.nsaokajw.53x53-50.png', 'http://a1112.phobos.apple.com/us/r30/Purple/v4/71/e0/bc/71e0bcbf-4022-7580-f9be-70c5624afd7e/mzl.nsaokajw.75x75-65.png', 'http://a1669.phobos.apple.com/us/r30/Purple/v4/71/e0/bc/71e0bcbf-4022-7580-f9be-70c5624afd7e/mzl.nsaokajw.100x100-75.png', '300.00000', 'JPY', 'Good.iWare Ltd.', 'iOS_Apps', '6007', 'toppaidipadapplications', 0, '--- INTRODUCTORY PRICE FOR A LIMITED TIME - ALMOST 60% OFF ---\n\nThis is the next generation of our famous GoodReader app, and now it\'s a universal app - one app for all your iOS devices.\n\nIn addition to all the features from the original GoodReader app, this upgrade includes the following awesome features:\n- PDF Page Management - add, rearrange, delete, rotate, extract and email individual pages, split and merge files\n- PDF Page Slider now shows page previews\n- icon view for file browser, with larger previews\n- collapsible tool area on the main screen\n- “New PDF” button to create an empty file for your important notes and drawings\n\n-------\n\nGoodReader® is the super-robust PDF reader app. Mashable describes it as “a Swiss Army knife of awesome!” Reviews worldwide hail it as “essential,” “the best,” “magnificent” and “the killer app”. With GoodReader on your iPad or iPhone, you can read virtually anything, anywhere: books, movies, maps, pictures. Use it once and you’ll be hooked. Soon you\'ll be wondering how you ever managed to go mobile without GoodReader.\n\nGoodReader has earned its accolades by the way it handles huge PDF and TXT files, manuals, large books, magazines, and renderings of 100 mb and more with great speed.\n\nThe ability to mark-up PDFs opens up new doors to GoodReader users who can now use typewriter text boxes, sticky notes, lines, arrows, and freehand drawings on top of a PDF file.\n\nAll the excelent features of the original GoodReader are here, including:\n- the best PDF reading engine\n- PDF Annotations - text boxes, popup comments (\"sticky notes\"), text highlights and markups, freehand drawings, lines, arrows, rectangles, ovals, etc.\n- access to various types of servers to store your data - Dropbox, OneDrive, Google Drive, box.com, WebDAV, SMB, AFP, FTP, SFTP\n- Auto Sync with remote servers\n\nOur well-crafted Migration Assistant will make the transition to this new app easy for you - all your files and setting from the old GoodReader app will be transferred with a click of a button.', '2014-05-08 07:40:17', '2014-05-23 15:04:33')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:04:34 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('665875309', 'JP', 'net.kaleido-jp.photocut', 'HD合成写真 背景透明化 自動切り抜き PhotoCut-高画質でiPadにも対応！写真加工・ぼかし・縁取り・文字入れ・雑コラージュ・アイコン画像作成・無料素材も搭載！', 'http://a1087.phobos.apple.com/us/r30/Purple/v4/88/40/d8/8840d8c0-8828-3666-f0a2-a1a7dd112341/mzl.iqxefbsj.53x53-50.png', 'http://a1955.phobos.apple.com/us/r30/Purple/v4/88/40/d8/8840d8c0-8828-3666-f0a2-a1a7dd112341/mzl.iqxefbsj.75x75-65.png', 'http://a576.phobos.apple.com/us/r30/Purple/v4/88/40/d8/8840d8c0-8828-3666-f0a2-a1a7dd112341/mzl.iqxefbsj.100x100-75.png', '100.00000', 'JPY', 'Kousuke Araki', 'iOS_Apps', '6008', 'toppaidipadapplications', 0, '■高解像度で超綺麗な合成写真！■\n【 期間限定セール中！】 ￥300→￥100\n\niPhone 5以降なら8メガピクセル・フル解像度対応！\niPhone 4Sなどでも高解像度で保存できます！*1\n\nPhotoCutは、写真を様々なツールで合成できるアプリです。最大で同時に20枚の画像を合成できます。*2\n\n配置したレイヤーは位置を変えたりなどの再編集がいつでもできます。\n\n（*1：解像度は機種によって異なります。下記、解像度の項目をご確認ください）\n（*2：同時合成枚数は機種によって異なります。下記、最大レイヤー数の項目をご確認ください）\n\n◆iOS 7動作確認済み！◆\n\n【レイヤー画像の切取り】\n1. 自動削除ツール\n　近い色の領域を自動的に削除できます\n2.フリーハンド\n　切取りたい箇所を囲んで切取ります\n3.図形切取り\n　用意された図形で切取ります\n　（14種類の図形）\n4.消しゴム\n　なぞった部分を削除します\n5.修復ツール\n　なぞった部分を修復します\n\n\n【背景・レイヤー素材】\n背景やレイヤーに使う画像は写真以外にもアプリに用意された素材を使うことができます。\n・背景素材：14種類\n・レイヤー素材：15種類\n\n\n\n【画像の色調】\n輝度・彩度・コントラスト・ぼかし・透明度が変更できます。\n（背景は輝度・彩度・コントラストのみ）\n\n\n\n【レイヤー画像の周辺透かし・影】\nレイヤー画像は、縁を透かすことができ、また影を設定することができます。\n\n\n【レイヤー画像の個別保存】\n切取った（背景透明化した）レイヤー画像は、透過PNGファイルとしてカメラロールへ個別に保存することができます。\n※レイヤー個別保存の場合、端末によって最大1024x1024もしくは640x640となります。\n\n\n【 文字入れ】\n手書き日本語フォントを3種類搭載！システムフォントと合計して300種以上のフォントが使えます。\n\n\n\n【最大解像度（背景/全体の解像度）】\n・iPhone 5s/5c/5, iPad 4/3\n　→3264 × 2448\n \n・iPhone 4S/4, iPad mini, iPod touch(5世代)\n　→2048 × 2048\n \n・iPhone 3GS\n　→1280 × 1280\n\n\n【最大レイヤー枚数（画面サイズモード時）】\n・iPhone 5s/5c/5, iPad Air/4/3, iPad mini Retina\n　→20枚\n\n・iPhone 4S, iPad mini, iPod touch(5世代)\n   →15枚\n\n・iPhone 4\n　→12枚\n\n・iPhone 3GS\n　→7枚\n\n\n\n【編集の復元】\n編集を途中で中断してもいつでも再開できます。\n\n\n【写真のシェア】\nInstagram, Twitter, Facebookにシェアすることができます。\n※FacebookはiOS 6のみ\n\n\n【ご注意点】\n◆レイヤーメニューの「保存」について◆\n \nレイヤーメニューの保存は、切り抜いた画像を個別にカメラロールに保存します。背景画像との合成写真を保存する機能ではありませんのでご注意ください。\n \nまた、個別保存したレイヤー画像はカメラロール上で、他の画像と重なって表示される場合があります。これはカメラロールの仕様（バグ）で、こちらでは対処のしようがありません。\n \n切り抜いた画像を選択して表示すると、背景が黒く表示されますが、正常に透明化されております。透明化された画像は他のアプリなどのスタンプなどの利用ができます。\n \n◆メインメニューの「保存/シェア」について◆\n \nメインメニューの保存は、背景画像とレイヤー画像を全て合成して保存する機能です。\n \n合成写真を作る場合は、こちらを使用します。\n\n\n◆レイヤー1枚あたりの最大解像度（最高画質モード時）◆ \n・iPhone 5s/5c/5, iPad Air/Retina \n　→2048 x 2048 \n\n・iPhone 4S/4, iPod touch(5世代) , iPad mini \n　→1280 x 1280', '2013-07-03 10:36:31', '2014-05-23 15:04:34')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
