Error - 2014-05-23 15:04:40 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('669196929', 'JP', 'com.algoriddim.djay2-ios', 'djay 2', 'http://a1805.phobos.apple.com/us/r30/Purple/v4/d2/8e/5b/d28e5b6b-4404-4e73-a695-cef78fa06e98/mzl.cehbikcp.53x53-50.png', 'http://a321.phobos.apple.com/us/r30/Purple/v4/d2/8e/5b/d28e5b6b-4404-4e73-a695-cef78fa06e98/mzl.cehbikcp.75x75-65.png', 'http://a1358.phobos.apple.com/us/r30/Purple/v4/d2/8e/5b/d28e5b6b-4404-4e73-a695-cef78fa06e98/mzl.cehbikcp.100x100-75.png', '500.00000', 'JPY', 'algoriddim GmbH', 'iOS_Apps', '6011', 'toppaidipadapplications', 0, '** GET THE BEST SELLING DJ APP FOR 50% OFF - LIMITED TIME ONLY!! **\n\ndjay 2 - これで準備万端。次世代を担うベストセラーiOS DJソフトウェア、Apple Design Awards受賞のdjay - 再設計、再構築され、djay 2として生まれ変わりました。 \n\n• 「隠れた才能(スクラッチマスター)を開花させたい? djayなら、初心者でもプロでも大丈夫。」 — The New York Times(ニューヨークタイムズ)\n• 「djay 2 は衝撃的。耳にも。目にも。」 — iMore(iモア)\n• 「これまで見てきたiPad用音楽系アプリの中で最も印象的なひとつにあげられる。」— Engadget(エンガジェット) \n• 「我々が知る限り、DJ-ing(DJすること)に革命を起こすであろう。」— ZDNet(ZDネット) \n• 「iPadアプリ全体を見ても、逸品のひとつにあげられる。」— Macworld(マックワールド) \n\niPadを完全装備のDJシステムに変換します。ライブラリにシームレスに直結し、iPadにあるあなたのプレイリストや好みの曲にダイ レクトにアクセスします。ライブパフォーマンス、その場でミックスの録音、あるいはdjay 2にミックスを任せ(Automixモード作動)、自動的につなぎめのない(シームレス)ミックスを創り出すこともできます。プロはもちろん、音楽好きな初心者も直感で理解で き、感覚を開花させ、手応えのあるDJ体験を提供します。\n\n機能ハイライト\n• ミュージックライブラリへのダイレクトアクセス\n• Automix(オートミックス、自動ミックス機能)\n• オーディオFX: フランジャー、フェイザー、エコー、ゲート、ビットクラッシャー\n• ミキサー、テンポ、ピッチベンド、フィルター、EQコントロール\n• ルーピング & キューポイント \n• ライブ録音 \n• サンプラー: スヌープ・ドッグ、DJキューバート他のサウンドパック付き\n• シングルデッキモード\n• Colored HD Waveforms™(色付きHD波形)\n• ヘッドホンを用いたプレキューイング(Griffin DJ ケーブルまたはマルチチャンネルオーディオインターフェイス使用時)\n• アドバンスドタイムストレッチング (キーロック)\n• キー検出とマッチング (必要条件: Retinaディスプレイ付きiPad MiniあるいはiPad Air、それ以上)\n• 自動ビート検出\n• 自動ゲイン\n• iCloud統合 メタデータへシンク\n• AirPlay統合 \n• iTunes Store統合\n• Inter-App AudioとAudiobus対応\n• 主要オーディオフォーマットに対応(DRM保護楽曲には対応していません)\n• DJ MIDI コントローラ対応: パイオニア DDJ-WeGO, DDJ-WeGO2, DDJ-ERGO, ベスタクス Spin 2, Numark iDJ Pro, Mixdeck Quad, iDJ Live, iDJ Live II, ION iDJ 2 Go, Reloop Beatpad, カシオ XW-J1, フィリップス M1X-DJ \n\ndjay 2 の新機能\n\n新ユーザーインターフェイス\n• マルチパフォーマンスレイヤ: ターンテーブル、波形、サンプラー間の切り替えが簡単になり、パフォーマンスを次のレベルへ。\n• シングルデッキモード: デバイスを回転させ、縦向きモードにし、個々のデッキを大きくなったコントローラで操作。\n\nHD Waveforms™(HDウェーブフォーム - HD波形)\n• パラレルスクローリングウェイブビュー: 横に並んだ2つの曲に触れながら、相互作用。\n• カラーウェイブフォーム: 周波数を元にしたカラーマッピングを使って、視覚的に音(ドラム、ボーカルやベースラインなど)を探知。\n• スライドモード: ビートを波形に変形し、一時的にホットキューにすることで、その場でリミックスが可能に。\n• スリップモード: リリースした瞬間に瞬時に戻るため、流れを邪魔することなくスクラッチが可能に。\n• ビートグリッド: 的確なキューイングとビートマッチングに自動検出ビジュアルビートマーカーを使用。  \n\nサンプラー & ドラムパッド\n• サンプルプレイヤー: 12個あるサンプルパッドのいずれかをタップし、プレバンドルコンテンツから音をトリガー。\n• サンプルレコーダー: オリジナルのワンショットサンプルを作るために再生中のデッキを生録音。\n• カスタムプリセット: サンプルを割当、個々のパッドを色分け、カスタムプリセットとして保存。\n\n新ミュージックライブラリ\n• トラックキュー: リクエストや来たる曲のプレイリストを素早く創作。\n• プレイリスト履歴: セッション中に何がプレイされたかを参照し、後々ミックスを再作成。\n• インスタントプレビュー: デッキに読み込む前に、タップ&ホールドでライブラリにある曲をプレビュー。\n• ライブラリ分析: ライブラリを事前に分析すると、曲を読み込む時にBPM、波形などが瞬時に利用可能に。\n• フルスクリーンモード: ライブラリをダイナミックに拡大させ、曲の閲覧が容易に。\n• ライト&ダークテーマ: その場の照明環境に合わせ、ディスプレイを見やすくするために、ライブラリの明るさを調整。\n\nアドバンスドパフォーマンスツール\n• Perfect Sync™(パーフェクトシンク): シームレスに曲をブレンドし、完璧なトランジション／マッシュアップを創出。\n• ループFX: XYパッド上を指でスワイプしながら、ライブリミックス。同時フィルタリングのビートがマッチしたループを実現。', '2013-07-25 16:00:00', '2014-05-23 15:04:40')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:04:41 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('590039289', 'JP', 'biz.koikoi.stereogram2', '3D視力回復2/HD', 'http://a211.phobos.apple.com/us/r30/Purple/v4/c1/d6/60/c1d660ca-8840-d76d-ec28-4e6716bef71a/mzl.wqqgvepx.53x53-50.png', 'http://a727.phobos.apple.com/us/r30/Purple/v4/c1/d6/60/c1d660ca-8840-d76d-ec28-4e6716bef71a/mzl.wqqgvepx.75x75-65.png', 'http://a1476.phobos.apple.com/us/r30/Purple/v4/c1/d6/60/c1d660ca-8840-d76d-ec28-4e6716bef71a/mzl.wqqgvepx.100x100-75.png', '100.00000', 'JPY', 'koikoi.biz', 'iOS_Apps', '6012', 'toppaidipadapplications', 0, '★ホワイトデイキャンペーン ¥250 ➡ ¥85\nこの機会をお見逃しなく♪\n\n●大人気の3D視力回復にHD版が登場しました。\n・画像はすべて新作です。力作揃いですので是非ご覧下さい。\n・ステレオグラムによる立体ゲームを搭載しましたので、こちらも是非お試し下さい。\n\n■ありがとうございます。\n・iPad有料総合1位獲得しました。発売開始からわずか20時間での達成となりました。\n皆様、本当にありがとうございます。\n・iPhone有料、ヘルスケア／フィットネスカテゴリ1位獲得しました。\n・iPhone有料総合13位獲得しました。\n\n====== ユーザ様レビューのご紹介 =====\n\n・面白い ★★★★★  - Version 1.5 - Feb 20, 2013\n楽しみながら何となく目の疲れも取れているところがいい。ついつい見てしまう。\n\n・便利！ ★★★★★  - Version 1.5 - Feb 22, 2013\n交差法と平行法が選択できるところが凄く便利！重宝しています(*^^*)\n\n・ありがとうございました。 ★★★★★  - Version 1.5 - Feb 13, 2013\n前作から、2012年夏より使っています。 始める前は左右共に0.1以下でした。 \nこのアプリを使ったり目の体操、マッサージを続けました。 左0.3 右0.3 両眼0.7になりました。 \nめでたく車の運転免許証のメガネ制限がなくなりました。 \n使いやすい様にアップデートしていただき ありがとうございました。 これからも、良いアプリを作ってください。 本当にありがとうございました。\n\n===========================\n\n■アプリ概要 \nこのアプリは3Dステレオグラムを利用して、視力の回復を図るものです。\nまた、iPhoneやiPadを使った後の疲れ目にもご利用いただけますので、すべてのiPhone,iPad,iPod touchユーザ様必携のアプリです。\n\n\n●視力回復 \n視力には、眼球視力と脳内視力があります。 \n眼球視力とは一般的に言われている視力のことで、見たものを目がピントを合わせて見る力をいいます。 \n脳内視力とは目で見たものを脳が認識して映像化する力のことをいいます。 \n視力を回復させるためには、眼球視力だけではなく脳内視力も上げるのが理想的です。 \n\n本アプリ「3D視力回復」は、3Dステレオグラム画像を見ることで、 \n・3D画像をピントを合わせることを意識してみることで脳内視力を鍛え、 \n・またその作業が普段は使わない目の筋肉を鍛えることになり、 \n・平行法と交差法という逆の見方をすることによって目のストレッチにもなります。 \n・また、ステレオグラムですので、楽しみながら続けることができます。 \n\nこのように本アプリを使用することにより、「一挙4得」で総合的に目に良い運動を楽しみながらすることができます。 \n\n■使い方 \nステレオグラムの平行法と交差法で画像を見て下さい。1日３分、毎日継続して使用して下さい。 \n近視には平行法、遠視には交差法が効果的です。画像を見ながらデバイスを前後に動かすとよりいっそう効果的です。 \n\n■平行法 ■交差法 \nアプリ内にてご説明しています。 \n\n3Dステレオグラムを見るのは目の運動になりますので、多少なりとも目が疲れます。目が疲れ過ぎないように、長時間の使用はお控えください。 \n\n■機能一覧 \n・明るさ調整機能 \n・ピンチイン/ピンチアウトによる画像の縮小／拡大機能 \n・動く3Dゲーム\n・54種類すべての3D画像について、平行法／交差法／解答の画像があります。 \n・しおり機能 \n・説明用画面(平行法の絵による説明,FAQ等) \n・スライドショー機能／スライドショーは全画面でご覧いただけます。 \n・上下反転機能 \n・練習用初級画像 \n・画像の大小自動変化機能\n\n◇お知らせ◇\n当社の「睡眠アプリ」は聴くだけでいつの間にか眠れる画期的なアプリです。\n他にも、勉強前に聴くだけで集中力がアップして勉強がはかどる音やリラックスする音も収録しています。\n是非、お試しください。\n\nバージョンアップ予定 \n・3D画像を随時追加します。', '2013-01-05 10:44:16', '2014-05-23 15:04:41')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:04:45 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('765224318', 'JP', 'net.7minworkoutapp.ipad', '7 分間エクササイズ (iPad) - 7 Minute Workout Challenge HD for iPad', 'http://a1512.phobos.apple.com/us/r30/Purple6/v4/aa/27/83/aa2783a4-25f6-16be-1ef0-125e68d990d5/mzl.mkfsfmoy.53x53-50.png', 'http://a28.phobos.apple.com/us/r30/Purple6/v4/aa/27/83/aa2783a4-25f6-16be-1ef0-125e68d990d5/mzl.mkfsfmoy.75x75-65.png', 'http://a825.phobos.apple.com/us/r30/Purple6/v4/aa/27/83/aa2783a4-25f6-16be-1ef0-125e68d990d5/mzl.mkfsfmoy.100x100-75.png', '300.00000', 'JPY', 'Fitness Guide Inc', 'iOS_Apps', '6013', 'toppaidipadapplications', 0, '「7 分間ワークアウト」はリサーチに基づいたワークアウトプログラムです。世界的なヒットを記録しています! \n\n論文誌 ACSM にも掲載され、ニューヨークタイムズによって人気を獲得した「7分間ワークアウト」はシンプルですが、効果的です。 \n\n30 秒間行うワークアウトを 10 秒間隔で行う 12 のエクササイズを研究者が厳選。休みを少なく入れた高集中トレーニングで、1 日のメタボリズムを高めることができ、7 分強の運動で、1 時間以上の運動量に匹敵する効果が得られます。 \n\n最も注目していただきたいのは、このエクササイズがとてもシンプルだという点です。特殊な機器は必要ありません。どこにいてもエクササイズできるのです! これで言い訳はできませんね。 \n\nこのアプリでは、研究によって裏付けられたワークアウトを行っていきます。効果を追跡し、ワークアウトを続けるうちにご褒美ももらえるようになっており、楽しく続けることができます。 \n\nアプリの機能: \n\n- おしゃれなデザイン \n- 男性と女性のトレーナーが、ビデオ、オーディオ、画像、テキストでエクササイズをご案内します \n- すべてのコンテンツが料金に含まれています (追加料金はかかりません。インターネット接続も必要ありません) \n- ウェイトトラッカーで体重を管理できます \n- アクティビティカレンダーでアクティビティを追跡できます \n- ワークアウトしながら、さまざまなアチーブメントをアンロックできます \n\n弊社はフィットネスのプロを集めアプリ開発を行っています。最高品質の製品をお届けすることに細心の注意を払っています。ご意見やご提案などは、お気軽にお寄せください。アプリは定期的に追加料金なしでアップデートしていただけます。', '2013-12-14 10:47:23', '2014-05-23 15:04:44')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
