ーは、iPhone 4S、iPad（第3世代）ではご利用いただけませんので、ご注意ください。\n\n\n\n▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△▼△\n\n【対応端末のご注意】\n・iOS6.0～iOS7.1を搭載した、iPhone 4S, iPhone 5, iPhone 5s, iPhone 5c,\n　iPod Touch（第5世代 32GB/64GB バックカメラあり）, iPad Air, iPad mini（第2世代）\n・iOS6.1.3～iOS7.1を搭載した、iPad（第3世代）, iPad（第4世代）, iPad mini（第1世代）\n\n※上記以外の端末やOSでの動作保証は致しておりませんので、ご注意ください。\n※iPhone 4 / iPod Touch（第4世代） / iPad 2以前, iPod Touch（第5世代 16GB）などは対応しておりません。\n※iPhone 4ではダウンロードを行うことは可能ですが、動作保証の対象外となりますので、ご注意ください。\n\n【ご利用上のご注意】\n※本アプリを端末から削除してしまいますと、ゲームのセーブデータも一緒に削除されてしまいますので、ご注意ください。\n※オリジナル版に存在しました「コラボクエスト」や「コラボ装備」などは、本アプリには登場しませんので、ご注意ください。\n\n■公式Webサイトはコチラ！\nhttp://www.capcom.co.jp/monsterhunter/P2ndGi/', '2014-05-08 14:05:26', '2014-05-23 15:04:45')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
