Error - 2014-05-23 15:04:49 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('875242534', 'JP', 'com.mobileventures.LittleBuilders', 'リトル ビルダーズ – 建設現場が舞台の楽しい体験＆ゲーム', 'http://a1437.phobos.apple.com/us/r30/Purple/v4/d6/b5/cc/d6b5ccee-72f0-b928-7b95-10b70090e529/mzl.lgndaqah.53x53-50.png', 'http://a305.phobos.apple.com/us/r30/Purple/v4/d6/b5/cc/d6b5ccee-72f0-b928-7b95-10b70090e529/mzl.lgndaqah.75x75-65.png', 'http://a974.phobos.apple.com/us/r30/Purple/v4/d6/b5/cc/d6b5ccee-72f0-b928-7b95-10b70090e529/mzl.lgndaqah.100x100-75.png', '300.00000', 'JPY', 'Fox & Sheep', 'iOS_Apps', '6016', 'toppaidipadapplications', 0, 'ショベルカーの運転やセメントの混合、建物の屋根の建設やクレーンの操縦、そして家のペンキ塗りなど、やってみたいと思ったことがありますか？そんな願いをかなえてくれる私たちの建設現場へようこそ！ここでは小さなビルダー達が、穴を作ったり、壁塗りをしたり、ペンキを塗ったり、セメントを混ぜたり、、、とにかくやることがいっぱい。彼らはあなたの助けを待っています！ \n\nここでは、セメントの混合、クレーンの操縦、トラックの積載、壁の建設などが体験できます。また、建設現場にはアクシデントが付き物です。水道管が突然破裂してしまったり、建物が掘った穴に落ちてしまったり、セメントが乾いてないレンガの壁が突風で飛ばされてしまったり。さまざまな面白い出来事を目撃することができます。\n\nリトル ビルダーズは、本格的なビルダー(建設)体験が楽しめる、8歳以下のお子様向けでは初の3Dアプリです。アニメーションや機能は、お子様の年齢に合わせて自動再生モード、もしくはタッチ操作に設定することができます。\n\n100以上のインタラクティブなアニメーションや驚きが体験できる、5つのシナリオ:  \n1. ショベルカーを操縦して、トラックにモノを積んで、水道管を修理しよう。\n2. 家をいろんな色のペンキで塗って、トラックの積荷を降ろそう。\n3. クレーンを操縦して、家の新しい屋根を作ろう。\n4. セメントを混ぜて、リアルな壁を作ってみよう。\n5. 大きなセメントミキサー操縦して、広い面積にコンクリート打設をしてみよう。\n\n驚きのグラフィックと素晴らしいアニメーション、操作が簡単なインターフェイス。文字は無く、App内での購入もありません。今すぐダウンロードして建設をスタートしましょう！\n\n私たちが制作した、他の素晴らしい子供用アプリもチェックして下さい：\n\n「体験型動物園」 –iPadおよびiPhone用の素晴らしい絵本アプリです。20以上の動物の美しいインタラクティブアニメーションが楽しめ、あらゆる年齢のお子様や動物愛好家のお気に入りとなること間違いなし。\n\n「ナイティ・ナイト 」 – 可愛らしい動物や音楽、素晴らしいナレーションで、お子様の毎日の寝付けに最適のアプリです。\n\n「リトルフォックス・ミュージックボックス」 – 100以上のインタラクティブ要素が散りばめられた3曲の歌と、あなた自身の歌を録音できるリトルフォックス・ミュージックスタジオで構成された唱歌集。\n\n私たちのアプリで何らかの問題が生じたり、質問やコメントがありましたら、いつでもcontact@foxandsheep.comのほうへご連絡下さい。喜んでサポートさせていただきます。その際は、あなたのデバイスとiOSのバージョンをご明記下さい。\n詳しい情報やサポートにつきましては、私たちのウェブサイトwww.foxandsheep.comをご参照下さい。', '2014-05-21 20:21:43', '2014-05-23 15:04:49')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
