めるポイントがあり、ご両親がお子\n　さまを褒めたり励ましたりしてあげられます。\n\n・ごっこの工程の随所に、知育的な要素を\n　取りいれています。\n\n・見た目の質感や工程など、リアル感に\n　こだわりました。\n\n『なりきり!!おかしの家をつくろう！』は、\nパパママとお子さまとで一緒に楽しんでいただ\nけます。\nお子さまをひざの上に乗せて見てあげて下さい。\n\n--------------------------------------------\n・対象年齢：3才から', '2014-04-16 12:33:06', '2014-05-23 15:04:50')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
