- \nRussian, Swedish, Finnish, Chinese Simplified, English, Spanish, Korean, French, Portuguese, Dutch, Norwegian, Japaneese, German, Italian, Indonesian, Swahili, Chinese Traditional, Danish, Croatian, Greek, Afrikaans, Albanian, Chichewa, Cibemba, Polish, Czech, Hungarian, Lingala, Malagasy, Maltese, Ossetian, Romanian, Serbian, Sesotho, Slovenian, Tumbuka, Xhosa, Zulu,Bulgarian,Georgian, Turkish, Slovak, Armenian, Arabic, Tagalog,Yoruba and some others...\n\nPrev version has bookmarks, notes, fast search and...\n1) restore opened book and chapter when reopen application\n2) size of translations zipped and has 1.5 Mb instead of 10 Mb before\n3) fastest search, speed up to 10x ! (unfortunately names with accent not looking yet)\n4) when downloading freeze, this exception error and you can redownload again, also,\n    you can cancel download\n5) On devices with iOS >= 5.0 you can change brightness\n6) new book title page with splitting books\n7) correct arabic support, for right-to-left text alignment\n8) support devices - iPod/iPhone w/wo retina, iPad w/wo retina, iPad mini. \n    Minimum support for iOS 4.3 but best from 5.0\n\nTwice tap on the screen to hide bottom panel. Touch with two fingers, \nto showing all books for choices book and chapter\n\nTODO:\nMore more more new features in next releases. \n\nThe contract of a public offer:\nhttp://jwbible.chepil.info/viewtopic.php?f=3&t=24\n\n***\nIf you have crash with application after update, please, \ndelete application and install it again from AppStore, It will help you. \n\nDear users! I can\'t answer you via AppStore feedbacks.\nIf you have a trouble, or If you need help, please, use support forum http://jwbible.chepil.info\n***', '2012-12-13 09:04:54', '2014-05-23 15:04:51')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:04:53 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('504001448', 'JP', 'com.argosy.muscular', 'Muscle Premium', 'http://a164.phobos.apple.com/us/r30/Purple/v4/93/6b/95/936b9587-e4e8-6f94-a5a5-edaaac545151/mzl.yphjntoh.53x53-50.png', 'http://a1032.phobos.apple.com/us/r30/Purple/v4/93/6b/95/936b9587-e4e8-6f94-a5a5-edaaac545151/mzl.yphjntoh.75x75-65.png', 'http://a549.phobos.apple.com/us/r30/Purple/v4/93/6b/95/936b9587-e4e8-6f94-a5a5-edaaac545151/mzl.yphjntoh.100x100-75.png', '2000.00000', 'JPY', 'Visible Body', 'iOS_Apps', '6020', 'toppaidipadapplications', 0, '*****このアプリケーションは、筋肉および骨組織の詳細を考察するとともに、患者に対して生体構造を説明することを目的とした最も販売数の多い参考資料です。理学療法士、スポーツトレーナー、マッサージ療法士、整形外科専門家等によって推薦されています（以下のレビューを確認してください!）。\n*****Muscle Premiumは、多数の筋肉および骨組織、靭帯、嚢および神経に関する実際の3Dモデルを含んでいます。人体の一部の理想的な画像を作成するために、回転、拡大表示および分析することが可能です。\n*****筋肉付着部は、骨組織に対する色彩表示、更に筋肉に対するピンを利用することによって視覚的に描写されます。一般的な筋肉の動作は、3Dモデルを機能させることによって再現することが可能です。この3Dモデルでは、拡大表示および回転が可能です。発音ならびに詳細な定義によって、その起始、付着点、神経支配、血液の供給、動作が説明されます。多数のクイズ式問題によって、迅速な学習および考察が促進されます。\n*****iPad 2またはそれよりも新しいバージョン、iPad mini, iPhone 4あるいはそれよりも新しいバージョン、iPod touch（5th generation）と共に機能します。iOS 6およびiOS 7に対しても互換性があります。\n*****このアプリケーションは、英語によるアプリケーションです。\n\n*****iMedicalAppsは、Muscle Premiumについて下記のように説明しています。すなわち、「これは、複雑な生体構造を強調している全く素晴らしいアプリケーションである…見事な詳細部分のみならず、3D画像の組み合わせによって、このアプリケーションが市場におけるリーダーであることを意味している。」\n\n*****Muscle Premiumに関する顧客のレビューの確認：\n「私は、患者に対する指導の手段としてスポーツ医学の実務で［Muscle Premium］を利用していますが、非常に役立っています。」\n「このアプリケーションによって、死体による実験での無駄な時間が短縮され、ストレスを全く感じなくなりました!」\n「整形外科研修医の3年生として、［このアプリケーション］は、解剖領域の更なる完全な把握に対する原点を与えてくれました。外科的アプローチ、解剖の計画において、このような参考資料を保持することは、非常に有用です。」\n「…［Muscle Premium］は、患者に対する医学上の論点を説明することにおいて、非常に有用です。このアプリケーションが導く継続的な学習は、実際の喜びを生む結果となります。」\n「私は音声言語病理学者として勤務していますが、このアプリケーションのプログラムは頭部、首の研究に対して非常に役立っています。」\n「このアプリケーションのプログラムを利用する以前、あらゆる筋肉を記憶することは、混乱を招き、記憶自体が不可能であると思われました。しかしながら、このアプリケーションのプログラムを利用することにより、自分が納得するまで1日あるいは数日で一定の部位を学習することが可能であり、その後他の部位の学習に移動することができます。更に、クイズ式問題によって、常に新しく頭に記憶されるアプリケーションは非常に有用です。」\n「私は25年以上に及びマッサージ療法士として勤務していますが、私は研修会でこのアプリケーションのプログラムを利用しています。」\n「私はフィットネストレーナーになるために研修を受けていますが、［このアプリケーション］は、詳細に画像が描写され、事実上実践用のアプリケーションです。従って、筋肉について学習することが非常に簡単になります。」\n「私は、参考資料のために、更に患者に対する指導のために、PTクリニックでこのアプリケーションを殆ど毎日利用しています。」\n「これは素晴らしいアプリケーションです。私は理学療法士を目指す学生ですが、このアプリケーションは解剖学の授業で非常に有用です。」\n「私のカイロプラクターが、iPadでこのアプリケーションを紹介してくれました。このアプリケーションが非常に素晴らしかったので、私自身（プロボイスシンガー、教師）も購入し、夫（マッサージ療法士の学校に在学中）もこのアプリケーションを購入しました。」\n\n当該モデルについて\nMuscle Premiumは、人体の筋肉組織に関して利用可能な最新、完全かつ実際の3Dモデルです。これには、生物医学的視覚化において長年の経験を積んだメディカルイラストレーターの専門家チームによって作成された高度かつ詳細な筋肉、骨格のモデルが含まれています。これらの専門家は、あらゆるモデル、その定義を考察する教授、医療の専門家と提携し、作業を行っています。\n\n弊社への連絡\n顧客の意見は、優れた製品に対して非常に重要な要因となります!　弊社への連絡を希望する方は、support@visiblebody.comまでご連絡をお願いいたします。Muscle Premiumの利点についてお知らせください。更に、このアプリケーションが説明通りに機能しない場合には弊社にご連絡をお願いいたします。あるいは、アプリケーションの改良点などのアイディアについてもお知らせください。', '2012-02-29 05:19:11', '2014-05-23 15:04:53')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
