Error - 2014-05-23 15:04:58 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('627281579', 'JP', 'com.zappallas.ShirogohanRecipeAppliPad', '和食の基本55 for iPad（白ごはん.com）by Clipdish ‐お料理初心者でも安心、丁寧な下ごしらえの基礎と和のおかずレシピ‐', 'http://a1156.phobos.apple.com/us/r30/Purple2/v4/e5/5f/ea/e55fea7d-b990-4c23-173d-5d332b87bd40/mzl.khfaguxh.53x53-50.png', 'http://a24.phobos.apple.com/us/r30/Purple2/v4/e5/5f/ea/e55fea7d-b990-4c23-173d-5d332b87bd40/mzl.khfaguxh.75x75-65.png', 'http://a389.phobos.apple.com/us/r30/Purple2/v4/e5/5f/ea/e55fea7d-b990-4c23-173d-5d332b87bd40/mzl.khfaguxh.100x100-75.png', '200.00000', 'JPY', 'ZAPPALLAS, INC.', 'iOS_Apps', '6023', 'toppaidipadapplications', 0, '[フード/ドリンク]ランキング1位獲得しました。\nありがとうございました！\n\n＊＊セール情報＊＊＊＊＊＊＊＊＊\n通常価格：400円⇒\nセール価格：200円\nでご提供中です！\n************************\n\n和食の入門書としても、\nもっと深く知りたい人にもお勧め！\n\n和食の基本（定番ごはん・おかず）から、おもてなし料理まで、\n丁寧に解説した55レシピ収録。\n\n意外と知らない＆いまさら聞けないポイントを\nしっかりおさえて、分かりやすく解説します。\n\n================================ \n\n「Clipdish」アプリシリーズ、 \nついに３５万ダウンロードを突破いたしました！ \nありがとうございます！これからもよろしくお願いいたします。 \n▼アプリ一覧はコチラ \nhttp://clipdish.jp/about/about_clipdish_app \n\n================================ \n\n【年末年始休業のご案内】 \n平素はClipdishアプリシリーズをご利用頂きまして、誠にありがとうございます。 \n弊社では誠に勝手ながら、下記の期間お問合せ窓口業務をお休みさせて頂きます。 \n\n休業期間：12/29（日）～1/3（金） \n休業期間中に頂きますお問合せは、1/4（土）以降に順次対応させて頂きます。 \n\nなお、12/28及び 1/4・5 は、メールのみの受付とさせて頂きます。 \n\nお問合せへの返答、調査には日数を頂く場合がございます。 \nご不便をお掛け致しますが、何卒ご了承頂けますようお願い申し上げます。 \n\n※お問合せの際は、「zappallas.com」ドメインからのメールを受信可能に設定頂きますようお願い致します。 \n\n================================\n\n【収録レシピ】\n\n■基本の基本\n炊飯器でのごはんの炊き方,鍋炊きごはんの炊き方,味噌汁の基本,かつおだしの基本,煮干しだしの基本\n\n■コツのいる野菜の下ごしらえの基本\nたけのこのあく抜き,ふきの下ごしらえ,ゴーヤの下ごしらえ,ごぼうのささがき,きゅうりの塩もみ\n\n■下ゆでの基本\nほうれん草のゆで方,枝豆のゆで方,春菊のゆで方,オクラのゆで方,とうもろこしのゆで方\n\n■魚介の下ごしらえの基本\nあさりの砂抜きのやり方,いわしの手開きのやり方,あじのさばき方（片開き）,えびの下処理,霜降りのやり方\n\n■味作りの基本となる、合わせ調味料のレシピ\n自家製めんつゆ,寿司酢と酢飯の作り方,南蛮酢の作り方,白練りみそ,甘酢の作り方\n\n■薬味の基本\n大根おろしの基本,みょうがの千切りの切り方,刻みねぎの切り方,白髪ねぎの切り方,大葉の千切りの切り方\n\n■和の定番レシピ\nだし巻き卵,いんげんのごま和え,鶏のから揚げ,筑前煮,ぶりの照り焼き\n\n■薬味が活きるレシピ\nなめこおろし,みょうがご飯,焼き味噌,きゅうりの浅漬け,薬味たっぷりそうめん\n\n■絶品ごはんのお供＆漬物\n自家製なめたけ,かぶの葉のふりかけ,生姜の佃煮,黄身の醤油漬け,牛そぼろ\n\n■鉄板ストックおかず\n鮭の南蛮漬け,夏野菜の揚げびたし,牛ごぼう,こんにゃくのおかか煮,れんこんのきんぴら\n\n■和の基本レシピ\nお浸しの基本,酢の物の基本,浅漬けの基本,魚の煮付けの基本,ぬた和えの基本\n\n\n【その他】\n■用語集\n・切り方(千切り,半月切り,いちょう切り・・・)\n・調味料,食材(赤味噌,白味噌,合わせ味噌・・・)\n・調理器具(落とし蓋,おろし金,蒸し器・・・)\n\n================================\n【スクリーンショット解説】\n\n■1枚目\n「あじのさばき方」レシピのトップです。\n[イメージ]と[材料]ボタンで分かれています。\n\n■2枚目\n「筑前煮」レシピのトップです。\n[イメージ]と[材料]ボタンで分かれています。\n\n■3枚目\n「だし巻き卵」の工程写真です。\n『なめらかな食感にするために一度ざるごしをする』など、丁寧に解説しています。\n\n■4枚目\n「こんにゃくのおかか煮」の工程写真です。\n『味のしみ込みをよくするために、スプーンでちぎるようにして・・』など、丁寧に解説しています。\n\n■5枚目\n「浅漬けの基本」の工程写真です。\n『野菜の重さに対して2%の塩を加えるのが基本・・』など、丁寧に解説しています。\n\n================================\n【著者紹介】\n\n料理研究家\n冨田ただすけ\n\n1980年山口県下関市出身。現在は愛知県在住。\n料理が何より好きで、その中でも和食がいちばん好き。\n\n体にしみ込むような料理を作りたいし、\n忙しいいまの家庭環境でも、少しでもそんな料理が増えてほしいと思っている。\n\nちょっとだけ手間を加えて、料理を美味しく作るコツや工夫を日々考え、\n生活にいかせる情報発信をすることで、少しでも社会に役立ちたいと思う。\n\n\n名古屋の南山大学卒業後は中食の食品メーカー「ロック・フィールド」に就職。\nその後、大阪阿部野の辻調理師専門学校に入り再度勉強をして、\n茶懐石も扱う名古屋の日本料理店「金毘羅」（現在は閉店）で修業につく。\n\n次は食品加工メーカー「寿がきや食品」にて研究開発の職に従事して、\n加工食品でできる限り安全でおいしいものを食卓に届ける仕事に情熱を傾ける。\n\n食品の開発をしながらの6年間は、\n「白ごはん.com」という“いちばん丁寧な和食レシピサイト”を目指すHPを立ち上げたり。\nAll Aboutの「シンプル和食レシピ」のガイドを勤めたりと、料理に関する活動を徐々に広げる。\n\nおよそ10年間の様々な経験を活かし、2013年に料理研究家として再スタートを切る。\n何をやろうか、じっくり考え中。\n\n----------\n[冨田ただすけのサイト]\n白ごはん.com\nhttp://www.sirogohan.com/\n\n和弁当ブログ\nhttp://wagohan.blog72.fc2.com/\n\nAll About和食ガイドページ\nhttp://allabout.co.jp/gm/gp/965/library/\n\n\n================================\n【Clipdish】について\n\n自分の好きなレシピを好きなだけ集めて、自分だけのレシピクリップボードを作成することができる、レシピ管理サービス（無料）です。\nhttp://clipdish.jp \n\n================================\n≪お知らせ≫\n\n■『銀座のママの１０分で男の胃袋わしづかみレシピ』\nただいま、\n300円⇒100円でご提供中です！\n「銀座のママレシピ」で検索してください。\n\n■『本格派お菓子レシピ for iPad（信太康代）by Clipdish -ケーキもクッキーも簡単においしく作れる、本格手作りスイーツ-』\n\n400円⇒200円でご提供中です！\n「本格派お菓子レシピ」で検索してください。\n\n\nこちらもあわせていかがでしょうか。\nよろしくお願いします。', '2013-04-09 16:11:19', '2014-05-23 15:04:58')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
