Error - 2014-05-23 15:05:05 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('870312451', 'JP', 'jp.mangabang.Hanamai', '女帝＆女帝花舞(漫画)全52巻 毎日30分読み放題！', 'http://a1601.phobos.apple.com/us/r30/Purple4/v4/ec/d1/90/ecd190f2-1c8c-01de-de28-caa51bf21ea6/mzl.mrbvlmtg.53x53-50.png', 'http://a469.phobos.apple.com/us/r30/Purple4/v4/ec/d1/90/ecd190f2-1c8c-01de-de28-caa51bf21ea6/mzl.mrbvlmtg.75x75-65.png', 'http://a514.phobos.apple.com/us/r30/Purple4/v4/ec/d1/90/ecd190f2-1c8c-01de-de28-caa51bf21ea6/mzl.mrbvlmtg.100x100-75.png', '0.00000', 'JPY', 'Amazia, Inc.', 'iOS_Apps', '6018', 'topfreeapplications', 0, '電子書籍（マンガ）の常識が変わる！全巻試し読み型マンガアプリ登場！\nマンガはじっくり試し読みしてから購入する時代に！\n会員登録も不要でいつでも、どこでも、かんたんにマンガを楽しめます。\n\n電車の待ち時間や仕事・勉強の合間、寝る前のちょっとした時間にマンガを楽しんで、気に入ったら、コミックを購入しましょう！ \n\n■マンガアプリ紹介\n\n本アプリはテレビドラマ、映画化で有名な大人気漫画『女帝』とその続編である『女帝花舞』全52巻がセットで楽しめるマンガアプリです！\n会員登録などの面倒な作業は一切不要！いつでも簡単に漫画を楽しめます！\n\n■全巻・全ページの試し読みが可能！毎日30分の読み放題！\n\n従来の1話や1巻限定の試し読みとは異なり、本マンガアプリでは全巻・全ページを制限なく試し読みできます。\n最終話を見逃した人も！\nあの名シーンを読み返したい人も！\nあなたの好きな巻、エピソードから試し読みが可能なマンガアプリです。\n\n満足いくまで試し読みをして、作品を気に入ったら、コミックを購入しましょう。\n購入したコミックは時間を気にせず、好きなだけ楽しむことができます。\n\n■1巻100円でコミックを購入！今だけの特別価格です！\n通常、1巻400円ですが、今だけ1巻100円で購入可能！\n\n〓〓〓〓〓〓〓〓〓〓〓〓〓〓\nアプリリリースキャンペーン！\nナント1巻100円で購入可能！8月15日まで！\n期間限定の全巻コレクションのチャンスをお見逃しなく！\n〓〓〓〓〓〓〓〓〓〓〓〓〓〓\n \n■女帝&女帝花舞 マンガ作品紹介\n女帝は倉科遼原作、和気一作作画による累計200万部超の人気漫画。芳文社発行の漫画雑誌「週刊漫画TIMES」に連載された。\n単行本は全24巻。マンガを原作として、2000年に小沢真珠主演で映画化され、2007年には加藤ローサ主演でテレビドラマ化もされた。女帝花舞は「週刊漫画ゴラク」に連載された綾香の娘・明日香を主人公とした続編。倉科遼原作、和気一作作画。全28巻。\n \n著者：\n原作　倉科遼\n作画　和気一作\n \n■作品あらすじ\n女帝\n熊本出身の高校生 立花彩香がホステスとして様々な修羅場をくぐりぬけながら成長し、後に「銀座の女帝」と呼ばれるようになるまでの半生を描いた物語。\n立花彩香は、地元熊本から上京し、銀座を舞台に実業家や小説家、政治家など多彩な男達に支えられ、彼らを支える存在になっていく。\n\n女帝花舞\n“銀座の女帝”彩香の娘として、元総理大臣の孫として、良家の子女が集う有栖川学園に通う明日香。\nしかし、水商売の娘故に、学校での明日香の立場は居心地の悪いものだった。\nある日、偶然目にしたテレビ番組で京都・祇園の舞妓の存在を知り、その魅力に惹かれていく…。\n\n本マンガアプリはアプリ収益を著作権者に還元する事で運営されています。\n著作権者様からの許諾を受けておりますので安心してお楽しみください。 \n\n ■アプリ使用時の注意点\n※マンガデータの削除方法について※ \nダウンロードしたマンガデータを削除したい場合には、削除したいマンガデータを開き、 画面右上のボックス（削除アイコン）から作品データの削除が可能です。\nまた、データ管理からもダウンロードしたマンガデータの削除が可能です。\n\n※購入したマンガデータの復元について※\n一度購入したマンガデータは、itunesアカウントが同じであれば、重複して購入することはございません。\nアプリ内のリストアボタンをタップください。', '2014-05-16 16:00:00', '2014-05-23 15:05:05')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
