Error - 2014-05-23 15:05:07 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('763377066', 'JP', 'com.kakaku.tabelog', '食べログ ～近くのランチが探せる！ 記念日ディナーのレストランや、宴会のお店もランキングと日本最多の口コミを参考に探せる、お店探しで失敗したくない人のためのグルメアプリ～', 'http://a934.phobos.apple.com/us/r30/Purple6/v4/25/32/ff/2532ff34-6cf1-14ed-fee9-a20c87d1b95d/mzl.eczxmiig.53x53-50.png', 'http://a1802.phobos.apple.com/us/r30/Purple6/v4/25/32/ff/2532ff34-6cf1-14ed-fee9-a20c87d1b95d/mzl.eczxmiig.75x75-65.png', 'http://a759.phobos.apple.com/us/r30/Purple6/v4/25/32/ff/2532ff34-6cf1-14ed-fee9-a20c87d1b95d/mzl.eczxmiig.100x100-75.png', '0.00000', 'JPY', 'Kakaku.com, Inc.', 'iOS_Apps', '6023', 'topfreeapplications', 0, '■近くのおいしいランチが探せます■\n食べログには、実際にそのお店で食事した人の口コミが500万件以上集まっています。\nたくさんの人のリアルな感想を参考に、あなた好みのおいしいお店をお探しください。 \n\n\nこのアプリでできること\n\n■１．自分にピッタリの条件でサクサク検索\nどの検索も、条件を追加した絞込み検索が可能です。\n \n・[エリア・駅]と[キーワード]でお店を探す\n地名、エリア名や駅名と、\n　店名、料理ジャンルなどのキーワードで手早く検索\n　できる検索窓をトップに設置しました。\n \n・【エリア・駅・条件からお店を探す】\n　エリアやキーワードだけでなく、営業時間や予算\n　などの条件で絞りこんだ検索ができます。\n \n・【現在地周辺のお店からお店を探す】\n　現在地周辺のお店のリスト/地図をワンタップで\n　表示できます。\n（※位置情報を利用します。）\n \n・【行った・行きたいからお店を探す】（※要ログイン）\n　食べログアカウントをお持ちの方は\n　「行った・行きたい」に記録しているお店から\n　気になるお店のリスト/地図をワンタップで\n　表示できます。\n\n\n■２．行ったお店、行きたいお店をまとめて管理\n食べログアカウントをお持ちの方は、\n行ったお店や、行きたいお店を\n「行った・行きたい」に登録することで、自分だけの\nお店リストを作ることができます。\nリストは、 【行った・行きたいからお店を探す】からワンタップで\n見ることができ、様々な条件で検索できます。\nまた、PCサイトやスマートフォンサイトでログインする\nことで、アプリと同じリストを利用いただけます。\n \n \n■３．気になったお店の予約も共有も簡単\nお店の情報ページに電話番号、オンライン予約窓口、\n地図、共有の必要機能を集約したことで、ページ間を\n行き来する手間なく、お店選びから予約、メール・\nSNSなどでのお店情報の共有までが可能になりました。\n\n■４．口コミ＆写真もアプリからサクサク投稿\n写真投稿機能を改良し、一度に複数枚まとめて投稿\nでき、自由に並び替えができるようになりました。\n\nほか、PCサイト、SPサイトでご利用いただける機能を\n随時アプリに搭載する予定です。\n\n\n◆◇   プレミアムサービスご登録について◇◆\n本アプリは無料でご利用いただけますが\nPCサイト（ http://tabelog.com/ ）や\nスマホサイト（ http://s.tabelog.com/ ）で\nプレミアムサービス（月額300円＋税）\nにご登録いただくことで\n広告が表示されなくなるほか\n下記の機能がアプリでも使えるようになります。\n・ランキング機能\n　検索結果を点数順に並び替える機能です。\n \n・こだわり検索機能\n　予算、営業時間以外にも様々な検索条件を\n　ご利用いただけるようになる機能です。\n \n・「行った・行きたい」絞込み、並べ替え\n　自分の「行った・行きたい」をこだわりの条件\nで絞り込んだり、お気に入りの順に並べ替えたり\nすることができます。\n \n・プレミアムクーポン機能\n　最低でも20%OFF以上、他のクーポンよりも必ず\n　5%以上おトクな厳選されたクーポンがご利用\n　いただけるようになる機能です。\n\n■■■■■■■■ 食べログとは？ ■■■■■■■■\n食べログは“ランキング”と“口コミ”で探せる\n「お店選びで失敗したくない」人のためのグルメサイ\nトです。\nユーザーから寄せられた日本各地の飲食店情報を無料\nでデータベース化し、実際にお店で食事したユーザー\nの意見や感想を集めて共有することで、お店選びで\n失敗しない、本当に信頼できるグルメサイトを実現\nしています。\nPCサイトURL：http://tabelog.com/\n\n■■■■■■■■ 食べログの特徴 ■■■■■■■■\n【日本最大のレストランデータベース】\n食べログでは、今までのグルメサイトに載っていな\nかった「インターネット上で広告宣伝をしない美味\nしいお店」も検索できるように、日本全国のお店を\n無料掲載によってデータベース化しています。\nユーザーの皆様が毎日新しいお店をどんどん登録して\nいますので、現在では全国約75万件という圧倒的な数\nのレストラン情報を掲載しています。\n試しに、知っているお店をいくつか検索してみてくだ\nさい。食べログのヒット率に驚くはずです。\n\n【ユーザーの評価を基にした格付け・ランキング】\n食べログに掲載されているお店には、全て「5点満点\nの点数（格付け）」が付いています。\nこれはユーザーの皆様から寄せられたお店の個人評価\nをもとに、そのユーザーの方の信頼度を加味した独自\nのロジックで算出されています。\n点数が高ければ、それだけ「失敗しない確率が高い」\n。そんな格付け・ランキングシステムを目指し、日々\nロジックの見直しを行っております。\n3.8以上のお店をいくつか訪れてみれば、食べログの\n点数の信頼性を実感できるはずです。\n \n【実際に食事した人のリアルな口コミ】\n食べログに投稿された口コミ数は500万件と日本最大。\nしかも、ポジティブな内容だけでなく、ネガティブな\n内容も掲載しています。\n人の味覚や嗜好は千差万別。賛否両論があって当然な\nので、きちんと両方掲載していくことが口コミサイト\nとしての信頼性において重要なポイントであると考え\nています。また、口コミの内容も読み応えのあるもの\nが多く、量・質ともにNo.1と言っても過言ではありま\nせん。\nさらに、文章による口コミだけでなく、その時撮影し\nた写真も1,000万枚も投稿されています。文字だけで\nなくビジュアルでも参考になる充実した口コミ情報を\n提供しております。', '2014-02-05 01:52:07', '2014-05-23 15:05:07')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
