Error - 2014-05-23 15:05:08 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('513188658', 'JP', 'kr.co.infraware.polarisoffice', 'ポラリスオフィス 5 (POLARIS Office 5)', 'http://a639.phobos.apple.com/us/r30/Purple/v4/37/de/ef/37deef0d-5a08-bba3-140c-b51480bfd40a/mzl.zowdgzox.53x53-50.png', 'http://a1507.phobos.apple.com/us/r30/Purple/v4/37/de/ef/37deef0d-5a08-bba3-140c-b51480bfd40a/mzl.zowdgzox.75x75-65.png', 'http://a1984.phobos.apple.com/us/r30/Purple/v4/37/de/ef/37deef0d-5a08-bba3-140c-b51480bfd40a/mzl.zowdgzox.100x100-75.png', '1300.00000', 'JPY', 'Infraware Co.,Ltd', 'iOS_Apps', '6000', 'topgrossingipadapplications', 0, 'POLARIS Office 5 通常セール価格 ￥2,000 -> ￥1,300(35%) \n\n* 文書編集機能と Microsoft Office との高い互換性を実現し、文書の読み込み速度が向上した POLARIS Office 5を今すぐ体験してください。\n\nPOLARIS Office 2013年、ビジネスカテゴリー68ヶ国の1位を達成！\n\n- 外国メディアの記事 – \n- 移動時間にMS Officeの文書を閲覧・編集するのに最適なソリューションは POLARIS Office」\n- iPad向けの生産性アプリの中で最も堅固でリーズナブルなPOLARIS Office」\n- 「最も進んだ編集技術を持つモバイルソリューションである POLARIS Office」\n\n■ POLARIS Office 5とは \nPOLARIS Office 5は強力な文書編集機能をベースでiPhone/iPadでの優れた Microsoft Office の互換性を誇る最高のモバイルオフィスソリューションです。このようにモバイルでの使用を考慮してメールの添付ファイルをすぐに開き、クラウドストレージとの連携、ファイルマネジャー機能など、便利な付加機能もご提供します。 \n\n■ POLARIS Office 5の長所 \nMicrosoft Office との高い互換性\n500以上の強力な編集機能 \n300以上のスピーディなデータ分析及び文書の読み込み速度\n様々なクラウドサポート \n華やかなプレゼンテーション\nシンプルで洗練されたデザイン \n\n■ POLARIS Office 5の主要機能 \nMicrosoft Office 文書閲覧及び編集 / PDF、HWP 文書閲覧\n様々なクラウドストレージとの連携(Dropbox、Box、WebDAV等) \n15種類のテンプレート / 20種類の 2D/3D チャート / 173種類の様々な図形 / 300以上の関数及びデータの自動計算 \n条件付き書式、ピボットテーブル閲覧 / シート編集に適した構成のCustom Keyboard をご提供 \n37種類の画面切り替えの効果適用及び編集 / オブジェクトアニメーション閲覧 \nスライドショー専用のポインター及びメモ / スライドノート  \nヘッダー、フッター、後注、脚注の追加及び編集 / ルーラー機能 \n撮ってすぐに文書に適用できるカメラモード / 動画挿入及びプレイ / Zip ファイルすぐに展開 \n\n■ サポートデバイス及び要求事項 \niPhone、iPad、iPod touchとの互換 / iOS 7 以上 \n\n■ サポート形式 \n編集 (doc/docx、xls/xlsx、ppt/pptx、txt) / 閲覧 (pdf、hwp) \n\n■ サポート言語 \nメニューサポート言語 (韓国語、英語、日本語、簡体字中国語、繁体字中国語、ドイツ語、フランス語、スペイン語、ヘブライ語) / 入力サポート言語 (iOSでサポートするほとんどの言語) \n\n■ オンラインチャネル\n製品のサイト : http://www.polarismobile.com/jpn/\nブログ : http://polarisoffice.co.jp/ \nFacebook : https://www.facebook.com/polarisofficejp  \nTwitter :  https://twitter.com/PolarisOfficejp', '2012-05-19 12:05:52', '2014-05-23 15:05:08')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:05:10 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('302955766', 'JP', 'com.weathernews.weather', 'ウェザーニュース タッチ', 'http://a1884.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.53x53-50.png', 'http://a400.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.75x75-65.png', 'http://a781.phobos.apple.com/us/r30/Purple4/v4/43/2d/81/432d8173-ed88-6ebb-5f30-b6079b68f69d/mzl.xvbzvfbu.100x100-75.png', '0.00000', 'JPY', 'Weathernews Inc.', 'iOS_Apps', '6001', 'topgrossingipadapplications', 0, 'ようこそ、みんなで作る天気予報の世界へ！\n\nウェザーニュースタッチは、天気・季節・減災などの専門気象情報はもちろん、 いまこの瞬間のリアルタイムの空がわかる究極の天気予報アプリ（無料）です。\n \n全国600万人のウェザーリポーターから送られてくるリポートによって、 刻々と変わる「空の様子」や、周辺の人々の「体感」が手に取るようにわかります。 また、「ソラサーチ」という機能を利用すれば、 今あなたがいる場所に今後降ってくる雨の影響を 現地のリポートを元に詳細に知ることができます。\n 天気予報の精度は､観測データの量によって決まります｡ みなさんから寄せられる膨大な数のウェザーリポートは､ これまで150年間大きく変わらなかった天気予報の精度向上に 大きな一歩を踏み出しています｡\n このように、ウェザーニュースタッチは、従来の天気予報の限界を超えて、 詳細で正確な天気予報をみんなのチカラで創る全く新しいアプリなのです。\n\n 【よくあるお問い合わせ】\n 多く頂いたご意見につきまして、設定方法をお知らせ致します。 もっと便利に・もっと楽しくウェザーニュースタッチをご活用ください。\n\n ◆常にONになっているGPS機能を停止するには？\n 　マイページのソラミッション通知設定や、スマートアラーム設定をOFFにすると、\n 　GPS機能を停止することができます。その場合、エリア限定で配信される災害情報など、\n 　各種通知サービスがご利用頂けなくなりますので、ご注意ください。\n\n ◆起動画面を「天気予報Ch.」（ピンポイント天気）にするには？\n 　１）「天気予報Ch.」をMyスクリーンに登録\n 　　起動時に表示したい画面を開き、ツールバーの「＋」をタップします \n　２）「AllCh.」から「MyCh.」を立ち上げます\n 　　「編集」から「起動時の画面を設定」をタップ。\n 　　表示したい画面の上部にある「HOME」をタップすることで設定いただけます。\n 　※この方法で、天気予報Ch.以外にもお気に入りのChを起動画面に設定することができます。\n\n ◆ツールバーに「MyCh.」を設定するには？ \n　１）ツールバーの一番右にある六角形のアイコンを長押しします。\n 　２）「MyCh.」と「TOPのソラピース」のアイコンが表示されます。\n 　 　　「MyCh」アイコンを選択すると、ツールバーに「MyCh.」を設定できます。\n\n 【究極の天気予報アプリ】\n ウェザーニュースタッチには、定番の気象メニューが充実。 気象のエキスパート４００名が支えるお天気サイトの決定版です。\n ◆全２５チャンネルがあなたの生活を全力サポート\n 　▼ALL Ch.\n 　・今日明日週間の天気（天気予報、１０分天気予報）\n 　・気象災害対策Ch（地震、津波、台風、ゲリラ雷雨、警報注意報など）\n 　・専門気象Ch（雨雲レーダー、衛星、天気図、ライブカメラなど）\n 　・季節情報Ch（星空、さくら、花粉、花火、紅葉、スキー＆スノボ）\n 　・24時間生放送で天気を伝える動画番組Ch（SOLiVE24）\n◆スマートアラーム(通知サービス)\n 　スマートアラームの設定をONにしておくだけで、GPSによる位置情報をもとに、\n 　今いる場所の最新の気象情報を入手できます。\n 　 　(なお、バックグラウンドで位置情報(GPS)の利用は、バッテリーの消費量が大きくなる場合がありますのでご注意ください。)\n ◆ウェザーニュース会員（有料）登録について \n　スマートアラームやソラトモ機能など有料オプションの機能をご利用頂くには、「ウェザーニュース会員」（有料）をアプリケーション内でご購入手続きください。\n 　会員登録はご購入頂いた期間有効です。期間内に追加購入頂きますと、その期間分が加算されます。\n 　期間途中での解約に際し、返金は致しかねますのでご了承ください。\n 　自動更新にて、「ウェザーニュース会員」をご利用いただいている方へ\n - １ヶ月ごとの自動更新となります。\n - 月額 300 円です。\n - お支払いは iTunes よりご利用いただきます。\n - 現在有効期間満了の少なくとも24時間以上前に、自動更新を停止しない限り、自動的に更新されます。\n - ご購入後、[設定] - [iTunes Store/App Store] - [Apple ID] - [購読] の項目より、いつでも自動更新を停止していただくことができます。\n - 期間の途中で自動更新を停止していただいても、残りの有効期間については引き続きお使いいただけます。\n - 他のお支払い方法により、有効な期間が残存しているときに、新規に自動更新をご登録いただいた場合は、その残存期間については無効とさせていただきます。ご注意ください。', '2009-01-24 07:26:15', '2014-05-23 15:05:09')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:05:13 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('657795287', 'JP', 'com.square-enix.dqxtools', 'ドラゴンクエストⅩ　冒険者のおでかけ便利ツール', 'http://a564.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.53x53-50.png', 'http://a1080.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.75x75-65.png', 'http://a805.phobos.apple.com/us/r30/Purple/v4/da/01/30/da013058-4c10-e3f2-a433-7c51b77e73f5/mzl.ahuqhfny.100x100-75.png', '0.00000', 'JPY', 'SQUARE ENIX INC', 'iOS_Apps', '6002', 'topgrossingipadapplications', 0, '================================\nドラゴンクエストⅩプレイヤー専用アプリです\n================================\n\n\n※※　はじめにご確認ください　※※ \nお使いの端末が以下のいずれかに当てはまる場合、アプリが正常に動作しない場合がございます。 \n\n・OSのバージョンが古い端末の場合\n・改造端末の場合\n・以下のような解析がされた端末の場合\n ---ソフトウェアの改造 \n ---ルート化等を含む解析\n ---リバースエンジニアリング\n ---逆コンパイル、または逆アセンブル　等\n\n\n【ご利用いただける機能】 \n『ドラゴンクエストⅩ』の世界をより一層お楽しみいただける『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』です！ \nこのアプリには、ゲームをしていないおでかけ先でも使える「ちょっと便利な機能」が搭載されています。 \n\n\n■キャラクター情報確認機能 \n自分のキャラクターの装備やパラメーターなどのプロフィール情報を確認できます。 \n\"サポート仲間雇われ情報\"やドラゴンクエストⅩ内でフレンド登録した相手キャラクターの状態が確認できる\"フレンド確認機能\"はもちろんのこと、その他にも、\"キャラクターの3D表示機能\"や、ドラゴンクエストⅩ内で所属しているチームの情報が確認できる\"チーム情報確認機能\"などの機能をお使いいただけます。 \n\n■郵便局機能 \n自分のフレンド宛てに手紙を送ることができます。また、郵便局に届いたお届け物も確認することができます。  \n\n■旅人バザー閲覧機能 \n「旅人バザー」に出品されているアイテムを条件をつけて検索したり、自分が出品しているアイテムの情報を確認することもできます。 \n\n■おしらせ確認機能 \nゲーム内での『ドラゴンクエストⅩ』運営スタッフからのお知らせを確認できます。\n\n■ライブカメラ \n「ドラゴンクエストⅩ」の世界がライブカメラ画像として映しだされます。画像は数十秒に一度更新されます。 \n\n■思い出アルバム \n「ドラゴンクエストⅩ」の世界で撮影した思い出アルバムの写真をおでかけ先で確認することができます。 \n\n\n■Ver2.0.1以降の新機能\n・チームクエスト閲覧機能の追加\n・元気チャージを元気玉に交換できる機能の追加\n・キャラクターの持ち物を確認できる機能の追加\n・ゴールド銀行からのゴールドの引き出し、預け入れができる機能の追加\n・郵便箱の手紙、アイテム、ゴールドを受け取る機能の追加\n・バザーの出品とりやめ機能の追加\n・プレミアムコンシェルジュ機能の追加\n\n\n≪プレミアムコンシェルジュについて≫\nプレミアムコンシェルジュでは以下のサービスがご利用いただけます。\n\n【こちらは有料のサービスになります】\n\n------------------------\n\n◆畑のお世話\nおでかけ便利ツール上から「ドラゴンクエストⅩ」内の畑に水をあげることができます。ご自身のキャラクター以外にフレンド、チームメンバー、自宅のご近所の方にも水をあげることができます。\n\n※畑のお世話機能に関しては「ドラゴンクエストⅩ」にログインした状態でもご利用いただけます。\n\n◆バザー落札\n旅人バザーに出品されているアイテムを、おでかけ便利ツールより落札することができます。\n\n◆バザー出品\n「ドラゴンクエストⅩ」内でお持ちのアイテムを、おでかけ便利ツール上から旅人バザーに出品することができます。\n\n◆元気玉をふくびき券に交換できるサービス\n「ドラゴンクエストⅩ」内でお持ちの元気玉・小元気玉・超元気玉を、元気玉の種類に応じた枚数のふくびき券に交換することができます。\n\n※ただし、一度に交換できるふくびき券は99枚です\n\n◆酒場サービス\nおでかけ便利ツール上からサポート仲間を雇うことができます。酒場サービスは町や村、キャンプ地、住宅村などフィールドやダンジョン以外の場所で「ドラゴンクエストⅩ」のゲームをログアウトしている場合にご利用いただけます。\n\n◆ふくびき所\nおでかけ便利ツール上から、「ドラゴンクエストⅩ」内でお持ちのふくびき券またはふくびき補助券を使用して、お好きな大陸のふくびき所をご利用いただけます。\n※「冒険者の便利ツール専用ふくびき所」もございます。\n\n------------------------\n\n\n≪ご注意≫\n\n※プレミアムコンシェルジュ機能をご利用の際には『ドラゴンクエストⅩ　冒険者のおでかけ便利ツール』上でのみ使用できる仮想通貨「ジェム」が必要となります。\n\n※ジェムはアプリ内のショップよりお買い求めいただけますが、初回サービスとして500ジェムをご利用のアカウント毎にプレゼントしております。また、毎日おでかけ便利ツールを起動するたびにもらえるデイリーボーナスもご用意しておりますので、無料でプレミアムコンシェルジュ機能をお使いいただくことも可能です。\n\n\n■お客様へのお願い\nお客様が「ドラゴンクエストⅩ」をよりお楽しみいただけるよう、本アプリの品質向上に努めておりますが、特定の端末でのみ発生する固有の不具合など原因調査が難しいものも多く、改善のためにお客様からの情報提供を必要としております。\n\nレビュー等の内容では原因特定に至らない場合も多いので、もし不具合が見つかりました際には、ぜひとも弊社サポートセンターまで詳細情報をご提供いただけますと幸いです。\n\n※アプリに関しての不具合やお問い合わせは\n　下記URLもしくはアプリ内からお問い合わせください。\n　スクウェア・エニックスサポートセンター\n　http://support.jp.square-enix.com/main.php?la=0&id=7901\n\n【使い方】 \n本アプリをご利用になるためには、「ドラゴンクエストⅩ　目覚めし五つの種族　オンライン」をオンラインモードでプレイしている「スクウェア・エニックス　アカウント」が必要です。 \n\nアプリを起動した後に、「はじめる」→「新しくキャラクターを登録」をお選びいただき、「スクウェア・エニックス　アカウント」を入力の上、「おでかけ便利ツール」に登録したいキャラクターを選択してください。 \n\n\n【ご注意】 \nおでかけ便利ツールに登録できるキャラクターは1キャラクターです。ただし複数キャラクターをお使いの方も、登録キャラクターを変更することで、おでかけ便利ツールをお使いいただけます。 \n　 \n登録しているキャラクターの変更をするためには、画面右上にある 「編集」ボタンを押し、キャラクター削除した後に再度キャラクター登録を行ってください。 \n\nまとめて複数キャラクターを登録しておきたい方のために、キャラクター登録チケットをアプリ内で販売いたします。一度このチケットをご購入いただければ、登録可能キャラクター数を最大限の10キャラクターまで増やせます。 \n\n【対応機種】 \niOS 5以上の機種 \n\n※OSのバージョンが古い場合、 \n　 正常に動作しない場合があります。 \n\n\n【非推奨機種】 \niPhone3GS \n\n※アプリが動かなくなった場合 \n　 バックグラウンドで起動しているアプリを \n　 完全に終了させて再度起動してください。 \n　 (操作方法についてはご使用の端末の \n　　マニュアル等をご参照ください。）', '2013-07-27 02:34:53', '2014-05-23 15:05:13')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:05:18 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('404970558', 'JP', 'jp.co.mapple.cotrip', 'ことりっぷ - 女性向け旅行ガイドブック 働く女性が週末に行く、２泊３日の小さな旅を提案します。', 'http://a1979.phobos.apple.com/us/r30/Purple4/v4/01/a0/dd/01a0ddb0-0bc0-bae9-53db-b6e88a0f22d2/mzl.hnnhdmtj.53x53-50.png', 'http://a495.phobos.apple.com/us/r30/Purple4/v4/01/a0/dd/01a0ddb0-0bc0-bae9-53db-b6e88a0f22d2/mzl.hnnhdmtj.75x75-65.png', 'http://a1676.phobos.apple.com/us/r30/Purple4/v4/01/a0/dd/01a0ddb0-0bc0-bae9-53db-b6e88a0f22d2/mzl.hnnhdmtj.100x100-75.png', '0.00000', 'JPY', 'Shobunsha Publications, Inc.', 'iOS_Apps', '6003', 'topgrossingipadapplications', 0, '・・・・・・・・・・・・・・・・・・・・・・ \n新緑の初夏おでかけキャンペーン\n新しい街・出会い、小さな贅沢　働く女性が週末に行く２泊３日の小さな旅を提案するガイドブック「ことりっぷ」の電子書籍アプリ\n\n・特別セール：2014年5月31日まで\n　　対象製品「各エリア版（香港・台北・ソウルを除く）」\n特別価格 800円⇒500円(300円OFF!) \n・・・・・・・・・・・・・・・・・・・・・・ \n新着情報\n(2014.4.14)『東急沿線さんぽ』を追加しました。\n(2014.4.1)期間限定無料版『JAL四国』を追加しました。（～2014年8月3日）\n\n【ご注意】\nディスクの容量不足によるiOSの容量確保処理やPCもしくはiCloudにバックアップしたものを復元をするなどにより本棚の本が消えることがございます。 \nこの場合、購入済みリストから購入した本を再ダウンロードしてください。(再課金は行われません)。 \n\n・・・・・・・・・・・・・・・・・・・・・・ \n\n「大人かわいい」テイストの誌面や表紙柄はそのままで、アプリならではのかわいさと、旅先で街歩きがもっとラクチンになる便利な機能をプラスしました。 \n\n『ことりっぷ』って? \n20~30代の働く女性をターゲットに\"等身大の旅\"を提案した昭文社発行の旅行ガイドブックです。女性を中心に絶大な支持を得て発行部数は900万部を超えました。そんな『ことりっぷ』が2012年春、4年ぶりにリニューアル。今回は読者の声を反映し、今もっとも女性におすすめのエリアやスポットを改めて紹介しています。好評の全エリア異なる表紙柄は、新たな柄で登場しました。 \n\n【おもな機能】 \n●誌面中の気になるスポットをタッチでさまざまなアクションができます \n誌面から関連する誌面への移動や、地図の表示はもとより電話の発信やルートの参照、スポットによってはHPの表示や宿の予約までできます \n\n●現在地の周辺情報やスポットまでの距離を表示します \nGPSで現在地を所得し、周辺スポットの誌面イメージやスポットリスト、周辺地図を表示します。また、誌面に現在地からの距離を表示することができます \n\n●シールを貼って行きたいスポットをリスト化します \nことりっぷならではのかわいいシールを誌面に貼ることができます。たとえば旅行前や移動中に気になるスポット、行きたいスポットにシールを貼って、スポットリストを作成。誌面もスポットも自分だけのことりっぷが作れます \n\n●本と同じ感覚でぱらぱらページをめくれます。 \n本の魅力はぱらぱらめくりながら興味のあるページを探すこと。そんな感覚がことりっぷアプリで実現しました \n\n●ことりっぷ表紙柄でフォトアルバムが作れます。 \nことりっぷと同じ表紙とオリジナルデザインの誌面台紙で、アプリのなかにフォトアルバムを作ることができます。シールや付箋などを貼って、お手製の思い出アルバムを作ってください。ステキなアルバムに仕上がったら、スクリーンショットを撮ってともだちと共有しましょう\n\n【対応機種】 \niPadシリーズ、iPad mini \niPhone5s、iPhone5c、iPhone5、iPhone4S、iPhone4、iPhone3GS \n※上記機種以外は非対応になります。\n\n【販売タイトル】 \n札幌・小樽／函館／富良野・美瑛／知床・阿寒／弘前／十和田・奥入瀬／\n仙台／角館・盛岡／会津・磐梯／日光・奥鬼怒／伊香保・草津／千葉・房総／\n東京／小笠原／横浜／横須賀・三浦半島／鎌倉／箱根／新潟・佐渡／河口湖・山中湖／\n軽井沢／安曇野／小布施・長野／金沢／飛騨高山／伊豆／静岡・浜松／名古屋／\n伊勢・志摩／滋賀・琵琶湖／京都／大阪／神戸／淡路島・鳴門／城崎温泉 出石・豊岡／\n奈良・飛鳥／南紀／松江・出雲／倉敷・尾道／広島・宮島／萩・津和野／香川 高松・小豆島／\n四国／福岡／長崎／由布院・黒川温泉／屋久島／沖縄／石垣・竹富・西表・宮古島／\n東京さんぽ／伊豆さんぽ／京都さんぽ／沖縄さんぽ／\nソウル／台北\n\n●販売価格について\n販売価格につきましては、変更になる可能性がありますので、\n必ず購入画面でご確認のうえ、ご購入をお願いいたします。', '2010-12-15 16:00:00', '2014-05-23 15:05:17')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
