ポート。重要な単語やイディオムについて約4万項目の音声を収録。\n\n- 項目数:約10万2千項目\n- 音声データ:約4万項目\n\n◎ ウィズダム和英辞典 第2版\n\n自然な英文を書き、英語による総合的な発信をサポートするための上級和英辞典、待望の改訂第2版。語の選択、文章の組み立て、模範例の提示という3つの面から、実際の英文作成を支援。項目数約9万、用例数約8万4千と増補。詳細な語法・類語解説のほか、まとまった文章を書くときに役立つ情報を満載。\n\n- 項目数：約9万項目\n- 用例数：約8万4千項目', '2012-12-29 16:00:00', '2014-05-23 15:05:22')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
