用\n- Evernote を最大限に活用するには、お使いのすべてのコンピュータとモバイル端末にダウンロードして下さい。\n\nNew York Times 「必須アプリトップ 10」選出、TechCrunch Crunchies、Mashable Awards、Webbys 受賞', '2008-07-11 16:00:00', '2014-05-23 15:05:25')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:05:25 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('377298193', 'JP', 'com.apple.iMovie', 'iMovie', 'http://a799.phobos.apple.com/us/r30/Purple4/v4/61/5a/19/615a1941-d2b9-c204-797d-90a004e2eec1/mzl.uhrktare.53x53-50.png', 'http://a1315.phobos.apple.com/us/r30/Purple4/v4/61/5a/19/615a1941-d2b9-c204-797d-90a004e2eec1/mzl.uhrktare.75x75-65.png', 'http://a944.phobos.apple.com/us/r30/Purple4/v4/61/5a/19/615a1941-d2b9-c204-797d-90a004e2eec1/mzl.uhrktare.100x100-75.png', '500.00000', 'JPY', 'Apple', 'iOS_Apps', '6008', 'topgrossingipadapplications', 0, 'ストーリーを伝えるために必要な操作を、すべて指先で行うことができるiMovie。美しく洗練されたインターフェイスとマルチタッチジェスチャーで、あなたのビデオをこれまでにないほど楽しめます。ビデオライブラリをチェックする。みんなと思い出をすばやく共有する。美しいハイビジョンムービーやハリウッド映画のような予告編を作成する。すべてが思いのまま。さらにiCloudを使えば、あなたが持っているすべてのデバイスのiMovie Theaterでそれらを楽しむことができます。\n\nビデオをすばやく探して共有しよう\n• ビデオライブラリをフルスクリーンのビデオブラウザで楽しめます。\n• クリップ全体や一部分を抜き出して簡単に共有できます。\n• シンプルな再生コントロールを使って、クリップをスローモーションや早送りでレビューできます。\n• お気に入りの瞬間に印をつけておけば、あとで簡単に見つかります。\n\nハリウッド映画のような予告編をつくろう\n• 14種類の予告編テンプレートから、圧倒的に美しいグラフィックスや、世界的に有名な映画音楽の作曲家が手がけたオリジナルの楽曲が選べます。\n• 映画スタジオのロゴ、キャスティング、クレジットはアウトラインでカスタマイズできます。\n• 絵コンテのアニメーションドロップゾーンを使えば、予告編にぴったりのビデオや写真を選べます。\n• あなたのライブラリにあるコンテンツや、新しく録画した映像を直接予告編に追加できます。\n\n美しいHDムービーを作成できます\n• タイトル、トランジション、音楽を組み合わせた、8種類のオリジナルテーマから選べます。\n• あなたのライブラリにあるビデオや写真を追加することも、撮影した映像をそのままタイムラインに組み込むこともできます。\n• スローモーション、早送り、ピクチャ・イン・ピクチャ、画面分割エフェクトを使ってムービーに磨きをかけることができます。*\n• 内蔵された音楽やサウンドエフェクト、iTunesライブラリにある曲、あなたがGarageBandで録音した曲、あなた自身のナレーションなどを使って、サウンドトラックを制作できます。\n• トリミング、分割、複製、フェードといったパワフルなオーディオコントロールを使って、音楽やサウンドエフェクトを微修正できます。\n\n好きな場所でiMovie Theaterを楽しもう\n• クリップ、ムービー、予告編をみんなと共有して、iMovie Theaterを美しいポスターでいっぱいにしましょう。\n• ポスターをクリックするだけで全画面表示になります。\n• iCloudを使えば、あなたのどのデバイスからでもiMovie Theaterにアクセスできます。\n• Apple TVがあれば、あなたのハイビジョンテレビでiMovie Theaterを楽しめます。\n\nウェブで、自宅で、友だちと共有\n• メールやメッセージで共有できます。\n• iMovieから直接ビデオをYouTube、Facebook、Vimeo、CNN iReportに公開できます。\n• AirPlayを使うと、Apple TV経由でハイビジョンテレビにワイヤレスでストリーミングできます。\n• ビデオクリップや編集できるiMovieプロジェクトは、AirDropで友だちに送ることができます。\n\nAirPlayは第2世代以降のApple TVに対応しています。\nAirDropはiPhone 5以降、iPad（第4世代以降）、iPad mini以降、iPod touch（第5世代）で利用できます。iCloudアカウントが必要です。\n\n* 2 倍速の早送りは、iPhone 5s、iPad Air、およびiPad mini Retinaディスプレイモデルで利用できます。', '2010-06-24 16:00:00', '2014-05-23 15:05:25')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:05:29 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('372332300', 'JP', 'jp.co.sankei-digital.YOPViewer.hd', '産経新聞HD', 'http://a1792.phobos.apple.com/us/r30/Purple/v4/ab/38/5e/ab385e57-7928-7d9f-39d9-a9d7562e1725/mzl.icgvolhy.53x53-50.png', 'http://a308.phobos.apple.com/us/r30/Purple/v4/ab/38/5e/ab385e57-7928-7d9f-39d9-a9d7562e1725/mzl.icgvolhy.75x75-65.png', 'http://a145.phobos.apple.com/us/r30/Purple/v4/ab/38/5e/ab385e57-7928-7d9f-39d9-a9d7562e1725/mzl.icgvolhy.100x100-75.png', '0.00000', 'JPY', '株式会社産経デジタル', 'iOS_Apps', '6009', 'topgrossingipadapplications', 0, '【美しい紙面画像】\n産経新聞などの紙面を、新聞そのままの体裁で、かつiPadならではの高精細な画面で、美しくご覧いただけるのが「産経新聞HD」です。\n\n【3カ月のバックナンバー＆切り抜き】\n過去3カ月分のバックナンバーもご利用いただけるほか、記事を切り抜いてアプリ内の「スクラップ帳」に保存することができます。\n\n【購読料】※4月1日以降も同額です\n購読料金は次のとおり(いずれも1カ月/自動更新型です)。\n\n・産経新聞(朝夕刊セット) 1,500円\n・フジサンケイビジネスアイ 900円\n・夕刊フジ 900円\n・SANKEI EXPRESS 900円\n\n▼産経朝刊は東京版、夕刊は大阪版となります\n▼産経新聞号外は、無料でご覧いただけます\n\n【1面だけなら無料】\nアプリケーションのインストールは無料。それぞれの一面だけでしたら毎日無料でご覧いただけます。\n\n【Appleの定期購読機能を使用】\n▼購読はAppleの自動更新型になっています\n▼月末月初にかかわらず、購読手続きをされた日から翌月の同日までの購読期間となり、これが自動的に更新されます\n\n▼最新紙面を取得しない場合は、「ストア」画面に戻ってください。あるいは「ストア」画面左上の「更新」ボタン(丸まった矢印のボタン)をタップしてください。\n\n▼いずれも自動更新の定期購読型課金です。お客さまご自身でApp Storeを通じて自動更新をキャンセルされない限り、課金は継続しますのでご注意ください。\n▼すでに購入済みなのに再度課金を求められる方は、アプリ右上の「メニュー」>「購読を復元」をタップして、「復元」処理を行なってください\n\n\n【特徴】\n・紙の新聞そのままのレイアウトで読めます。(一部、ご覧いただけない記事、ページもあります。ご了承ください)朝刊は毎朝午前5時、夕刊は午後5時をめどに新聞データを準備します。激虎につきましては、原則毎週水曜日の午前5時過ぎとなります(あくまで目安になります)。\n\n・全紙面のデータをダウンロードした後は、通信環境のない場所でも新聞を読めます(必ず全データを取得しておいてください。未取得データは、通信環境のない場所ではごらんいただけません。バックナンバーは、その都度紙面データを取得しますので、必ず通信環境下でお願いします)。\n\n・過去3カ月分のバックナンバーが読めます。\n\n・ダブルタップで段階的に拡大しますので、ピンチアウト、ピンチインでお好みのサイズに調整してください。2本の指で同時に画面をタップすると1段階ずつ縮小します。\n\n・ページをめくるには、左右端をタップしたり、ページをフリックして(指ではじいて)ください。\n\n・長押しにより記事の切り抜きができます。\n\n【ご利用環境等について】\n・紙面データのダウンロードは、3G/LTE回線でもできますが、Wi-Fi環境で行うことを推奨します。バックナンバー取得時も同様です。\n\n・アプリのバージョンをアップしたり、アプリを削除すると新聞データもなくなります。アップデート後は、通信の安定している場所で、再度紙面データを取得してください。\n\n・購読期間中は、なんらかの理由でアプリを削除されても、紙面購読の権利は継続されていますのでご注意ください。\n\n【休刊日等について】\n新聞の発行がない日は、更新はありません。夕刊フジは日曜のほか祝日や年末年始もお休みです。ご了承ください。', '2010-05-27 16:00:00', '2014-05-23 15:05:29')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:05:33 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('413487517', 'JP', 'jp.co.navitime.NAVITIMEdrive', 'NAVITIMEドライブサポーター -カーナビ＆渋滞情報-', 'http://a73.phobos.apple.com/us/r30/Purple4/v4/a4/52/c3/a452c310-ed4f-d807-908f-c16d9d2af959/mzl.omeriien.53x53-50.png', 'http://a589.phobos.apple.com/us/r30/Purple4/v4/a4/52/c3/a452c310-ed4f-d807-908f-c16d9d2af959/mzl.omeriien.75x75-65.png', 'http://a922.phobos.apple.com/us/r30/Purple4/v4/a4/52/c3/a452c310-ed4f-d807-908f-c16d9d2af959/mzl.omeriien.100x100-75.png', '0.00000', 'JPY', 'NAVITIME JAPAN CO.,LTD.', 'iOS_Apps', '6010', 'topgrossingipadapplications', 0, '2000万人※に使われているNAVITIMEのカーナビアプリ！！渋滞考慮ルートの音声ナビや駐車場の満空情報も検索できます。\nドライブサポーターがあれば、あなたのiPhoneがカーナビになります。\n【動画で見る】\nhttp://navi.tm/6wl28c8r/\n\n※当社サービス全体の月間ユニークユーザ数合計（2013年8月時点）\n\n旅行で気になる通行規制や渋滞などの交通情報は、1分間隔で更新されるリアルタイムの情報が確認可能で、渋滞や規制を迂回するルートを提案します。また、目的地の天気も一週間先まで確認できます。 \n\n■■お読みください■■\n=====================================\n■機種変更について\n機種変更前の会員情報を引き継いでご利用いただけます。\nアプリ内の「会員情報」メニューより復元ください。\n==================================== \n■無料おためしができるようになりました！\nNAVITIMEドライブサポーターの一部機能を初回だけ7日間無料でお試しいただけます。ドライブを安全・快適にサポートする機能が満載です、この機会に是非お試しください。\n◎アカウント画面から『7日間お試しキャンペーン』をご利用いただけます\n=====================================\n\n■■主な機能■■\n=====================================\n●詳細な地図表示\niOS6のマップアプリ連携にも対応しており、市外図の表示により建物名や形状、細街路、信号名まで表示可能です。また、ランドマークとなる主要店舗はアイコンで表示します。\n\n●駐車場検索\n全国約8万件の駐車場から現在地周辺や目的地周辺の駐車場を収容台数などの条件から探すことができます。\n\n●ガソリン価格がわかるガソリンスタンド検索\n全国約4万件のガソリンスタンドを現在地周辺や都道府県ごとにブランドや24時間営業などの条件から探せ、会員カードを利用したい時や深夜や早朝の給油の際も安心です。\n\n----以下、有料登録後にご利用いただけます----\n\n●ルート検索(渋滞情報も考慮します)\n有料道路優先、一般道路優先などの4ルートのほか、景観のよい区間が含まれる景観優先ルートも検索できます。VICSの渋滞/規制などの交通情報を考慮しているので、目的地までの所要時間を確認することもできます。 \n\n●音声案内/各種ガイド表示\n交差点や分岐点での音声による右左折の案内はもちろん、方面看板や進行レーンの3Dガイドも表示します。オービスに近づくと地図上で場所を表示し音声で案内します。\n\n●大型車ルート\n大型車を登録いただくと、大型車規制道路を避け他の大型車の通行実績のある道路や幹線道路を優先してルート検索します。\n\n●渋滞フルマップ\n全国の高速道路の交通情報を簡易地図上にリアルタイムに表示します。現在地の周辺から遠く離れた場所までフリースクロールで自由に見る事ができます。\n\n●スポットアイコン\n地図上にガソリン価格や駐車場の満車空車情報、ガソリン価格やTVで紹介されたスポットなどが表示され、タップすると詳細な情報も確認できます。また、別途年に6回の地図更新および、毎日のスポット情報の更新を行っています。\n\n●燃費の表示\nご利用の自動車の車種を設定いただくと、ルート検索をした際、ルートごとに消費ガソリン量やガソリン料金、燃費が表示されます。\n------------------------------------- \n【有料登録について】 \n\n■定期購読 \n400円(税込)/月 \n・このコースは自動継続課金機能(Auto Renewable Subscription)を利用しています。 \n・「利用規約に同意する」ことで、料金がiTunesアカウントに課金され、ルート検索等の機能をご利用頂けます。 \n・自動更新される際の課金は、有効期間終了の24時間前から終了までの間に行われます。1ヵ月の料金は400円です。 \n・自動更新の解除/設定は、「設定」⇒「Store」⇒「Apple ID」⇒「購読 管理」⇒「自動更新」で変更できます。 \n・有効期間終了の24時間以上前に、「設定」から自動更新をオフ」にすると、自動更新を停止することができます。 \n\n■チケット購入 \n利用期間に応じて以下の2コースから選べます。(全て税込) \n・180日 (1,900円) \n・365日 (3,500円) \n------------------------------------- \n\n■検索できるスポットカテゴリ\n※周辺のスポットも検索できます\nGS(ガソリンスタンド), 駐車場, 道の駅, カフェ, コンビニ, ファミレス, ホテル, 旅館, ホームセンター, ショッピングモール, ファーストフード, ラーメン, 寿司/回転寿司, 牛丼/丼物, ゴルフ場, 焼肉, 薬局(ドラッグストア), クリーニング/コインランドリー, 100円ショップ, SA(サービスエリア), PA(パーキングエリア), 温泉, レジャー施設, アウトレットモール, 観光地, 温泉, 病院, 内科, ペンション, カー用品, つり(釣堀), 市役所,電気自動車充電スタンド,ドライブスルー(他多数)\n\n■対応ハードウェア\niPhone3GS,iPhone4,iPhone4S,iPhone5/5C/5S,iPad 3Gモデル,iPadmini 3Gモデル\n※ユニバーサルアプリのため、iPadでも最適化された画面でご利用いただけます。\n※Wi-Fiモデルについては正常に動作しません\n\n■対応OS\n6.0以上\n\n■推奨環境\nハードウェア：iPhone5以上/iPad(第3世代)3Gモデル以上/iPad mini(第2世代) 3Gモデル\nOS：7.0以上\n\n■ご注意\n・最新のiOSでご利用ください、対応OSはVer6.0以上となります\n・iPod touch、iPad Wi-FiモデルなどGPS非搭載端末では正常に動作しません\n・アプリ起動中はシガーソケットにさしてのご利用をおすすめしています\n\n=====================================\n【NAVITIME IDが共通利用可能】\nスマートフォン向け｢NAVITIME｣アプリと｢PC-NAVITIME｣を、｢NAVITIME ID｣で共通にログインし、課金や登録情報を一元管理できるように会員システムをリニューアルしました。\n\n・ID発行/課金\nこれまでは、｢NAVITIME ID｣でのデバイスをまたがる有料機能利用は一部課金のみ可能でしたが、この度すべての決済手段でご利用いただけるようになりました。使用するデバイスやOSなどに関わらず、同一のサービスを｢NAVITIME ID｣で横断的にご利用が可能となります。 \n\n・アカウントの統合\n複数のサービスを同一の｢NAVITIME ID｣で管理するため、アカウントを統合することが可能です。有料課金をされれているお客様のみ設定が可能です。また、複数の対象サービスをご利用の場合対象アプリ内にて｢アカウント統合｣を行う事により情報を統合するができます。 \n\n◎詳しくは以下ページでご確認ください\nhttp://corporate.navitime.co.jp/topics/pr/201211/13_2223.html', '2011-02-28 16:00:00', '2014-05-23 15:05:33')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
