subscription......1,200 JPY \n* 6 month subscription......6,400 JPY \n* 1 year subscription........11,800 JPY \n***************************************** \n\nReuters Stock Report Pro turns you iPhone into a professional-quality equity information terminal, linking you to the markets wherever you are. \n\nAdvanced features include: \n\n* Live-updated company financials on all listed Japan stocks including REITs and ETFs \n* Consensus earnings estimates and analyst buy-sell ratings provided by Reuters \n* Scores of valuation and performance metrics for every stock \n* Quotes and charts updated throughout the trading day (20-min. delay) \n* Advanced screening system featuring hundreds of items \n* Save your own stock screens as well as use our set of pre-configured screens and ranking lists \n* Live-updated financial news from Reuters \n* Heat Map feature that lets you drill into market sectors and check performance at a glance \n* Stock ratings on all listed stocks based on growth, profitability, and valuation measures. \n* Save multiple portfolios and select items you want to display for each \n* Blazing speed so you can get right to the information you need when you need it \n* Data stored on your iPhone so you can use the system even when no internet connection available \n* Much more! \n\nReuters Stock Report Pro is simply the best way available to stay in touch with Japanese equity markets! Fast, simply, and comprehensive, it provides everything you need to keep you up to date with market information and valuable data on all the companies you are interested in.', '2012-03-03 02:39:00', '2014-05-23 15:05:41')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
