の速度で動画を楽しめます！\n※プレミアム会員のみ\n\n\n--------------------------------------\n■niconicoとは\n--------------------------------------\n日本最大級の動画サービスです。\n「ニコニコ動画」や「ニコニコ生放送」などの各種サービスからなる、コメントによる双方向コミュニケーションの一体感の中でコンテンツを視聴できるサービスです。\n\n◆ニコニコ動画とは\nWEBサイト上、もしくはアプリ内で再生される動画に、コメントを付けることができるサービスです。\nただ映像を見ているだけでは味わえない、面白さや楽しさを共有できます。\n動画のカテゴリは多岐にわたり、自らの歌声を収録した「歌ってみた」、ダンスを踊っているところを撮影した「踊ってみた」、料理や工作など創作的な内容の「作ってみた」、その他「ゲーム」「アニメ」「動物」などがあります。\n各カテゴリごとのランキングや総合ランキングなどから、人気の動画をすぐに見つけることができます。\n\n◆ニコニコ生放送とは\n生放送にリアルタイムでコメントを付けることができるサービスです。\nコメントによって放送者と視聴者のコミュニケーションが図れる、インタラクティブな楽しみ方ができます。\nアニメ一挙放送や、音楽、ゲーム、アイドル、政治等の放送を行う「公式生放送」「チャンネル生放送」、ユーザー自身が放送を行う「ユーザー生放送」があり、多い時には5,000を超える番組が同時に生放送されています。\nもちろん、どの番組でもリアルタイムにコメントができます。\n\nまた、iPhone/iPad/iPod touchから生放送の配信を行うことができます(プレミアム会員のみ)。\nPCに接続したウェブカメラとの切り替えカメラとして利用することもできます。\n\n\n--------------------------------------\n■プレミアム会員登録の仕組みについて \n--------------------------------------\n・プレミアム会員登録の価格と期間\n　700円(税込)/1ヶ月間(申し込み日から起算)/自動更新\n　6400円(税込)/1年間(申し込み日から起算)/自動更新\n\n・課金について\n　iTunesアカウントに課金されます。\n\n・自動更新の詳細\n　プレミアム会員期間の終了日の24時間以上前に自動更新を解除しない限り、会員期間が自動更新されます。\n　自動更新される際の課金については、会員期間の終了後の24時間以内に行われます。\n\n・プレミアム会員状況の確認方法と退会(自動更新の解除)方法\n　会員状況の確認と退会は下記ページから行うことができます。\n　[ App Store アプリ/おすすめページ最下部 → Apple ID/アカウントを表示 → 購読/管理 ]\n　次回の自動更新タイミングの確認や、自動更新の解除/設定をこの画面内で行うことができます。\n　※iTunesからも同様の確認や自動更新の解除/設定を行うことができます。\n　※本アプリ「niconico」からはお手続きできません。\n\n・当月分のキャンセルについて\n　プレミアム会員登録の当月分のキャンセルについては受けつけできません。\n\n\n--------------------------------------\n■注意事項\n--------------------------------------\n・本アプリはniconicoアカウントでご利用いただけます\n・アカウントをお持ちでない場合は、アカウントを取得してください\n・生放送について、視聴は全会員、配信はプレミアム会員のみ可能です\n・iOS5.0以降に対応\n\n※生放送の配信機能について\n・配信機能は3G/WiFiともに使用可能です', '2009-04-27 16:37:13', '2014-05-23 15:05:43')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
Error - 2014-05-23 15:05:45 --> Error - SQLSTATE[HY000]: General error: 1114 The table 'application_row_data' is full with query: "INSERT INTO `application_row_data` (`app_id`, `country_code`, `bundle_id`, `app_name`, `image_53`, `image_75`, `image_100`, `amount`, `currency`, `copyright`, `media_type`, `genre`, `category`, `ranking`, `description`, `release_date`, `create_datetime`) VALUES ('509071750', 'JP', 'com.newton-jp.newtonfornewsstand', 'Newton International Edition', 'http://a238.phobos.apple.com/us/r30/Purple4/v4/99/18/01/99180108-2233-00d3-c83c-d86d8c776d90/mzl.kwnwvudf.53x53-50.png', 'http://a1106.phobos.apple.com/us/r30/Purple4/v4/99/18/01/99180108-2233-00d3-c83c-d86d8c776d90/mzl.kwnwvudf.75x75-65.png', 'http://a1615.phobos.apple.com/us/r30/Purple4/v4/99/18/01/99180108-2233-00d3-c83c-d86d8c776d90/mzl.kwnwvudf.100x100-75.png', '0.00000', 'JPY', 'Newton Inc. Apps.', 'iOS_Apps', '6017', 'topgrossingipadapplications', 0, '******** 重要なお知らせ ********\n最新バージョンの Newton International Edition は，iOS6以降でご利用になれます。また，7月8日以降は，旧バージョンで記事のダウンロードができなくなりますので，アップデートをお願いいたします。ご不便をおかけし申し訳ありませんがよろしくお願いいたします。\n***\nアップデートを行うと，購入済の情報がリセットされる場合があります。その際は，お手数ですが「ライブラリ」画面右上の歯車マークをタップし，「すべての購入を復元する」を行ってください。\n********************************\n\n\n眼で見て,耳で聞いて,指でさわって楽しむことのできる,サイエンスマガジンがつくりたかった! それが,科学雑誌NewtonがiPad向けに創刊した「Newton International Edition」です。\n\n動画や音声, タッチ操作などをふんだんに取り入れながら, サイエンスを「なるほど!」と納得しながら, 楽しむためにiPad向けに特別に制作された, 待望のインタラクティブ・サイエンスマガジンです。\n\n-------\n特別増刊号『福島原発1000日ドキュメント』を刊行いたしました。発生から3年を迎えていまだに収束しない福島第一原発事故について、「あのときに何が起きたのか」「この3年間で何が行われてきたのか」をビジュアルに展開しています。原発のこれからを考える上での必携資料としてご活用ください。\n\n■ 福島第一原発の施設全体を3DCG化。制御棒の自動挿入による「原子炉の緊急停止」を動画で再現\n　科学雑誌『Newton』は、深刻な事故を起こした福島第一原発の施設全体を3DCGで再現しました。iPad版特別増刊号では、福島第一原発の施設全体を指でぐるぐるとまわしながら、くまなく観察することができます。\n　2011年3月11日午後2時46分、マグニチュード9.0の超巨大地震が発生し、福島第一原発を震度6強の強い揺れが襲いました。運転中だった1号機、2号機、3号機の原子炉は制御棒の自動挿入によって緊急停止しました。iPad版特別増刊号では、この緊急停止の様子がわかる動画が収録されています。\n\n■ 巨大津波の襲来からメルトダウンまでの一部始終を、動画とインタラクティブ・イラストで検証\n　地震によって送電鉄塔が倒壊し、配電設備も破壊されたことによって、各原子炉は外部電源を喪失し、非常用ディーゼル発電機が自動起動しました。そして、午後3時35分に襲来した巨大津波によって各原子炉建屋とタービン建屋が浸水し、非常用ディーゼル発電機も水没して機能を失いました。\n　こうしてすべての電源を失った1号機、2号機、3号機では、緊急停止後も熱を放つ核燃料の冷却手段が失われ、夜10時頃に恐れていた核燃料の溶融、すなわちメルトダウンが1号機ではじまりました。iPad版特別増刊号では、巨大津波の襲来と電源喪失、非常用冷却装置の停止、そしてメルトダウンへと至るまでの一部始終を動画で検証しています。\n\n■ 恐れていた「放射性物質の大量放出」が現実に。iPad版特別増刊号でその経緯が確認できます\n　1号機に続いて、2号機、3号機でも同様にメルトダウンが発生し、1号機、2号機、3号機の原子炉は破壊されて放射性物質が大量に放出されました。こうして発生した福島原発事故は、その後も事故を積み重ね、空・地下・海に放射性物質の漏洩汚染を続けています。\n　iPad版特別増刊号では、原子炉に閉じ込められていたはずの放射性物質が、いつ、どこから、どのようにして空・海・地下へと放出されたのかについて、その実態と実状を確認できます。\n\n＊ 『Newton International Edition』3月号の特集記事『過酷事故 連鎖の5日間 福島第一原発』は、特別増刊号『福島原発1000日ドキュメント』の一部を先行して掲載したものです。\n＊紙版のNewtonとは別に,iPad向けに制作したものです。\n\n--------\n\n■購読方法\n1号ごとの通常号の購入:500円(創刊号は無料)。\n1年間定期購読(自動継続):3000円。\n\n-自動継続は,購読期間終了の24時間以上前に自動更新設定をオフにすることで停止できます。\n-購読期間中は,期間の変更やキャンセルはできません。\n\n■記事の再ダウンロードについて\n各号をiPadから削除しても，一度購入した号は，何度でも無料で再ダウンロードすることができます。', '2012-05-16 16:00:00', '2014-05-23 15:05:45')" in /var/www/html/analozy/fuel/core/classes/database/pdo/connection.php on line 175
